t have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\nAdditional context: create array questions\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','C Programming','EASY',2,'gemini-2.5-flash','GEMINI','SUCCESS','```json\n[\n  {\n    \"question\": \"Which of the following is the correct way to declare an integer array named `grades` that can store 5 elements in C?\",\n    \"options\": [\n      {\"text\": \"int grades(5);\", \"is_correct\": false},\n      {\"text\": \"grades int[5];\", \"is_correct\": false},\n      {\"text\": \"int grades[5];\", \"is_correct\": true},\n      {\"text\": \"array int grades[5];\", \"is_correct\": false}\n    ],\n    \"explanation\": \"In C, an array is declared by specifying the data type of its elements, followed by the array name, and then the size of the array in square brackets. So, `int grades[5];` declares an integer array named `grades` with a capacity for 5 elements.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Given an integer array declared as `int values[10];`, what is the correct index to access the first element of the array?\",\n    \"options\": [\n      {\"text\": \"values[1]\", \"is_correct\": false},\n      {\"text\": \"values[0]\", \"is_correct\": true},\n      {\"text\": \"values.first\", \"is_correct\": false},\n      {\"text\": \"values[first]\", \"is_correct\": false}\n    ],\n    \"explanation\": \"In C, arrays use zero-based indexing. This means the first element of an array is always located at index 0, the second at index 1, and so on.\",\n    \"is_multiple_correct\": false\n  }\n]\n```',2,NULL,'2026-02-04 06:09:43.092522','2026-02-04 06:09:46.983953',1),(11,'Generate exactly 10 multiple choice questions about \"C Programming\".\n\nDifficulty Level: EASY - Questions should test basic understanding and recall.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\nAdditional context: create array questions\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','C Programming','EASY',10,'gemini-2.5-flash','GEMINI','SUCCESS','```json\n[\n  {\n    \"question\": \"How do you declare an integer array named `numbers` that can hold 5 elements in C?\",\n    \"options\": [\n      {\"text\": \"int numbers(5);\", \"is_correct\": false},\n      {\"text\": \"int numbers[5];\", \"is_correct\": true},\n      {\"text\": \"array numbers[5];\", \"is_correct\": false},\n      {\"text\": \"numbers int[5];\", \"is_correct\": false}\n    ],\n    \"explanation\": \"In C, arrays are declared using square brackets `[]` after the variable name to specify their size. `int numbers[5];` declares an integer array named `numbers` capable of holding 5 integer elements.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which of the following correctly initializes an integer array named `scores` with values 10, 20, and 30?\",\n    \"options\": [\n      {\"text\": \"int scores = {10, 20, 30};\", \"is_correct\": false},\n      {\"text\": \"int scores[3] = (10, 20, 30);\", \"is_correct\": false},\n      {\"text\": \"int scores[] = {10, 20, 30};\", \"is_correct\": true},\n      {\"text\": \"scores = {10, 20, 30};\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Arrays can be initialized using an initializer list enclosed in curly braces `{}`. When the size is omitted (e.g., `[]`), the compiler automatically determines the size based on the number of elements provided.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"If you have an array declared as `int arr[10];`, how would you access the third element of the array?\",\n    \"options\": [\n      {\"text\": \"arr[3]\", \"is_correct\": false},\n      {\"text\": \"arr(3)\", \"is_correct\": false},\n      {\"text\": \"arr[2]\", \"is_correct\": true},\n      {\"text\": \"arr.at(2)\", \"is_correct\": false}\n    ],\n    \"explanation\": \"C arrays use 0-based indexing, meaning the first element is at index 0, the second at index 1, and so on. Therefore, the third element is at index 2.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"For an array declared as `int data[7];`, what is the valid index range for its elements?\",\n    \"options\": [\n      {\"text\": \"1 to 7\", \"is_correct\": false},\n      {\"text\": \"0 to 7\", \"is_correct\": false},\n      {\"text\": \"1 to 6\", \"is_correct\": false},\n      {\"text\": \"0 to 6\", \"is_correct\": true}\n    ],\n    \"explanation\": \"An array of size N has valid indices from 0 to N-1. For an array of size 7, the indices range from 0 to 6.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which declaration correctly creates a character array (string) named `name` and initializes it with the string literal \\\"C Lang\\\"?\",\n    \"options\": [\n      {\"text\": \"char name = \\\"C Lang\\\";\", \"is_correct\": false},\n      {\"text\": \"string name = \\\"C Lang\\\";\", \"is_correct\": false},\n      {\"text\": \"char name[] = \\\"C Lang\\\";\", \"is_correct\": true},\n      {\"text\": \"char name[5] = \\\"C Lang\\\";\", \"is_correct\": false}\n    ],\n    \"explanation\": \"To declare and initialize a character array with a string literal, you use `char array_name[] = \\\"string_literal\\\";`. The compiler automatically allocates space for the characters plus a null terminator. `char name[5]` would be too small for \\\"C Lang\\\" (7 characters + null terminator).\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"If `int arr[5];` is declared, and an `int` typically takes 4 bytes on a given system, what would `sizeof(arr)` return?\",\n    \"options\": [\n      {\"text\": \"5\", \"is_correct\": false},\n      {\"text\": \"4\", \"is_correct\": false},\n      {\"text\": \"20\", \"is_correct\": true},\n      {\"text\": \"8\", \"is_correct\": false}\n    ],\n    \"explanation\": \"`sizeof(arr)` returns the total size in bytes occupied by the entire array. Since there are 5 integer elements and each integer takes 4 bytes, the total size is 5 * 4 = 20 bytes.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which loop structure is most commonly used to iterate through all elements of an array from the first to the last in C?\",\n    \"options\": [\n      {\"text\": \"do-while loop\", \"is_correct\": false},\n      {\"text\": \"for loop\", \"is_correct\": true},\n      {\"text\": \"if statement\", \"is_correct\": false},\n      {\"text\": \"goto statement\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The `for` loop is ideal for iterating through arrays because it allows for easy initialization of a counter, a clear termination condition (e.g., `i < array_size`), and an increment step.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What happens if you try to access an array element using an index that is outside its declared bounds in C?\",\n    \"options\": [\n      {\"text\": \"A compile-time error\", \"is_correct\": false},\n      {\"text\": \"A run-time error that always crashes the program\", \"is_correct\": false},\n      {\"text\": \"Undefined behavior\", \"is_correct\": true},\n      {\"text\": \"The program automatically resizes the array\", \"is_correct\": false}\n    ],\n    \"explanation\": \"C does not perform bounds checking on arrays at runtime. Accessing an element outside the array\'s declared bounds results in undefined behavior, which can lead to crashes, incorrect data, or other unpredictable program behavior.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"How do you declare a 2D integer array named `matrix` with 3 rows and 4 columns?\",\n    \"options\": [\n      {\"text\": \"int matrix(3,4);\", \"is_correct\": false},\n      {\"text\": \"int matrix[3,4];\", \"is_correct\": false},\n      {\"text\": \"int matrix[3][4];\", \"is_correct\": true},\n      {\"text\": \"int matrix[][] = {3,4};\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Multi-dimensional arrays in C are declared by using multiple sets of square brackets. `int matrix[3][4];` declares a 2D array with 3 rows and 4 columns.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which of the following is a correct way to declare a function `printArray` that accepts an integer array `arr` and its size `n` as parameters?\",\n    \"options\": [\n      {\"text\": \"void printArray(int arr, int n)\", \"is_correct\": false},\n      {\"text\": \"void printArray(int arr[], int n)\", \"is_correct\": true},\n      {\"text\": \"void printArray(int arr[n], int n)\", \"is_correct\": false},\n      {\"text\": \"void prin