\"text\": \"display()\", \"is_correct\": false},\n      {\"text\": \"printf()\", \"is_correct\": true},\n      {\"text\": \"write()\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The `printf()` function, part of the standard input/output library (`stdio.h`), is the most commonly used function for formatted output to the console in C.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Every C program must have a special function from where its execution begins. What is the name of this function?\",\n    \"options\": [\n      {\"text\": \"start()\", \"is_correct\": false},\n      {\"text\": \"run()\", \"is_correct\": false},\n      {\"text\": \"main()\", \"is_correct\": true},\n      {\"text\": \"execute()\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The `main()` function is the entry point of every C program. Execution always begins from the first statement inside the `main()` function.\",\n    \"is_multiple_correct\": false\n  }\n]\n```',3,NULL,'2026-02-04 06:13:03.937303','2026-02-04 06:13:07.439325',1),(14,'Generate exactly 5 multiple choice questions about \"Java\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','Java','MEDIUM',5,'gemini-2.5-flash','GEMINI','SUCCESS','```json\n[\n  {\n    \"question\": \"Consider the following Java code snippet:\\n\\n```java\\nclass Vehicle {\\n    public String getType() { return \\\"Generic Vehicle\\\"; }\\n}\\n\\nclass Car extends Vehicle {\\n    @Override\\n    public String getType() { return \\\"Car\\\"; }\\n    public String getBrand() { return \\\"Toyota\\\"; }\\n}\\n\\npublic class Test {\\n    public static void main(String[] args) {\\n        Vehicle myCar = new Car();\\n        System.out.println(myCar.getType());\\n        // What happens if we try to call myCar.getBrand();?\\n    }\\n}\\n```\\n\\nWhat is the output of `System.out.println(myCar.getType());` and what would happen if `myCar.getBrand();` were uncommented?\",\n    \"options\": [\n      {\"text\": \"Output: \\\"Generic Vehicle\\\". `myCar.getBrand();` would compile and run, printing \\\"Toyota\\\".\", \"is_correct\": false},\n      {\"text\": \"Output: \\\"Car\\\". `myCar.getBrand();` would compile and run, printing \\\"Toyota\\\".\", \"is_correct\": false},\n      {\"text\": \"Output: \\\"Car\\\". `myCar.getBrand();` would result in a compile-time error.\", \"is_correct\": true},\n      {\"text\": \"Output: \\\"Generic Vehicle\\\". `myCar.getBrand();` would result in a compile-time error.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Due to runtime polymorphism (method overriding), `myCar.getType()` calls the `getType()` method of the actual `Car` object, which returns \\\"Car\\\". However, `myCar` is declared as a `Vehicle` type. The compiler only knows about methods declared in the `Vehicle` class (and its superclasses). Since `getBrand()` is defined only in the `Car` class and not in `Vehicle`, calling `myCar.getBrand()` through a `Vehicle` reference will result in a compile-time error. To call `getBrand()`, `myCar` would need to be cast to `Car` type.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"You are writing a Java method that reads data from a file. This operation might throw an `IOException` (a checked exception). What is the most appropriate way to handle this exception if the method itself cannot fully recover from the error, but calling methods might be able to?\",\n    \"options\": [\n      {\"text\": \"Catch the `IOException` and print a stack trace, then continue execution.\", \"is_correct\": false},\n      {\"text\": \"Catch the `IOException` and return a default value or `null`.\", \"is_correct\": false},\n      {\"text\": \"Declare the method with `throws IOException` in its signature.\", \"is_correct\": true},\n      {\"text\": \"Wrap the `IOException` in a `RuntimeException` and throw it.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Declaring the method with `throws IOException` (option C) is the most appropriate strategy. This signals to calling methods that they must either handle the `IOException` themselves using a `try-catch` block or further propagate it. This adheres to Java\'s checked exception mechanism, ensuring that potential issues are explicitly addressed. Options A and B hide the error, which might lead to unexpected behavior later. Option D converts a checked exception to an unchecked one, which bypasses the compile-time check and can make error handling less explicit and harder to manage.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"A Java application needs to store a collection of unique user IDs (String type) and frequently perform checks to see if a particular ID already exists in the collection. The order of IDs is not important, and the application requires efficient storage and lookup. Which Java Collection Framework class is best suited for this scenario?\",\n    \"options\": [\n      {\"text\": \"ArrayList\", \"is_correct\": false},\n      {\"text\": \"LinkedList\", \"is_correct\": false},\n      {\"text\": \"HashSet\", \"is_correct\": true},\n      {\"text\": \"HashMap\", \"is_correct\": false}\n    ],\n    \"explanation\": \"`HashSet` is designed to store unique elements and provides O(1) (average case) time complexity for adding, removing, and checking for the presence of an element using its `contains()` method. This perfectly matches the requirement for storing unique user IDs and frequently checking for existence. `ArrayList` and `LinkedList` allow duplicate elements and have O(n) complexity for `contains()`. `HashMap` stores key-value pairs, which is not necessary if only unique IDs (keys) are needed, although a `HashMap` where values are dummy objects could technically work, `HashSet` is more semantically appropriate and efficient for this specific use case.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Consider a Java class with a method `public synchronized void updateCounter()`. If multiple threads attempt to call `updateCounter()` on the *same instance* of this class concurrently, what does the `synchronized` keyword primarily guarantee?\",\n    \"options\": [\n      {\"text\": \"It ensures that changes made by one thread to the counter variable are immediately visible to other threads.\", \"is_correct\": false},\n      {\"text\": \"It ensures that the entire method `updateCounter()` is executed as a single, atomic operation without interruption from other threads on the same object.\", \"is_correct\": true},\n      {\"text\": \"It allows multiple threads to execute the method concurrently as long as they are using different instances of the class.\", \"is_correct\": false},\n      {\"text\": \"It prevents the method from being re-entered by the same thread before its current execution completes.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The `synchronized` keyword on an instance method ensures mutual exclusion. This means that only one thread can execute a `synchronized` instance method (or a `synchronized` block on the same object\'s monitor) on a given object at any time. Option B correctly describes this, making the method\'s execution atomic with respect to other synchronized methods/blocks on the same object. While `synchronized` also ensures memory visibility (like option A), its primary guarantee for methods/blocks is mutual exclusion. Option C is true for different instances but doesn\'t describe the effect on the *same* instance. Option D describes reentrancy, which `synchronized` *allows* (a thread holding a lock can re-enter another synchronized block/method on the same object) rather than prevents.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which of the following statements accurately describes the usage and implications of the `final` keyword in Java?\",\n    \"options\": [\n      {\"text\": \"A `final` class can be extended by other classes, but its methods cannot be overridden.\", \"is_correct\": false},\n      {\"text\": \"A `final` method can be overridden by a subclass, but only if the subclass itself is declared `final`.\", \"is_correct\": false},\n      {\"text\": \"A `final` variable must be initialized exactly once, either at the point of declaration or within the constructor for instance variables, or within a static initializer block for static variables.\", \"is_correct\": true},\n      {\"text\": \"Once an object reference is assigned to a `final` variable, the object\'s internal state becomes immutable.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Option C is correct. A `final` variable, once initialized, cannot be reassigned. For instance variables, this initialization can occur at declaration or in the constructor. For static variables, it can be at declaration or in a static initializer. Option A is incorrect; a `final` class cannot be extended at all. Option B is incorrect; a `final` method cannot be overridden by any subclass. Option D is incorrect; `final` on an object reference means the *reference itself* cannot be changed to point to another object, but the object it points to can still be modified if it is mutable (e.g., `final ArrayList<String> list = new ArrayList<>();` allows `list.add(\\\"item\\\");`).\",\n    \"is_multiple_correct\": false\n  }\n]\n```',5,NULL,'2026-02-04 06:14:06.334316','2026-02-04 06:14:19.981550',1),(15,'Generate exactly 5 multiple choice questions about \"Full Stack Development\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','Full Stack Development','MEDIUM',5,'gemini-2.5-flash','GEMINI','SUCCESS','[\n  {\n    \"question\": \"A full-stack developer is building a new e-commerce platform. They need to store product catalogs with complex, nested attributes (e.g., color variants, size charts, material compositions) and user reviews that are frequently updated. Considering the need for flexible schema evolution and horizontal scalability for the product catalog, which database approach is generally most suitable?\",\n    \"options\": [\n      {\"text\": \"A highly normalized relational database (SQL) schema.\", \"is_correct\": false},\n      {\"text\": \"A key-value store like Redis for product details.\", \"is_correct\": false},\n      {\"text\": \"A document-oriented NoSQL database like MongoDB.\", \"is_correct\": true},\n      {\"text\": \"Storing product data directly in flat files on the server.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Document-oriented NoSQL databases are well-suited for data with complex, nested structures and evolving schemas, as they allow for flexible data models without rigid pre-defined tables. This makes them ideal for product catalogs where attributes might change or expand frequently. They also generally offer better horizontal scalability compared to traditional relational databases for such use cases.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"A full-stack team is developing a single-page application (SPA) using React for the frontend and Node.js for the backend. The frontend needs to retrieve a list of user profiles from the backend to display them. Which of the following is the most appropriate and secure method for the frontend to interact with the backend to get this data?\",\n    \"options\": [\n      {\"text\": \"The React frontend directly queries the backend database using SQL commands embedded in JavaScript.\", \"is_correct\": false},\n      {\"text\": \"The backend renders a full HTML page with the user data for every frontend request.\", \"is_correct\": false},\n      {\"text\": \"The frontend makes an HTTP GET request to a RESTful API endpoint (e.g., `/api/users`) which returns JSON data.\", \"is_correct\": true},\n      {\"text\": \"The frontend includes all user data as part of the initial HTML payload when the application first loads.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The most appropriate and secure method for a frontend SPA to retrieve data from a backend is through a well-defined API, typically a RESTful API. The frontend sends an HTTP GET request to a specific endpoint, and the backend responds with data in a format like JSON, which the frontend then processes and displays. Direct database queries from the frontend are a major security vulnerability and violate architectural principles. Rendering a full HTML page for every request is characteristic of traditional server-side rendering, not an SPA\'s typical data retrieval. Including all data in the initial payload is impractical for dynamic or large datasets.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"A full-stack developer has just committed changes to a Git repository for a web application. The company policy dictates that these changes should automatically run through a suite of tests, build the application, and then deploy it to a staging server. What full-stack practice is being described here?\",\n    \"options\": [\n      {\"text\": \"Load balancing\", \"is_correct\": false},\n      {\"text\": \"Microservices architecture\", \"is_correct\": false},\n      {\"text\": \"Continuous Integration/Continuous Deployment (CI/CD)\", \"is_correct\": true},\n      {\"text\": \"Object-Relational Mapping (ORM)\", \"is_correct\": false}\n    ],\n    \"explanation\": \"This scenario perfectly describes Continuous Integration/Continuous Deployment (CI/CD). Continuous Integration involves automatically building and testing code changes whenever developers commit them. Continuous Deployment extends this by automatically deploying the verified code to a staging or production environment. The other options are unrelated: Load balancing distributes traffic, microservices is an architectural style, and ORM is for database interaction.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"A full-stack application uses JWTs (JSON Web Tokens) for user authentication. After a user successfully logs in, the backend issues a JWT. What is the most common and secure way for the frontend to handle and utilize this token for subsequent authenticated API requests?\",\n    \"options\": [\n      {\"text\": \"Store the JWT in a server-side session variable.\", \"is_correct\": false},\n      {\"text\": \"Send the JWT as a query parameter in the URL for every API call.\", \"is_correct\": false},\n      {\"text\": \"Store the JWT securely (e.g., in `localStorage` or `httpOnly` cookie) and include it in the `Authorization` header of subsequent requests.\", \"is_correct\": true},\n      {\"text\": \"Re-request a new JWT from the backend for each API call to ensure freshness.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"For JWT-based authentication, the most common and secure practice is for the frontend to store the token (either in `localStorage` for accessibility by JavaScript, or an `httpOnly` cookie for better XSS protection) and then include it in the `Authorization` header (typically as a \'Bearer\' token) of all subsequent HTTP requests that require authentication. Storing in a server-side session defeats the stateless nature of JWTs. Sending in URL parameters is insecure (can be logged, exposed) and has length limits. Re-requesting a token for every call is inefficient and unnecessary.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"A full-stack team is developing a content-heavy news website. They are debating between building the frontend as a pure Client-Side Rendered (CSR) application (e.g., React with a REST API) or using a Server-Side Rendered (SSR) framework (e.g., Next.js). Which specific concern would most strongly advocate for choosing SSR over CSR in this context?\",\n    \"options\": [\n      {\"text\": \"Reducing the server\'s processing load by offloading rendering to the client\'s browser.\", \"is_correct\": false},\n      {\"text\": \"Simplifying client-side state management complexities across the application.\", \"is_correct\": false},\n      {\"text\": \"Improving initial page load performance and optimizing for search engine crawlers (SEO).\", \"is_correct\": true},\n      {\"text\": \"Enabling the website to function completely offline after the first visit.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"For content-heavy websites like news platforms, Server-Side Rendering (SSR) offers significant advantages in terms of initial page load performance and Search Engine Optimization (SEO). With SSR, the server sends fully rendered HTML to the browser, allowing for faster time-to-content and ensuring that web crawlers can easily index the content. CSR, while offering a rich user experience after initial load, often results in an empty HTML document initially, which can negatively impact SEO and perceived load times.\",\n    \"is_multiple_correct\": false\n  }\n]\n```',5,NULL,'2026-02-04 06:14:43.079227','2026-02-04 06:14:56.769263',1),(16,'Generate exactly 5 multiple choice questions about \"Data Structure\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','Data Structure','MEDIUM',5,'gemini-2.5-flash','GEMINI','SUCCESS','```json\n[\n  {\n    \"question\": \"A software system frequently needs to insert new elements into and delete existing elements from the middle of a collection. Which data structure would generally provide better average-case performance for these operations, assuming the position for insertion/deletion is already known?\",\n    \"options\": [\n      {\"text\": \"Array\", \"is_correct\": false},\n      {\"text\": \"Singly Linked List\", \"is_correct\": true},\n      {\"text\": \"Hash Table\", \"is_correct\": false},\n      {\"text\": \"Stack\", \"is_correct\": false}\n    ],\n    \"explanation\": \"While finding the position in a linked list is O(N), the actual insertion or deletion operation itself is O(1) after the position is known, as it only involves updating a few pointers. In contrast, an array requires shifting elements, leading to O(N) complexity for insertion/deletion in the middle.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"A task scheduler needs to process tasks based on their priority, always executing the highest-priority task next. New tasks can arrive at any time. Which data structure is most efficient for storing tasks to allow quick retrieval of the highest-priority task and efficient insertion of new tasks?\",\n    \"options\": [\n      {\"text\": \"Queue\", \"is_correct\": false},\n      {\"text\": \"Binary Search Tree\", \"is_correct\": false},\n      {\"text\": \"Max-Heap\", \"is_correct\": true},\n      {\"text\": \"Hash Table\", \"is_correct\": false}\n    ],\n    \"explanation\": \"A Max-Heap is ideal for implementing a priority queue. It allows for O(1) retrieval of the maximum (highest priority) element and O(log N) insertion or deletion of elements, making it highly efficient for this scenario.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"In a hash table that uses separate chaining for collision resolution, what is the primary consequence of a poorly designed hash function or a very high load factor?\",\n    \"options\": [\n      {\"text\": \"Increased memory consumption beyond initial allocation.\", \"is_correct\": false},\n      {\"text\": \"Significant degradation in average-case performance for search, insertion, and deletion operations.\", \"is_correct\": true},\n      {\"text\": \"The inability to store duplicate keys within the table.\", \"is_correct\": false},\n      {\"text\": \"A reduction in the total number of collisions.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"A poor hash function or a high load factor leads to more elements hashing to the same index, resulting in longer chains in separate chaining. Traversing these longer chains increases the time complexity for search, insertion, and deletion operations from an average of O(1) to potentially O(N) in the worst case, thus degrading performance.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"You have built a Binary Search Tree (BST) containing integer values. Which tree traversal algorithm would you use to print all the elements in non-decreasing (sorted) order?\",\n    \"options\": [\n      {\"text\": \"Pre-order traversal\", \"is_correct\": false},\n      {\"text\": \"In-order traversal\", \"is_correct\": true},\n      {\"text\": \"Post-order traversal\", \"is_correct\": false},\n      {\"text\": \"Level-order traversal\", \"is_correct\": false}\n    ],\n    \"explanation\": \"In a Binary Search Tree, an in-order traversal visits the left subtree, then the root, and then the right subtree. Due to the BST property (left child < root < right child), this specific order guarantees that the elements are visited in non-decreasing (sorted) order.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"For a graph representing a highly interconnected social network (many friendships between users), which representation would typically be more memory-efficient if the number of users (vertices) is large and the number of friendships (edges) is significantly less than V^2 (i.e., a sparse graph)?\",\n    \"options\": [\n      {\"text\": \"Adjacency Matrix\", \"is_correct\": false},\n      {\"text\": \"Adjacency List\", \"is_correct\": true},\n      {\"text\": \"Incidence Matrix\", \"is_correct\": false},\n      {\"text\": \"Edge List\", \"is_correct\": false}\n    ],\n    \"explanation\": \"For a sparse graph (where the number of edges E is much less than V^2), an Adjacency List representation (O(V+E) space) is generally more memory-efficient than an Adjacency Matrix (O(V^2) space) because it only stores information about existing edges, avoiding storage for non-existent connections.\",\n    \"is_multiple_correct\": false\n  }\n]\n```',5,NULL,'2026-02-04 06:16:30.427042','2026-02-04 06:16:46.047026',1),(17,'Generate exactly 5 multiple choice questions about \"DevOps\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','DevOps','MEDIUM',5,'gemini-2.5-flash','GEMINI','SUCCESS','[\n  {\n    \"question\": \"A software development team frequently faces issues with new features failing in production due to environmental inconsistencies and manual deployment errors. Which core DevOps principle, when effectively implemented, would most directly address these challenges?\",\n    \"options\": [\n      {\"text\": \"Strict separation of development and operations teams to specialize roles.\", \"is_correct\": false},\n      {\"text\": \"Implementing a robust manual testing phase after every code commit.\", \"is_correct\": false},\n      {\"text\": \"Automating the entire software delivery pipeline, including infrastructure provisioning and deployment.\", \"is_correct\": true},\n      {\"text\": \"Increasing the frequency of large, monolithic software releases to reduce overhead.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Automating the entire software delivery pipeline (Continuous Integration, Continuous Delivery, Infrastructure as Code) minimizes manual errors, ensures consistent environments, and allows for frequent, reliable deployments, directly addressing production failures due to inconsistencies and manual errors.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"An organization is struggling with long lead times for new feature delivery and high defect rates in production. They decide to adopt a \'shift-left\' approach as part of their DevOps transformation. Which of the following actions best exemplifies the \'shift-left\' principle in this context?\",\n    \"options\": [\n      {\"text\": \"Implementing comprehensive manual acceptance testing right before production deployment.\", \"is_correct\": false},\n      {\"text\": \"Focusing solely on performance testing once the application is in the staging environment.\", \"is_correct\": false},\n      {\"text\": \"Integrating automated security scans and unit tests into the development pipeline at the earliest stages.\", \"is_correct\": true},\n      {\"text\": \"Delaying bug fixes until the end of the release cycle to batch them efficiently.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The \'shift-left\' principle in DevOps advocates for performing activities like testing, security scans, and quality assurance earlier in the development lifecycle. Integrating automated security scans and unit tests early helps catch defects and vulnerabilities when they are cheaper and easier to fix, thus improving quality and reducing lead times.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"A company is expanding rapidly and needs to provision dozens of new server environments for different projects, each with specific configurations, multiple times a week. Manually configuring these servers is time-consuming and prone to errors. Which DevOps practice would provide the most efficient and consistent solution to this challenge?\",\n    \"options\": [\n      {\"text\": \"Implementing a dedicated team for manual server provisioning and maintenance.\", \"is_correct\": false},\n      {\"text\": \"Utilizing containerization technology without any configuration management.\", \"is_correct\": false},\n      {\"text\": \"Adopting Infrastructure as Code (IaC) to define and manage environments through version-controlled scripts.\", \"is_correct\": true},\n      {\"text\": \"Outsourcing all infrastructure management to a third-party vendor without internal control.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Infrastructure as Code (IaC) allows defining and managing infrastructure resources (like servers, networks, databases) using machine-readable definition files (scripts/templates) that are version-controlled. This enables automated, consistent, and repeatable provisioning of environments, directly addressing the challenge of rapid, error-prone manual configuration.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"A development team is practicing Continuous Integration (CI). They have automated builds, but developers often commit code that breaks the build, requiring significant time to debug and fix. What aspect of CI needs improvement to mitigate this specific issue effectively?\",\n    \"options\": [\n      {\"text\": \"Increasing the time between code merges to allow for more thorough manual review.\", \"is_correct\": false},\n      {\"text\": \"Implementing automated tests that run with every code commit and block merges if tests fail.\", \"is_correct\": true},\n      {\"text\": \"Reducing the frequency of code commits to avoid potential conflicts.\", \"is_correct\": false},\n      {\"text\": \"Assigning a dedicated \'build master\' to manually inspect all code before merging.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"A core practice of effective Continuous Integration is to run automated tests (unit, integration, etc.) on every code commit. If these tests fail, the commit should ideally be prevented from merging or immediately flagged, providing rapid feedback to the developer and preventing broken builds from propagating, thus ensuring the main branch remains stable.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"A company wants to achieve a state where any version of their application can be released to production at any time, with confidence and minimal manual effort. Which DevOps practice is primarily focused on enabling this \'release readiness\'?\",\n    \"options\": [\n      {\"text\": \"Maintaining a strict annual release cycle to ensure stability.\", \"is_correct\": false},\n      {\"text\": \"Relying heavily on manual quality assurance teams to perform final validation before each release.\", \"is_correct\": false},\n      {\"text\": \"Implementing Continuous Delivery, where code is always in a deployable state through an automated pipeline.\", \"is_correct\": true},\n      {\"text\": \"Developing all new features in isolated, long-lived branches that merge infrequently.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Continuous Delivery (CD) is the practice of ensuring that software can be released to production at any time. It involves maintaining an automated, reliable pipeline that builds, tests, and prepares code for release, making the deployment process low-risk and repeatable, thereby achieving \'release readiness\'.\",\n    \"is_multiple_correct\": false\n  }\n]',5,NULL,'2026-02-04 06:16:59.944527','2026-02-04 06:17:09.521197',1),(18,'Generate exactly 5 multiple choice questions about \"Python\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','Python','MEDIUM',5,'gemini-2.5-flash','GEMINI','SUCCESS','```json\n[\n  {\n    \"question\": \"What will be the output of the following Python code?\",\n    \"options\": [\n      {\n        \"text\": \"[1, 4, 9, 16, 25, 36, 49, 64, 81, 100]\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"[2, 4, 6, 8, 10]\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"[4, 16, 36, 64, 100]\",\n        \"is_correct\": true\n      },\n      {\n        \"text\": \"[1, 9, 25, 49, 81]\",\n        \"is_correct\": false\n      }\n    ],\n    \"explanation\": \"The list comprehension iterates through `numbers`, filters for even numbers (`x % 2 == 0`), and then squares those even numbers (`x**2`). The even numbers are 2, 4, 6, 8, 10, and their squares are 4, 16, 36, 64, 100 respectively.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Consider the following Python code:\\n```python\\ndata = {\\\"apple\\\": 3, \\\"banana\\\": 1, \\\"cherry\\\": 5, \\\"date\\\": 2}\\nfiltered_data = {k: v * 2 for k, v in data.items() if v > 2}\\nprint(filtered_data)\\n```\\nWhat will be the output?\",\n    \"options\": [\n      {\n        \"text\": \"{\'apple\': 6, \'cherry\': 10}\",\n        \"is_correct\": true\n      },\n      {\n        \"text\": \"{\'banana\': 1, \'date\': 2}\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"{\'apple\': 6, \'banana\': 2, \'cherry\': 10, \'date\': 4}\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"{\'apple\': 3, \'cherry\': 5}\",\n        \"is_correct\": false\n      }\n    ],\n    \"explanation\": \"The dictionary comprehension iterates through `data.items()`. It includes key-value pairs only if the value `v` is greater than 2. For these selected items, the value is multiplied by 2. The items satisfying `v > 2` are `(\\\"apple\\\", 3)` and `(\\\"cherry\\\", 5)`. Their values are then doubled to 6 and 10, resulting in `{\'apple\': 6, \'cherry\': 10}`.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What will be printed when the following Python code is executed?\\n```python\\ndef process_list(items, factor=2):\\n    new_items = []\\n    for item in items:\\n        if item % factor == 0:\\n            new_items.append(item * factor)\\n    return new_items\\n\\nmy_list = [1, 2, 3, 4, 5, 6]\\nresult = process_list(my_list, factor=3)\\nprint(result)\\n```\",\n    \"options\": [\n      {\n        \"text\": \"[6, 12, 18]\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"[3, 6]\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"[2, 4, 6, 8, 10, 12]\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"[9, 18]\",\n        \"is_correct\": true\n      }\n    ],\n    \"explanation\": \"The `process_list` function is called with `my_list` and `factor=3`. The loop iterates through `my_list`. The condition `item % factor == 0` (i.e., `item % 3 == 0`) is true for `item = 3` and `item = 6`. For these items, `item * factor` is appended to `new_items`. So, for `item = 3`, `3 * 3 = 9` is appended. For `item = 6`, `6 * 3 = 18` is appended. The function returns `[9, 18]`.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What will be the final output of the following Python code snippet?\",\n    \"options\": [\n      {\n        \"text\": \"Caught ZeroDivisionError\\nNo error occurred\\nFinally block executed\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"Caught ZeroDivisionError\\nFinally block executed\",\n        \"is_correct\": true\n      },\n      {\n        \"text\": \"Caught TypeError\\nFinally block executed\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"No error occurred\\nFinally block executed\",\n        \"is_correct\": false\n      }\n    ],\n    \"explanation\": \"The code attempts to divide 10 by 0, which raises a `ZeroDivisionError`. The `except ZeroDivisionError` block catches this specific error and prints \\\"Caught ZeroDivisionError\\\". The `else` block is skipped because an exception occurred. The `finally` block always executes, regardless of whether an exception occurred or was handled. Therefore, the output will be \\\"Caught ZeroDivisionError\\\" followed by \\\"Finally block executed\\\".\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What will be the output of the following Python code?\\n```python\\ns = \\\"Python Programming\\\"\\nresult = s[7:12].upper() + \\\" \\\" + s[:6].lower()\\nprint(result)\\n```\",\n    \"options\": [\n      {\n        \"text\": \"PROGRAM python\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"PROGR python\",\n        \"is_correct\": true\n      },\n      {\n        \"text\": \"GRAM python\",\n        \"is_correct\": false\n      },\n      {\n        \"text\": \"PROGRAMMING python\",\n        \"is_correct\": false\n      }\n    ],\n    \"explanation\": \"1. `s[7:12]` extracts the substring from index 7 (inclusive) up to index 12 (exclusive), which is \\\"Progr\\\".\\n2. `.upper()` converts \\\"Progr\\\" to \\\"PROGR\\\".\\n3. `s[:6]` extracts the substring from the beginning up to index 6 (exclusive), which is \\\"Python\\\".\\n4. `.lower()` converts \\\"Python\\\" to \\\"python\\\".\\n5. These two parts are concatenated with a space in between: \\\"PROGR\\\" + \\\" \\\" + \\\"python\\\".\\nThe final `result` is \\\"PROGR python\\\".\",\n    \"is_multiple_correct\": false\n  }\n]\n```',5,NULL,'2026-02-04 06:17:21.916040','2026-02-04 06:17:37.718169',1),(19,'Generate exactly 5 multiple choice questions about \"C Programming\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','C Programming','MEDIUM',5,'gemini-2.5-flash','GEMINI','SUCCESS','```json\n[\n  {\n    \"question\": \"Consider the following C code snippet:\\n\\n```c\\n#include <stdio.h>\\n\\nint main() {\\n    int arr[] = {10, 20, 30, 40, 50};\\n    int *ptr = arr;\\n    printf(\\\"%d\\\", *(ptr + 3));\\n    return 0;\\n}\\n```\\n\\nWhat will be the output of this program?\",\n    \"options\": [\n      {\"text\": \"10\", \"is_correct\": false},\n      {\"text\": \"30\", \"is_correct\": false},\n      {\"text\": \"40\", \"is_correct\": true},\n      {\"text\": \"50\", \"is_correct\": false}\n    ],\n    \"explanation\": \"In C, array names often decay to pointers to their first element. So, `int *ptr = arr;` makes `ptr` point to the first element of `arr`. Pointer arithmetic works by scaling the integer offset by the size of the data type it points to. `*(ptr + 3)` means \'dereference the address that is 3 integer sizes after the address `ptr` points to\'. This effectively accesses `arr[3]`, which has a value of 40.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Analyze the following C code:\\n\\n```c\\n#include <stdio.h>\\n\\nint main() {\\n    int i, j, count = 0;\\n    for (i = 0; i < 3; i++) {\\n        for (j = 0; j < 3; j++) {\\n            if (i == j)\\n                continue;\\n            count++;\\n        }\\n    }\\n    printf(\\\"%d\\\", count);\\n    return 0;\\n}\\n```\\n\\nWhat will be the final value printed by the program?\",\n    \"options\": [\n      {\"text\": \"9\", \"is_correct\": false},\n      {\"text\": \"6\", \"is_correct\": true},\n      {\"text\": \"3\", \"is_correct\": false},\n      {\"text\": \"0\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The outer loop runs for `i = 0, 1, 2`. The inner loop runs for `j = 0, 1, 2`. The `if (i == j) continue;` statement skips the `count++` when `i` and `j` are equal (i.e., for pairs (0,0), (1,1), (2,2)). In total, there are 3x3 = 9 iterations. Three of these iterations are skipped by the `continue` statement. So, `count` will be incremented 9 - 3 = 6 times.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Consider the following C program:\\n\\n```c\\n#include <stdio.h>\\n\\nvoid modifyValue(int x) {\\n    x = x * 2;\\n}\\n\\nvoid modifyPointer(int *x) {\\n    *x = *x * 2;\\n}\\n\\nint main() {\\n    int a = 5;\\n    int b = 10;\\n    modifyValue(a);\\n    modifyPointer(&b);\\n    printf(\\\"%d %d\\\", a, b);\\n    return 0;\\n}\\n```\\n\\nWhat will be the output of this program?\",\n    \"options\": [\n      {\"text\": \"5 10\", \"is_correct\": false},\n      {\"text\": \"10 20\", \"is_correct\": false},\n      {\"text\": \"5 20\", \"is_correct\": true},\n      {\"text\": \"10 10\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The `modifyValue` function receives `a` by value. This means a copy of `a` (which is 5) is passed to `x`. Changing `x` inside `modifyValue` does not affect the original variable `a` in `main`. So, `a` remains 5. The `modifyPointer` function receives the address of `b` (using `&b`). The `*x = *x * 2;` line dereferences the pointer `x` and modifies the value at that memory location, which is `b`. So `b` becomes 10 * 2 = 20. Therefore, the output will be `5 20`.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Given the following C code snippet:\\n\\n```c\\n#include <stdio.h>\\n\\nstruct Point {\\n    int x;\\n    int y;\\n};\\n\\nint main() {\\n    struct Point p1 = {10, 20};\\n    struct Point *ptr = &p1;\\n    printf(\\\"%d\\\", ptr->y);\\n    return 0;\\n}\\n```\\n\\nWhat will be the output of this program?\",\n    \"options\": [\n      {\"text\": \"10\", \"is_correct\": false},\n      {\"text\": \"20\", \"is_correct\": true},\n      {\"text\": \"Compilation error\", \"is_correct\": false},\n      {\"text\": \"Undefined behavior\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The code defines a struct `Point` with two integer members `x` and `y`. `p1` is an instance of this struct, initialized with `x=10` and `y=20`. `ptr` is a pointer to a `Point` struct and is made to point to `p1` using `&p1`. The `->` operator is used to access members of a struct when you have a pointer to that struct. `ptr->y` is equivalent to `(*ptr).y`, which accesses the `y` member of the `p1` struct. Therefore, it will print the value of `p1.y`, which is 20.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Consider the following C code using a preprocessor macro:\\n\\n```c\\n#include <stdio.h>\\n\\n#define SQUARE(x) x * x\\n\\nint main() {\\n    int a = 3;\\n    printf(\\\"%d\\\", SQUARE(a + 1));\\n    return 0;\\n}\\n```\\n\\nWhat will be the output of this program?\",\n    \"options\": [\n      {\"text\": \"16\", \"is_correct\": false},\n      {\"text\": \"9\", \"is_correct\": false},\n      {\"text\": \"7\", \"is_correct\": true},\n      {\"text\": \"10\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Preprocessor macros perform simple text substitution. When `SQUARE(a + 1)` is encountered, it is directly substituted with `a + 1 * a + 1`. Due to operator precedence, multiplication (`*`) is performed before addition (`+`). So, the expression becomes `a + (1 * a) + 1`. Substituting `a = 3`, this evaluates to `3 + (1 * 3) + 1`, which is `3 + 3 + 1 = 7`. To avoid this common issue, macro arguments should always be parenthesized: `#define SQUARE(x) ((x) * (x))`.\",\n    \"is_multiple_correct\": false\n  }\n]\n```',5,NULL,'2026-02-04 06:26:58.565001','2026-02-04 06:27:11.201838',1),(20,'Generate exactly 10 multiple choice questions about \"Python\".\n\nDifficulty Level: EASY - Questions should test basic understanding and recall.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','Python','EASY',10,'gemini-2.5-flash','GEMINI','SUCCESS','```json\n[\n  {\n    \"question\": \"Which of the following is the correct way to print \'Hello, World!\' in Python?\",\n    \"options\": [\n      {\"text\": \"print(\\\"Hello, World!\\\")\", \"is_correct\": true},\n      {\"text\": \"console.log(\\\"Hello, World!\\\")\", \"is_correct\": false},\n      {\"text\": \"printf(\\\"Hello, World!\\\");\", \"is_correct\": false},\n      {\"text\": \"System.out.println(\\\"Hello, World!\\\");\", \"is_correct\": false}\n    ],\n    \"explanation\": \"In Python, the `print()` function is used to output text to the console. The text to be printed is passed as an argument inside parentheses, typically enclosed in single or double quotes.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which symbol is used to denote a single-line comment in Python?\",\n    \"options\": [\n      {\"text\": \"//\", \"is_correct\": false},\n      {\"text\": \"/* */\", \"is_correct\": false},\n      {\"text\": \"#\", \"is_correct\": true},\n      {\"text\": \"--\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The hash symbol (`#`) is used in Python to start a single-line comment. Any text following \'#\' on the same line is ignored by the interpreter.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What is the correct way to assign the value 10 to a variable named \'x\' in Python?\",\n    \"options\": [\n      {\"text\": \"x == 10\", \"is_correct\": false},\n      {\"text\": \"x = 10\", \"is_correct\": true},\n      {\"text\": \"int x = 10\", \"is_correct\": false},\n      {\"text\": \"10 = x\", \"is_correct\": false}\n    ],\n    \"explanation\": \"In Python, the assignment operator `=` is used to assign a value to a variable. The variable name comes on the left and the value on the right.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which of the following data types is used to store whole numbers in Python?\",\n    \"options\": [\n      {\"text\": \"float\", \"is_correct\": false},\n      {\"text\": \"str\", \"is_correct\": false},\n      {\"text\": \"bool\", \"is_correct\": false},\n      {\"text\": \"int\", \"is_correct\": true}\n    ],\n    \"explanation\": \"The `int` (integer) data type in Python is used to represent whole numbers, positive or negative, without a fractional component.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What is the file extension for a Python script?\",\n    \"options\": [\n      {\"text\": \".txt\", \"is_correct\": false},\n      {\"text\": \".py\", \"is_correct\": true},\n      {\"text\": \".html\", \"is_correct\": false},\n      {\"text\": \".java\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Python script files are typically saved with the `.py` extension. This extension helps operating systems and code editors identify them as Python source code.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What will be the output of the following Python code?\\n`print(5 + 2 * 3)`\",\n    \"options\": [\n      {\"text\": \"21\", \"is_correct\": false},\n      {\"text\": \"11\", \"is_correct\": true},\n      {\"text\": \"17\", \"is_correct\": false},\n      {\"text\": \"13\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Python follows the order of operations (PEMDAS/BODMAS). Multiplication (`*`) is performed before addition (`+`). So, `2 * 3` is `6`, and then `5 + 6` is `11`.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which keyword is used to define a function in Python?\",\n    \"options\": [\n      {\"text\": \"function\", \"is_correct\": false},\n      {\"text\": \"func\", \"is_correct\": false},\n      {\"text\": \"def\", \"is_correct\": true},\n      {\"text\": \"define\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The `def` keyword is used in Python to define a new function. It is followed by the function name, parentheses for parameters, and a colon.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"How do you create an empty list in Python?\",\n    \"options\": [\n      {\"text\": \"list = {}\", \"is_correct\": false},\n      {\"text\": \"list = ()\", \"is_correct\": false},\n      {\"text\": \"list = []\", \"is_correct\": true},\n      {\"text\": \"list = new list()\", \"is_correct\": false}\n    ],\n    \"explanation\": \"In Python, square brackets `[]` are used to define a list. An empty list is created by simply using `[]`.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which of the following is used for conditional execution in Python?\",\n    \"options\": [\n      {\"text\": \"loop\", \"is_correct\": false},\n      {\"text\": \"switch\", \"is_correct\": false},\n      {\"text\": \"if\", \"is_correct\": true},\n      {\"text\": \"goto\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The `if` statement is used for conditional execution in Python. It executes a block of code only if a specified condition is true.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What is Python primarily known for?\",\n    \"options\": [\n      {\"text\": \"A low-level assembly language\", \"is_correct\": false},\n      {\"text\": \"A hardware description language\", \"is_correct\": false},\n      {\"text\": \"A high-level, general-purpose programming language\", \"is_correct\": true},\n      {\"text\": \"A database query language\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Python is widely recognized as a high-level, interpreted, general-purpose programming language, known for its readability and versatility across various domains.\",\n    \"is_multiple_correct\": false\n  }\n]\n```',10,NULL,'2026-02-06 07:44:44.544455','2026-02-06 07:44:52.968006',1),(21,'Generate exactly 20 multiple choice