: \"[1, 2, 3]\", \"is_correct\": false},\n      {\"text\": \"[10, 20, 30]\", \"is_correct\": false},\n      {\"text\": \"[1, 2, 3, 4]\", \"is_correct\": true},\n      {\"text\": \"An error will occur\", \"is_correct\": false}\n    ],\n    \"explanation\": \"When `modify_list` is called, `data_list` initially refers to the same list object as `my_list`. The `data_list.append(4)` operation modifies the original list in place. However, the line `data_list = [10, 20, 30]` rebinds the local variable `data_list` to a *new* list object within the function\'s scope. It does not affect `my_list` in the global scope, which still points to the original list that was modified by the `append` call.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Which of the following correctly defines a Python function that accepts an arbitrary number of positional arguments and keyword arguments, and prints them?\",\n    \"options\": [\n      {\"text\": \"def func(*args, **kwargs):\\n    print(args, kwargs)\", \"is_correct\": true},\n      {\"text\": \"def func(**kwargs, *args):\\n    print(args, kwargs)\", \"is_correct\": false},\n      {\"text\": \"def func(args*, kwargs**):\\n    print(args, kwargs)\", \"is_correct\": false},\n      {\"text\": \"def func(*args, kwargs):\\n    print(args, kwargs)\", \"is_correct\": false}\n    ],\n    \"explanation\": \"In Python, `*args` is used to collect an arbitrary number of positional arguments into a tuple, and `**kwargs` is used to collect an arbitrary number of keyword arguments into a dictionary. The correct order for these in a function signature is `*args` followed by `**kwargs` if both are present.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What will be printed by the following Python code block?\",\n    \"options\": [\n      {\"text\": \"Value: 10\\nValue: 20\", \"is_correct\": false},\n      {\"text\": \"Value: 20\\nValue: 10\", \"is_correct\": true},\n      {\"text\": \"Value: 10\\nValue: 10\