\"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What is the primary benefit of using a generator function in Python compared to a regular function that returns a list?\",\n    \"options\": [\n      {\"text\": \"Generators are always faster to execute than functions returning lists.\", \"is_correct\": false},\n      {\"text\": \"Generators allow for direct random access to elements.\", \"is_correct\": false},\n      {\"text\": \"Generators produce items one at a time and are memory-efficient for large sequences.\", \"is_correct\": true},\n      {\"text\": \"Generators can only be used with numeric data types.\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The primary benefit of generators is their memory efficiency. They produce items one at a time (lazy evaluation) and do not store the entire sequence in memory, which is crucial when dealing with very large or infinite sequences of data. Regular functions returning lists would create and store the entire list in memory before returning it. Generators do not support random access and are not inherently faster for all use cases, nor are they restricted to numeric types.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"Consider the following Python classes:\\n\\n```python\\nclass Animal:\\n    def speak(self):\\n        return \'Animal makes a sound\'\\n\\nclass Dog(Animal):\\n    def speak(self):\\n        return \'Woof!\'\\n\\nclass Cat(Animal):\\n    pass\\n\\ndog = Dog()\\ncat = Cat()\\n```\\n\\nWhat will be the output of `print(dog.speak() + \' \' + cat.speak())`?\",\n    \"options\": [\n      {\"text\": \"Woof! Animal makes a sound\", \"is_correct\": true},\n      {\"text\": \"Woof! Meow!\", \"is_correct\": false},\n      {\"text\": \"Animal makes a sound Animal makes a sound\", \"is_correct\": false},\n      {\"text\": \"AttributeError: \'Cat\' object has no attribute \'speak\'\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The `Dog` class overrides the `speak` method from its parent `Animal` class, so `dog.speak()` returns \'Woof!\'. The `Cat` class inherits from `Animal` but does not override `speak`, so `cat.speak()` calls the `speak` method from the `Animal` class, which returns \'Animal makes a sound\'. Concatenating these results in \'Woof! Animal makes a sound\'.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"What will be the output of the following Python code?\",\n    \"options\": [\n      {\"text\": \"Operation successful: 10\", \"is_correct\": false},\n      {\"text\": \"Operation failed: 0\", \"is_correct\": false},\n      {\"text\": \"Operation failed: division by zero\", \"is_correct\": true},\n      {\"text\": \"Finally block executed\\nOperation failed: division by zero\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The code attempts to perform `10 / 0`, which raises a `ZeroDivisionError`. This error is caught by the `except ZeroDivisionError as e:` block. Inside this block, `print(f\'Operation failed: {e}\')` is executed. The `else` block is skipped because an exception occurred. The `finally` block would execute regardless, but there is no `finally` block in this snippet. Therefore, only \'Operation failed: division by zero\' is printed.\",\n    \"is_multiple_correct\": false\n  },\n  {\n    \"question\": \"You want to dynamically import a module based on a string variable `module_name = \'math\'`. Which of the following is the correct way to do this in Python?\",\n    \"options\": [\n      {\"text\": \"import module_name\", \"is_correct\": false},\n      {\"text\": \"module = __import__(module_name)\", \"is_correct\": true},\n      {\"text\": \"module = import(module_name)\", \"is_correct\": false},\n      {\"text\": \"module = sys.modules[module_name]\", \"is_correct\": false}\n    ],\n    \"explanation\": \"The `__import__()` function is used for dynamic imports where the module name is a string. `import module_name` would try to import a literal module named 