INSERT INTO `coding_api_challenge` VALUES (1,'The Mirror of the Forgotten Scrolls-1','the-mirror-of-the-forgotten-scrolls-1','In the ancient library of Eclipsera, there is a mystical corridor known as the Hall of Scrolls.  Each scroll in the hall contains ancient inscriptions, and they are arranged in a single linear sequence along a conveyor belt.  The corridor is enchanted: if the scrolls form a perfect mirrored sequence, a magical mirror portal opens at the end of the hall. The librarian notices that the scrolls can only be examined one by one, moving forward along the belt. Your task, as the secret archivist, is to determine whether the sequence of inscriptions from start to end is exactly the same as from end to start, without breaking the scrolls apart or seeing more than one at a time. If the inscriptions match symmetrically, the portal will open. Otherwise, it remains closed forever. Hidden Technical Mapping  Each scroll is a node in a singly linked list.  The inscription on each scroll is the data in the node.  The task is to check whether the linked list forms a palindrome (reads the same forward and backward) without random access.','Each character separated by a space','print \"yes\" if the list is plaindrome, otherwise print \"no\"','- 1 <= Number of scrolls <= 10^5','- 1 <= Number of scrolls <= 10^5','R  A  D  A  R','yes','','','HARD',100,'linked_lists','',10,256,0,0,0,'2025-11-20 10:24:41.203074','2025-11-20 12:38:19.491346'),(2,'The Time-Reversal Courier Route','the-time-reversal-courier-route','A chain of one-way messengers forms a singly linked list. To send the final scroll back to the original sender, you must reverse the message chain so that every messenger points to the previous one (i.e., reverse the linked list). Hidden Technical Mapping Reverse a singly linked list iteratively (or recursively).','First line: N (number of messengers) \nSecond line: N space-separated values (node data)','Print the reversed list nodes in order separated by spaces or arrows.','0  N  10','Original A  B  C  D becomes D  C  B  A after reversal.','4\nA B C D','D C B A','','','MEDIUM',100,'linked_lists','',10,256,0,0,0,'2025-11-20 10:34:58.693402','2025-11-20 12:34:10.032388'),(3,'The Twin Mismatched Socks','the-twin-mismatched-socks','In a batch of socks, every ID appears exactly twice except for two IDs which appear once. Find the two unpaired sock IDs. Hidden Technical Mapping Use XOR partitioning technique: XOR all numbers to get x = a ^ b. Use a set bit of x to split numbers into two groups and XOR within groups to recover a and b.','First line: integer N (size of array)  even. \nSecond line: N space-separated integers.','Print the two unique IDs separated by a space (order doesn\'t matter).','2  N  10 Exactly two numbers appear once; others appear twice.','Two numbers 5 and 9 occur once.','6\n3 5 4 3 4 9','5 9','','','MEDIUM',100,'arrays','',10,256,0,0,0,'2025-11-20 11:14:33.772684','2025-11-22 11:38:04.263289'),(4,'The Mismatched Shoe','the-mismatched-shoe','In a factory, shoe IDs are recorded where every ID appears exactly twice except one mismatched shoe which appears once. Find that unique shoe ID. Hidden Technical Mapping Use XOR to find the single number in O(N) time and O(1) space.','First line: integer N (size of array)  N is odd. \nSecond line: N space-separated integers (shoe IDs).','Print the unique shoe ID.','1  N  10, N is odd IDs fit in 32-bit signed int','XOR of all numbers leaves 2, the one that appears once.','5\n5 7 2 7 5','2','','','EASY',100,'bit_manipulation','',10,256,0,0,0,'2025-11-20 11:25:10.461184','2025-11-20 12:33:48.347228'),(5,'The Missing Roll Number','the-missing-roll-number','In a class of N students, roll numbers from 1..N are assigned. One roll number is missing from the attendance list (array of size N-1). Find the missing roll number. Hidden Technical Mapping Use summation formula or XOR to compute the missing number in O(N) time and O(1) space.','First line: integer N \nSecond line: N-1 space separated integers (roll numbers)','Print the missing roll number (integer).','2  N  10 Roll numbers are unique and in range 1..N','Sum from 1..5 = 15, given sum = 1+2+4+5 = 12, missing = 3.','5\n1 2 4 5','3','','','EASY',100,'arrays','',10,256,0,0,0,'2025-11-20 11:43:53.489148','2025-11-22 11:37:08.231558'),(6,'The Circular Railway Track','the-circular-railway-track','Connected train stations form a singly linked route. Due to a glitch, some tracks may loop back to an earlier station, forming a circular track. Detect whether the railway track (linked list) contains a loop. Hidden Technical Mapping Detect cycle in a singly linked list using Floyds Tortoise and Hare algorithm.','First line: N (number of nodes) \nSecond line: N space-separated values (station IDs) \nThird line: integer pos  the 0-based index where the tail connects to form a loop; if pos = -1, no loop.','Print \"Loop Found\" if there is a cycle, otherwise \"No Loop\".','0  N  10 pos in [-1, N-1]','Tail connects to node index 2 (C) creating a loop.','5\nA B C D E\n2','Loop Found','','','MEDIUM',100,'linked_lists','',10,256,0,0,0,'2025-11-20 11:47:42.217832','2025-11-20 12:33:16.173216'),(7,'The Marathon Ranking','the-marathon-ranking','The annual City Marathon has just ended, and the results are in! There are N runners, and each runners completion time (in minutes) is recorded in an array. The event manager wants to find out who ranked at the Kth position (i.e., the Kth fastest runner). Since smaller time means faster runner, the Kth smallest completion time represents the Kth rank. Hidden Technical Mapping The problem maps to arrays and selection algorithms. You may use sorting or selection algorithms (e.g., Quickselect) depending on desired complexity.','First line: integer N (number of runners) \nSecond line: N space-separated integers: times[] \nThird line: integer K','Print the Kth smallest completion time (an integer).','1  N  10 1  times[i]  10 1  K  N','Sorted times: [180, 195, 205, 210, 240]  3rd smallest = 205.','5\n240 195 210 180 205\n3','205','','','EASY',100,'arrays','',10,256,0,0,0,'2025-11-20 11:52:42.136318','2025-11-22 11:36:07.205625'),(8,'The Mirror of the Forgotten Scrolls','the-mirror-of-the-forgotten-scrolls','In the ancient library of Eclipsera, there is a mystical corridor known as the Hall of Scrolls.  Each scroll in the hall contains ancient inscriptions, and they are arranged in a single linear sequence along a conveyor belt.  The corridor is enchanted: if the scrolls form a perfect mirrored sequence, a magical mirror portal opens at the end of the hall. The librarian notices that the scrolls can only be examined one by one, moving forward along the belt. Your task, as the secret archivist, is to determine whether the sequence of inscriptions from start to end is exactly the same as from end to start, without breaking the scrolls apart or seeing more than one at a time. If the inscriptions match symmetrically, the portal will open. Otherwise, it remains closed forever. Hidden Technical Mapping  Each scroll is a node in a singly linked list.  The inscription on each scroll is the data in the node.  The task is to check whether the linked list forms a palindrome (reads the same forward and backward) without random access.','The first line contains the number of scrolls N. The next N lines contain the inscriptions (characters or integers) for each scroll node.','Print \"Palindrome (Portal Opens)\" if the linked list is a palindrome. Otherwise, print \"Not a Palindrome (Portal Remains Closed)\".','1  N  10 Node data can be a character or integer. Must work without converting the linked list into an array.','The sequence R  A  D  A  R reads the same forward and backward. Hence, it forms a palindrome and opens the mystical portal.','5\nR A D A R','Palindrome (Portal Opens)','','','EASY',100,'linked_lists','',10,256,0,0,0,'2025-11-20 12:00:44.536081','2025-11-20 12:32:48.963833'),(9,'Anagram','anagram','In an ancient kingdom, there was a royal library with thousands of scrolls. Each scroll had a secret word written on it. The King believed that two scrolls belonged to the same family if the words on them were made of exactly the same letters but in different orders (i.e., they are anagrams). The King wanted to group all the scrolls into families of anagrams so that no scroll was misplaced. But heres the twist:  A family can have any number of scrolls, not just two.  The King is interested in knowing how many unique anagram families exist in the library.  Additionally, he wants to list each family with all its scrolls. Your task is to help the King organize the scrolls.','First line: An integer N (number of scrolls). Next N lines: Each contains one string (the secret word on a scroll).','First line: Number of anagram families. Next lines: Each family of scrolls printed together (order of words inside a family doesnt matter).','1  N  10^5 Strings contain only lowercase English letters. String length  100. Efficient solution expected: O(N * K log K) where K = max string length (using sorting) OR O(N * K) with hashing/frequency counting.','Explanation Family 1  {eat, tea, ate} Family 2  {tan, nat} Family 3  {bat} Total families = 3 ','6\neat\ntea\ntan\nate\nnat\nbat','3\neat tea ate\ntan nat\nbat','','','HARD',100,'strings','',10,256,0,0,0,'2025-11-20 12:05:50.625794','2025-11-20 12:05:50.625815'),(10,'Equilibrium index of an Array','equilibrium-index-of-an-array','A rope bridge is hanging over a river, and several monkeys are sitting on it in a line. Each monkey has a certain weight. The bridge is said to be balanced at a monkeys position if the total weight of monkeys to the left of that monkey is equal to the total weight of monkeys to the right. Your task is to help the zookeeper find if there exists such a monkeys position where the bridge is in equilibrium. The monkey at that position is called an equilibrium monkey. If there are multiple equilibrium monkeys, report the first one (smallest index). If none exists, return -1.','First line: An integer N (number of monkeys). \nSecond line: An array of N integers (weights of monkeys sitting in line).','Print the index (0-based) of the equilibrium monkey. If no equilibrium exists, print -1.','1  N  10^5 1  weight[i]  10^6','At index 2 (weight = 5): Left sum = 1 + 3 = 4 Right sum = 2 + 2 = 4 Since both are equal, the bridge is balanced at index 2.','5\n1 3 5 2 2','2','','','MEDIUM',100,'arrays','',10,256,0,0,0,'2025-11-20 12:08:49.905055','2025-11-24 10:47:15.232349'),(11,'Leaders of an array','leaders-of-an-array','A group of explorers is traveling through a desert, and each explorer is carrying some amount of water. The explorers walk in a line, and the leader of the line is always someone who has more water than everyone standing behind them. You are given an array where each element represents the amount of water carried by an explorer standing in line. Your task is to find out all the leaders in the group. \nAn element is called a leader if it is greater than or equal to all elements to its right in the array. \nThe last explorer is always a leader (since no one is behind them).',' First line: An integer N (number of explorers). \n Second line: An array of N integers (amount of water carried by each','Print all the leaders in the same order they appear in the array.','1  N  10^5 (number of explorers can be large). \n1  water[i]  10^6 (each explorer carries at least 1 unit of water).','Step-by-step check (from left to right): \n16: Not a leader because 17 (to its right) is greater. \n17: A leader (no one behind has more). \n4: Not a leader (5 is greater behind). \n3: Not a leader (5 is greater behind). \n5: A leader (greater than 2 behind). \n2: A leader (last explorer is always leader).','6\n16 17 4 3 5 2','17 5 2','O(N)','O(1)','EASY',100,'arrays','array',10,256,0,0,0,'2025-11-21 05:37:23.301862','2025-11-22 11:32:22.015341'),(12,'Fibonacci Search','fibonacci-search','Perform a Fibonacci Search on a sorted array to find the index of a target element. Fibonacci Search uses Fibonacci numbers to divide the array and narrow down the search space effectively using a divide-and-conquer method.','First line contains an integer n representing the size of the array. \nSecond line contains n space-separated integers representing the sorted elements of the array. \nThird line contains an integer k, the target element to search for.','Output the index (0-based) of the target element k if it exists in the array. If the element is not found, output -1.','1  n  10^6 -10^9  array elements,k  10^9','The target element 67 is found at index 6 in the sorted array using Fibonacci Search.','10\n6 11 19 24 33 54 67 81 94 99\n67','6','','','MEDIUM',100,'searching','',10,256,0,0,0,'2025-11-21 05:45:46.322458','2025-11-21 05:51:44.486192'),(13,'Spiral Matrix Print','spiral-matrix-print','Given an m x n matrix, print all elements in spiral order.','m n matrix elements (row-wise)','Elements in spiral order (space-separated)','1  m, n  100, -10  matrix[i][j]  10','Print elements in spiral order starting from top-left.','3 3\n1 2 3\n4 5 6\n7 8 9','1 2 3 6 9 8 7 4 5','','','MEDIUM',100,'arrays','',10,256,0,0,0,'2025-11-21 05:51:33.677706','2025-11-22 11:30:31.249105'),(14,'Decode Ways','decode-ways','A message containing digits can be decoded: \'A\'=1, \'B\'=2, , \'Z\'=26. Count total number of ways to decode a string of digits.','s','Single integer: number of decodings','1  |s|  10','\"12\"  \"AB\" or \"L\"','12','2','','','MEDIUM',100,'dynamic_programming','',10,256,0,0,0,'2025-11-21 05:54:27.680789','2025-11-21 05:54:27.680809'),(15,'Find Median from Data Stream','find-median-from-data-stream','Design a data structure that supports adding numbers and finding the median in real-time.','n op val (op=\"add\" or \"median\")','For median operation, print median','1  n  10, -10  val  10','After [1,2], median = 1.5 After [1,2,3], median = 2','5\nadd 1\nadd 2\nmedian\nadd 3\nmedian','1.5\n2','','','