t is a palindrome.\n     Return true if it is, otherwise false.\n    */\n    return false;\n}\n\nint main() {\n    struct Node* head = NULL;\n    // TODO: Create linked list and test\n    return 0;\n}',8),(52,'javascript','class Node {\n  constructor(data) {\n    this.data = data;\n    this.next = null;\n  }\n}\n\nfunction isPalindrome(head) {\n  /*\n   TODO:\n   Implement a function to check if the linked list is a palindrome.\n   Return true if it is, otherwise false.\n  */\n  return false;\n}\n\n// Example usage\nlet head = new Node(\'R\');\nhead.next = new Node(\'A\');\nhead.next.next = new Node(\'D\');\nhead.next.next.next = new Node(\'A\');\nhead.next.next.next.next = new Node(\'R\');\n\nif (isPalindrome(head))\n  console.log(\"Palindrome (Portal Opens)\");\nelse\n  console.log(\"Not a Palindrome (Portal Remains Closed)\");',8),(58,'python','class Node:\n    def __init__(self, data):\n        self.data = data\n        self.next = None\n\ndef has_loop(head):\n    slow = head\n    fast = head\n    while fast and fast.next:\n        slow = slow.next\n        fast = fast.next.next\n        if slow == fast:\n            return True\n    return False\n\n# Example input parsing (pos indicates loop connection)\nif __name__ == \"__main__\":\n    n = int(input().strip())\n    vals = input().split()\n    pos = int(input().strip())\n    head = None\n    tail = None\n    nodes = []\n    for v in vals:\n        node = Node(v)\n        nodes.append(node)\n        if head is None:\n            head = node\n            tail = node\n        else:\n            tail.next = node\n            tail = node\n    if pos != -1 and n>0:\n        tail.next = nodes[pos]\n    print(\"Loop Found\" if has_loop(head) else \"No Loop\")',6),(59,'java','import java.util.*;\nclass Node {\n    String data;\n    Node next;\n    Node(String d){ data = d; next = null; }\n}\n\npublic class Main {\n    static boolean hasLoop(Node head) {\n        Node slow = head, fast = head;\n        while (fast!=null && fast.next!=null) {\n            slow = slow.next;\n            fast = fast.next.next;\n            if (slow == fast) return true;\n        }\n        return false;\n    }\n\n    public static void main(String[] args) {\n        Scanner sc = new Scanner(System.in);\n        int n = sc.nextInt();\n        Node head = null, tail = null;\n        Node[] nodes = new Node[n];\n        for (int i=0;i<n;i++){\n            String v = sc.next();\n            nodes[i] = new Node(v);\n            if (head==null){ head = nodes[i]; tail = nodes[i]; }\n            else { tail.next = nodes[i]; tail = nodes[i]; }\n        }\n        int pos = sc.nextInt();\n        if (pos != -1 && n>0) tail.next = nodes[pos];\n        System.out.println(hasLoop(head) ? \"Loop Found\" : \"No Loop\");\n        sc.close();\n    }\n}',6),(60,'c_cpp','#include <bits/stdc++.h>\nusing namespace std;\nstruct Node {\n    string data;\n    Node* next;\n    Node(string s): data(s), next(NULL) {}\n};\n\nbool hasLoop(Node* head) {\n    Node* slow = head;\n    Node* fast = head;\n    while (fast && fast->next) {\n        slow = slow->next;\n        fast = fast->next->next;\n        if (slow == fast) return true;\n    }\n    return false;\n}\n\nint main(){\n    ios::sync_with_stdio(false);\n    cin.tie(nullptr);\n    int n; cin >> n;\n    vector<Node*> nodes(n);\n    Node* head = NULL;\n    Node* tail = NULL;\n    for (int i=0;i<n;i++){\n        string v; cin >> v;\n        nodes[i] = new Node(v);\n        if (!head) head = tail = nodes[i];\n        else { tail->next = nodes[i]; tail = nodes[i]; }\n    }\n    int pos; cin >> pos;\n    if (pos != -1 && n>0) tail->next = nodes[pos];\n    cout << (hasLoop(head) ? \"Loop Found\" : \"No Loop\") << \'\\n\';\n    return 0;\n}',6),(61,'c','#include <stdio.h>\n#include <stdlib.h>\n#include <string.h>\n\ntypedef struct Node {\n    char *data;\n    struct Node* next;\n} Node;\n\nNode* newNode(const char* s) {\n    Node* n = malloc(sizeof(Node));\n    n->data = strdup(s);\n    n->next = NULL;\n    return n;\n}\n\nint hasLoop(Node* head) {\n    Node *slow = head, *fast = head;\n    while (fast && fast->next) {\n        slow = slow->next;\n        fast = fast->next->next;\n        if (slow == fast) return 1;\n    }\n    return 0;\n}\n\nint main() {\n    int n;\n    if (scanf(\"%d\", &n)!=1) return 0;\n    Node** nodes = malloc(sizeof(Node*)*n);\n    Node *head = NULL, *tail = NULL;\n    for (int i=0;i<n;i++) {\n        char buf[256]; scanf(\"%s\", buf);\n        nodes[i] = newNode(buf);\n        if (!head) head = tail = nodes[i];\n        else { tail->next = nodes[i]; tail = nodes[i]; }\n    }\n    int pos; scanf(\"%d\", &pos);\n    if (pos != -1 && n>0) tail->next = nodes[pos];\n    printf(\"%s\\n\", hasLoop(head) ? \"Loop Found\" : \"No Loop\");\n    // memory freeing omitted for brevity\n    return 0;\n}',6),(62,'javascript','process.stdin.setEncoding(\'utf8\');\nlet data=\'\';\nprocess.stdin.on(\'data\', c=>data+=c);\nprocess.stdin.on(\'end\', ()=>{\n  const parts = data.trim().split(/\\s+/);\n  let idx=0;\n  const n = Number(parts[idx++]);\n  const nodes = [];\n  let head = null, tail = null;\n  for (let i=0;i<n;i++){\n    const v = parts[idx++];\n    const node = { data: v, next: null };\n    nodes.push(node);\n    if (!head) head = tail = node;\n    else { tail.next = node; tail = node; }\n  }\n  const pos = Number(parts[idx++]);\n  if (pos !== -1 && n>0) tail.next = nodes[pos];\n  function hasLoop(head) {\n    let slow = head, fast = head;\n    while (fast && fast.next) {\n      slow = slow.next;\n      fast = fast.next.next;\n      if (slow === fast) return true;\n    }\n    return false;\n  }\n  console.log(hasLoop(head) ? \"Loop Found\" : \"No Loop\");\n});',6),(73,'python','class Node:\n    def __init__(self, data):\n        self.data = data\n        self.next = None\n\ndef reverse_list(head):\n    prev = None\n    curr = head\n    while curr:\n        nxt = curr.next\n        curr.next = prev\n        prev = curr\n        curr = nxt\n    return prev\n\nif __name__ == \"__main__\":\n    n = int(input().strip())\n    vals = input().split() if n>0 else []\n    head = None\n    tail = None\n    for v in vals:\n        node = Node(v)\n        if not head:\n            head = tail = node\n        else:\n            tail.next = node\n            tail = node\n    new_head = reverse_list(head)\n    out=[]\n    cur = new_head\n    while cur:\n        out.append(str(cur.data))\n        cur = cur.next\n    print(\' \'.join(out))',2),(74,'java','import java.util.*;\nclass Node {\n    String data; Node next;\n    Node(String d){ data = d; next = null; }\n}\npublic class Main {\n    static Node reverseList(Node head) {\n        Node prev = null, curr = head;\n        while (curr != null) {\n            Node next = curr.next;\n            curr.next = prev;\n            prev = curr;\n            curr = next;\n        }\n        return prev;\n    }\n    public static void main(String[] args){\n        Scanner sc = new Scanner(System.in);\n        int n = sc.nextInt();\n        Node head = null, tail = null;\n        for (int i=0;i<n;i++){\n            String v = sc.next();\n            Node node = new Node(v);\n            if (head==null) head = tail = node;\n            else { tail.next = node; tail = node; }\n        }\n        Node newHead = reverseList(head);\n        Node cur = newHead;\n        StringJoiner sj = new StringJoiner(\" \");\n        while (cur!=null){ sj.add(cur.data); cur = cur.next; }\n        System.out.println(sj.toString());\n        sc.close();\n    }\n}',2),(75,'c_cpp','#include <bits/stdc++.h>\nusing namespace std;\nstruct Node {\n    string data;\n    Node* next;\n    Node(string s): data(s), next(NULL) {}\n};\nNode* reverseList(Node* head) {\n    Node* prev = NULL;\n    Node* curr = head;\n    while (curr) {\n        Node* next = curr->next;\n        curr->next = prev;\n        prev = curr;\n        curr = next;\n    }\n    return prev;\n}\nint main(){\n    ios::sync_wit