  printf(\"%d\\n\", times[k-1]);\n    free(times);\n    return 0;\n}',7),(189,'javascript','process.stdin.setEncoding(\'utf8\');\nlet data = \'\';\nprocess.stdin.on(\'data\', chunk => data += chunk);\nprocess.stdin.on(\'end\', () => {\n  const parts = data.trim().split(/\\s+/).map(Number);\n  let idx = 0;\n  const n = parts[idx++];\n  const times = [];\n  for (let i=0;i<n;i++) times.push(parts[idx++]);\n  const k = parts[idx++];\n  times.sort((a,b)=>a-b);\n  console.log(times[k-1]);\n});',7),(190,'python','def find_missing_roll(rolls, n):\n    total = n*(n+1)//2\n    return total - sum(rolls)\n\nif __name__ == \"__main__\":\n    n = int(input().strip())\n    rolls = list(map(int, input().split()))\n    print(find_missing_roll(rolls, n))',5),(191,'java','import java.util.*;\npublic class Main {\n    static int findMissing(int[] arr, int n) {\n        long total = (long)n*(n+1)/2;\n        long sum=0;\n        for (int v: arr) sum += v;\n        return (int)(total - sum);\n    }\n    public static void main(String[] args){\n        Scanner sc = new Scanner(System.in);\n        int n = sc.nextInt();\n        int[] arr = new int[n-1];\n        for (int i=0;i<n-1;i++) arr[i] = sc.nextInt();\n        System.out.println(findMissing(arr,n));\n        sc.close();\n    }\n}',5),(192,'c_cpp','#include <bits/stdc++.h>\nusing namespace std;\nint findMissing(vector<int>& arr, int n) {\n    long long total = 1LL*n*(n+1)/2;\n    long long sum = 0;\n    for (int v: arr) sum += v;\n    return (int)(total - sum);\n}\nint main(){\n    ios::sync_with_stdio(false);\n    cin.tie(nullptr);\n    int n; cin >> n;\n    vector<int> arr(n-1);\n    for (int i=0;i<n-1;i++) cin >> arr[i];\n    cout << findMissing(arr, n) << \'\\n\';\n    return 0;\n}',5),(193,'c','#include <stdio.h>\nint main(){\n    int n; scanf(\"%d\", &n);\n    long long sum = 0;\n    for (int i=0; i<n-1; i++){\n        int x; scanf(\"%d\", &x);\n        sum += x;\n    }\n    long long total = 1LL*n*(n+1)/2;\n    printf(\"%lld\\n\", total - sum);\n    return 0;\n}',5),(194,'javascript','const fs = require(\'fs\');\nconst parts = fs.readFileSync(0,\'utf8\').trim().split(/\\s+/).map(Number);\nlet idx=0;\nconst n = parts[idx++];\nlet sum=0;\nfor (let i=0;i<n-1;i++) sum += parts[idx++];\nconsole.log( (n*(n+1)/2) - sum );',5),(195,'python','def find_two_unique_socks(arr):\n    x = 0\n    for v in arr:\n        x ^= v\n\n    # Get rightmost set bit of x (a ^ b)\n    mask = x & -x\n\n    a = 0\n    b = 0\n\n    for v in arr:\n        if v & mask:\n            a ^= v\n        else:\n            b ^= v\n\n    return a, b\n\nif __name__ == \"__main__\":\n    n = int(input().strip())\n    arr = list(map(int, input().split()))\n    a, b = find_two_unique_socks(arr)\n    print(a, b)',3),(196,'java','import java.util.*;\npublic class Main {\n    static int[] findTwoUnique(int[] arr) {\n        int x=0;\n        for (int v: arr) x ^= v;\n        int mask = x & -x;\n        int a=0, b=0;\n        for (int v: arr) {\n            if ((v & mask) != 0) a ^= v;\n            else b ^= v;\n        }\n        return new int[]{a,b};\n    }\n    public static void main(String[] args){\n        Scanner sc = new Scanner(System.in);\n        int n = sc.nextInt();\n        int[] arr = new int[n];\n        for (int i=0;i<n;i++) arr[i] = sc.nextInt();\n        int[] ans = findTwoUnique(arr);\n        System.out.println(ans[0] + \" \" + ans[1]);\n        sc.close();\n    }\n}',3),(197,'c_cpp','#include <bits/stdc++.h>\nusing namespace std;\npair<int,int> findTwoUnique(vector<int>& arr) {\n    int x=0;\n    for (int v: arr) x ^= v;\n    int mask = x & -x;\n    int a=0,b=0;\n    for (int v: arr) {\n        if (v & mask) a ^= v;\n        else b ^= v;\n    }\n    return {a,b};\n}\nint main(){\n    ios::sync_with_stdio(false);\n    cin.tie(nullptr);\n    int n; cin >> n;\n    vector<int> a(n);\n    for (int i=0;i<n;i++) cin >> a[i];\n    auto p = findTwoUnique(a);\n    cout << p.first << \" \" << p.second << \'\\n\';\n    return 0;\n}',3),(198,'c','#include <stdio.h>\nint main(){\n    int n; scanf(\"%d\",&n);\n    int x=0;\n    int a[100005];\n    for (int i=0;i<n;i++){ scanf(\"%d\",&a[i]); x ^= a[i]; }\n    int mask = x & -x;\n    int p=0,q=0;\n    for (int i=0;i<n;i++){\n        if (a[i] & mask) p ^= a[i];\n        else q ^= a[i];\n    }\n    printf(\"%d %d\\n\", p, q);\n    return 0;\n}',3),(199,'javascript','const fs = require(\'fs\');\nconst parts = fs.readFileSync(0,\'utf8\').trim().split(/\\s+/).map(Number);\nlet idx=0;\nconst n = parts[idx++];\nconst arr = [];\nfor (let i=0;i<n;i++) arr.push(parts[idx++]);\nlet x = 0;\nfor (let v of arr) x ^= v;\nlet mask = x & -x;\nlet a=0,b=0;\nfor (let v of arr) {\n  if (v & mask) a ^= v;\n  else b ^= v;\n}\nconsole.log(a, b);',3),(200,'python','def equilibrium_monkey(arr, n):\n    total_sum = sum(arr)\n    left_sum = 0\n\n    for i in range(n):\n        right_sum = total_sum - left_sum - arr[i]\n\n        if left_sum == right_sum:\n            return i\n\n        left_sum += arr[i]\n\n    return -1',10),(201,'c_cpp','#include <iostream>\n#include <vector>\nusing namespace std;\n\nint equilibriumMonkey(vector<int>& arr, int n) {\n    // write your code here\n    return -1;\n}\n\nint main() {\n    int n;\n    cin >> n;\n\n    vector<int> arr(n);\n    for(int i = 0; i < n; i++) {\n        cin >> arr[i];\n    }\n\n    cout << equilibriumMonkey(arr, n) << endl;\n    return 0;\n}',10),(202,'c','#include <stdio.h>\n\nint equilibriumMonkey(int arr[], int n) {\n    // write your code here\n    return -1;\n}\n\nint main() {\n    int n;\n    scanf(\"%d\", &n);\n\n    int arr[n];\n    for(int i = 0; i < n; i++) {\n        scanf(\"%d\", &arr[i]);\n    }\n\n    printf(\"%d\\n\", equilibriumMonkey(arr, n));\n    return 0;\n}',10);
