INSERT INTO `concepts` VALUES (2,'Arrays','7-crore-technologies-arrays','Arrays store data in contiguous memory, allowing indexing. Matrices are 2D arrays. Problems usually involve traversal, sliding windows, prefix sums, or sorting.','INTERMEDIATE',60,0,1,'2025-11-20 10:48:16.976336','2025-11-20 10:48:16.976392',1),(3,'Strings','7-crore-technologies-strings','Strings are sequences of characters. Problems involve substring search, pattern matching, dynamic programming, or frequency counting.','INTERMEDIATE',60,0,1,'2025-11-20 10:48:38.427157','2025-11-20 10:48:38.427179',1),(4,'Searching & Sorting','haegl-technologies-private-limited-searching','Searching algorithms are methods to find the location or existence of an element within a dataset. Sorting algorithms arrange data in a particular order (ascending/descending).','INTERMEDIATE',60,0,1,'2025-11-20 10:49:41.275288','2025-11-20 10:56:42.834084',2),(5,'Strings','haegl-technologies-private-limited-strings','String manipulation problems assess understanding of character arrays, pattern matching, and substring/subsequence operations.','INTERMEDIATE',60,0,1,'2025-11-20 10:51:17.376029','2025-11-20 10:51:17.376055',2),(6,'Linked list','haegl-technologies-private-limited-linked-list','','INTERMEDIATE',60,0,1,'2025-11-20 10:52:03.834591','2025-11-20 10:52:03.834616',2),(7,'Arrays','wipro-limited-arrays','Linear data structures that hold elements in a contiguous memory location, allowing indexed access. Useful for sorting, searching, and manipulating fixed-size collections.','BEGINNER',60,0,1,'2025-11-20 10:55:19.755502','2025-11-20 10:55:19.755528',4),(8,'Number Theory & Math','wipro-limited-number-theory-math','Problems involving numeric operations, divisibility, series, and mathematical properties like primes, factorials, and gcd/lcm.','INTERMEDIATE',60,0,1,'2025-11-20 10:55:49.315972','2025-11-20 10:55:49.315991',4),(9,'Strings','wipro-limited-strings','Sequences of characters used for storing and manipulating text. 