INSERT INTO `courses` VALUES (3,'0e96b60002384a498ba823a31818c70a','CS101','C Programming','c-programming','Interacting with computer needs a language and one of the language is C. C is computer programming language developed in late seventies by Dennis Ritchie at AT & T Bell Laboratories. It has been very widely used because of its simple, reliable and simple to use.\r\nC is the high level programming language. It is strongly typed language. Strongly typed are one where we need to define what data type we are using. (More about data types in further sections).\r\nC language is widely used in the system side. It is the powerful language when it comes in terms of efficiency since it interacts directly with the computer hardware.','beginner',60,'published','course_thumbnails/c-programming-transparent-logo-free-png.png','','https://www.youtube.com/watch?v=08LWytp6PNI&list=PLdo5W4Nhv31a8UcMN9-35ghv8qyFWD9_S',61,1,'2025-11-20 06:38:24.694049','2026-02-02 09:53:52.214441',NULL,NULL,1),(4,'9d83d233cee5432ea11c697b9a2e5db6','CS201','Python','python','This course teaches you the basics of Python programming in a clear and easy way. You will learn how to write Python code, use variables, loops, functions, and work with different types of data. The course also introduces simple projects that help you practice what you learn.\r\n\r\nBy the end of the course, you will be able to write your own Python programs, solve problems using code, and understand how Python is used in real life.','beginner',60,'published','course_thumbnails/PY1-2.webp','','https://www.youtube.com/watch?v=ge8UdND6tUA',98,1,'2025-11-21 07:16:59.575986','2026-02-12 11:41:24.190528',NULL,NULL,1),(5,'d7f4817d00ca42be81304e64a7c390d8','CS301','Data Structure','data-structure','This course introduces you to the basic data structures used in computer science. You will learn how data is stored, organized, and managed so that programs can run efficiently. Topics include arrays, linked lists, stacks, queues, trees, graphs, and hashing.\r\n\r\nThe course focuses on understanding how each data structure works, when to use it, and how it helps in solving different types of problems. You will also learn how to write simple programs to implement these data structures.\r\n\r\nBy the end of the course, you will be able to choose the right data structure for a problem and build more efficient and optimized programs.','beginner',60,'published','course_thumbnails/DSA.webp','','https://www.youtube.com/watch?v=08LWytp6PNI&list=PLdo5W4Nhv31a8UcMN9-35ghv8qyFWD9_S',11,1,'2025-11-21 07:21:19.972712','2026-02-06 07:27:16.079424',NULL,NULL,1),(6,'0f7c31cd46fa47cca9e9182fb6fa6adb','CS401','Full Stack Development','full-stack-development','In this comprehensive course, youll follow a step-by-step pathway to install Django and build your first fully functional web application. From setup to deployment, every module is designed to give you hands-on experience with real-world project development.\r\n\r\nYoull begin by creating a Django project where you can add, view, modify, and remove data using Djangos built-in tools. The course will guide you through designing interactive HTML templates and applying Django Template Tags to dynamically display content on your web pages.\r\n\r\nNext, youll explore how to use QuerySets effectively to retrieve, filter, and arrange data from your database\r\nFinally, the course concludes with deploying your Django application onlinetransforming your local project into a production-ready web platform accessible to users worldwide.','beginner',60,'published','course_thumbnails/Django_web_framework-Logo.wine.png','','https://www.youtube.com/watch?v=08LWytp6PNI&list=PLdo5W4Nhv31a8UcMN9-35ghv8qyFWD9_S',17,1,'2025-11-21 07:23:39.850687','2026-02-06 07:27:41.736735',NULL,NULL,1),(7,'9e3e1b3216384feaa89ef7a2ad9cc35f','CS501','DevOps','devops','This course teaches you the basics of DevOps, which is a way of developing software faster and with fewer problems. You will learn how development and operations teams work together, how to automate tasks, and how to deploy applications smoothly.\r\n\r\nYou will also be introduced to important tools like Git, Docker, Jenkins, and Kubernetes. By the end of the course, you will understand how DevOps makes software delivery quicker, easier, and more reliable.','beginner',60,'published','course_thumbnails/Devops.png','','https://www.youtube.com/watch?v=08LWytp6PNI&list=PLdo5W4Nhv31a8UcMN9-35ghv8qyFWD9_S',5,1,'2025-11-21 07:25:21.265530','2026-01-20 16:39:27.346249',NULL,NULL,1),(9,'e63edabc8a0d4d5abd46e6fec537b6b6','CS1101','Java','java','Java is a high-level, object-oriented programming language designed to be platform-independent through its write once, run anywhere capability using the Java Virtual Machine (JVM). It is widely used for building web applications, mobile apps (especially Android), enterprise software, and large-scale systems. Java offers strong memory management, robust security features, and a rich standard library that supports complex development needs. Its syntax is similar to C++ but simpler, making it easier for developers to write reliable and maintainable code. Known for stability and performance, Java remains one of the most popular languages for enterprise and cross-platform development.','intermediate',120,'published','course_thumbnails/java-.jpg','',NULL,6,1,'2025-12-01 06:20:55.600084','2026-02-06 07:27:51.668337',NULL,2,NULL);
/*!40000 ALTER TABLE `courses` ENABLE KEYS */;
UNLOCK TABLES;

