INSERT INTO `jobs` VALUES (1,'Junior Software Developer','infosys-limited-dee-053aaff0','Looking for Enthusiast Fresher with Engineering Background','FULL_TIME','ENTRY','Hubli Karnataka, India',10000.00,20000.00,'INR','Python,\nReactjs,\nDjango,\nMySQL','BCA\nBE\nMCA','Full Stack','2025-12-28 14:35:00.000000','https://haegl.in/contact','info@haegl.in',1,1,'2025-11-23 09:05:48.208215','2025-12-05 09:56:24.104344',1,2),(2,'Software Engineer','amazon-software-engineer-e8e13a9f','Amazon is seeking a highly motivated Entry-Level Software Engineer to join our innovative engineering teams. In this role, you will contribute to designing, building, and optimizing large-scale systems that impact millions of customers globally. You will work with cutting-edge technologies, collaborate with senior engineers, and help deliver high-quality, scalable, and reliable software solutions. This is an excellent opportunity for fresh graduates who are passionate about solving complex problems and building world-class software products.','FULL_TIME','ENTRY','Bangalore',500000.00,800000.00,'INR','Java, Python, C++, AWS, Data Structures, Algorithms, Problem Solving, SQL, Distributed Systems','Bachelors or Masters degree in Computer Science, Information Technology, or related engineering field\n\nStrong understanding of object-oriented programming principles\n\nKnowledge of data structures, algorithms, and system design fundamentals\n\nFamiliarity with cloud computing concepts (AWS preferred)\n\nExcellent analytical and communication skills','Design, develop, test, and deploy scalable and reliable software systems\n\nWrite clean, maintainable, and efficient code following Amazons engineering best practices\n\nParticipate in design reviews, code reviews, and contribute to technical discussions\n\nCollaborate with cross-functional teams including product managers, UX designers, and senior engineers\n\nAnalyze and troubleshoot technical issues, ensuring high performance and availability\n\nAssist in building distributed systems, microservices, and cloud-native applications\n\nContinuously improve system performance, reliability, and overall customer experience','2025-12-27 14:34:00.000000','https://amazon.com/apply','hr@amazon.com',1,1,'2025-12-11 09:04:38.641352','2025-12-11 09:04:38.641376',NULL,13);
/*!40000 ALTER TABLE `jobs` ENABLE KEYS */;
