DROP TABLE IF EXISTS `question_bank`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `question_bank` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `text` longtext NOT NULL,
  `explanation` longtext,
  `is_multiple_correct` tinyint(1) NOT NULL,
  `difficulty` varchar(10) NOT NULL,
  `tags` json NOT NULL,
  `source` varchar(20) NOT NULL,
  `ai_prompt` longtext,
  `ai_model` varchar(100) DEFAULT NULL,
  `weight` int unsigned NOT NULL,
  `is_active` tinyint(1) NOT NULL,
  `created_at` datetime(6) NOT NULL,
  `updated_at` datetime(6) NOT NULL,
  `course_id` bigint DEFAULT NULL,
  `created_by_id` bigint DEFAULT NULL,
  `category_id` bigint DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `question_ba_difficu_7e4199_idx` (`difficulty`,`is_active`),
  KEY `question_ba_categor_cc743e_idx` (`category_id`,`is_active`),
  KEY `question_ba_source_35e491_idx` (`source`,`is_active`),
  KEY `question_bank_course_id_f0d6be9e_fk_courses_id` (`course_id`),
  KEY `question_bank_created_by_id_e1e5e658_fk_users_id` (`created_by_id`),
  CONSTRAINT `question_bank_category_id_02027a2b_fk_question_` FOREIGN KEY (`category_id`) REFERENCES `question_bank_categories` (`id`),
  CONSTRAINT `question_bank_course_id_f0d6be9e_fk_courses_id` FOREIGN KEY (`course_id`) REFERENCES `courses` (`id`),
  CONSTRAINT `question_bank_created_by_id_e1e5e658_fk_users_id` FOREIGN KEY (`created_by_id`) REFERENCES `users` (`id`),
  CONSTRAINT `question_bank_chk_1` CHECK ((`weight` >= 0))
) ENGINE=InnoDB AUTO_INCREMENT=76 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

