\n    public String getType() { return \"Car\"; }\n    public String getBrand() { return \"Toyota\"; }\n}\n\npublic class Test {\n    public static void main(String[] args) {\n        Vehicle myCar = new Car();\n        System.out.println(myCar.getType());\n        // What happens if we try to call myCar.getBrand();?\n    }\n}\n```\n\nWhat is the output of `System.out.println(myCar.getType());` and what would happen if `myCar.getBrand();` were uncommented?','Due to runtime polymorphism (method overriding), `myCar.getType()` calls the `getType()` method of the actual `Car` object, which returns \"Car\". However, `myCar` is declared as a `Vehicle` type. The compiler only knows about methods declared in the `Vehicle` class (and its superclasses). Since `getBrand()` is defined only in the `Car` class and not in `Vehicle`, calling `myCar.getBrand()` through a `Vehicle` reference will result in a compile-time error. To call `getBrand()`, `myCar` would need to be cast to `Car` type.',0,'MEDIUM','[\"java\"]','AI_GENERATED','Generate exactly 5 multiple choice questions about \"Java\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]'