tr` points to\'. This effectively accesses `arr[3]`, which has a value of 40.',0,'MEDIUM','[\"c programming\"]','AI_GENERATED','Generate exactly 5 multiple choice questions about \"C Programming\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','gemini-2.5-flash',1,1,'2026-02-04 06:27:11.176942','2026-02-04 06:27:11.176970',3,1,NULL),(42,'Analyze the following C code:\n\n```c\n#include <stdio.h>\n\nint main() {\n    int i, j, count = 0;\n    for (i = 0; i < 3; i++) {\n        for (j = 0; j < 3; j++) {\n            if (i == j)\n                continue;\n            count++;\n        }\n    }\n    printf(\"%d\", count);\n    return 0;\n}\n```\n\nWhat will be the final value printed by the program?','The outer loop runs for `i = 0, 1, 2`. The inner loop runs for `j = 0, 1, 2`. The `if (i == j) continue;` statement skips the `count++` when `i` and `j` are equal (i.e., for pairs (0,0), (1,1), (2,2)). In total, there are 3x3 = 9 iterations. Three of these iterations are skipped by the `continue` statement. So, `count` will be incremented 9 - 3 = 6 times.',0,'MEDIUM','[\"c programming\"]','AI_GENERATED','Generate exactly 5 multiple choice questions about \"C Programming\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','gemini-2.5-flash',1,1,'2026-02-04 06:27:11.184225','2026-02-04 06:27:11.184241',3,1,NULL),(43,'Consider the following C program:\n\n```c\n#include <stdio.h>\n\nvoid modifyValue(int x) {\n    x = x * 2;\n}\n\nvoid modifyPointer(int *x) {\n    *x = *x * 2;\n}\n\nint main() {\n    int a = 5;\n    int b = 10;\n    modifyValue(a);\n    modifyPointer(&b);\n    printf(\"%d %d\", a, b);\n    return 0;\n}\n```\n\nWhat will be the output of this program?','The `modifyValue` function receives `a` by value. This means a copy of `a` (which is 5) is passed to `x`. Changing `x` inside `modifyValue` does not affect the original variable `a` in `main`. So, `a` remains 5. The `modifyPointer` function receives the address of `b` (using `&b`). The `*x = *x * 2;` line dereferences the pointer `x` and modifies the value at that memory location, which is `b`. So `b` becomes 10 * 2 = 20. Therefore, the output will be `5 20`.',0,'MEDIUM','[\"c programming\"]','AI_GENERATED','Generate exactly 5 multiple choice questions about \"C Programming\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','gemini-2.5-flash',1,1,'2026-02-04 06:27:11.185571','2026-02-04 06:27:11.185580',3,1,NULL),(44,'Given the following C code snippet:\n\n```c\n#include <stdio.h>\n\nstruct Point {\n    int x;\n    int y;\n};\n\nint main() {\n    struct Point p1 = {10, 20};\n    struct Point *ptr = &p1;\n    printf(\"%d\", ptr->y);\n    return 0;\n}\n```\n\nWhat will be the output of this program?','The code defines a struct `Point` with two integer members `x` and `y`. `p1` is an instance of this struct, initialized with `x=10` and `y=20`. `ptr` is a pointer to a `Point` struct and is made to point to `p1` using `&p1`. The `->` operator is used to access members of a struct when you have a pointer to that struct. `ptr->y` is equivalent to `(*ptr).y`, which accesses the `y` member of the `p1` struct. Therefore, it will print the value of `p1.y`, which is 20.',0,'MEDIUM','[\"c programming\"]','AI_GENERATED','Generate exactly 5 multiple choice questions about \"C Programming\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','gemini-2.5-flash',1,1,'2026-02-04 06:27:11.186988','2026-02-04 06:27:11.187010',3,1,NULL),(45,'Consider the following C code using a preprocessor macro:\n\n```c\n#include <stdio.h>\n\n#define SQUARE(x) x * x\n\nint main() {\n    int a = 3;\n    printf(\"%d\", SQUARE(a + 1));\n    return 0;\n}\n```\n\nWhat will be the output of this program?','Preprocessor macros perform simple text substitution. When `SQUARE(a + 1)` is encountered, it is directly substituted with `a + 1 * a + 1`. Due to operator precedence, multiplication (`*`) is performed before addition (`+`). So, the expression becomes `a + (1 * a) + 1`. Substituting `a = 3`, this evaluates to `3 + (1 * 3) + 1`, which is `3 + 3 + 1 = 7`. To avoid this common issue, macro arguments should always be parenthesized: `#define SQUARE(x) ((x) * (x))`.',0,'MEDIUM','[\"c programming\"]','AI_GENERATED','Generate exactly 5 multiple choice questions about \"C Programming\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief