"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','gemini-2.5-flash',1,1,'2026-02-06 07:46:21.077225','2026-02-06 07:46:21.077248',4,1,NULL),(61,'What will be the output of the following Python code?','The code attempts to perform `10 / 0`, which raises a `ZeroDivisionError`. This error is caught by the `except ZeroDivisionError as e:` block. Inside this block, `print(f\'Operation failed: {e}\')` is executed. The `else` block is skipped because an exception occurred. The `finally` block would execute regardless, but there is no `finally` block in this snippet. Therefore, only \'Operation failed: division by zero\' is printed.',0,'MEDIUM','[\"python\"]','AI_GENERATED','Generate exactly 10 multiple choice questions about \"Python\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','gemini-2.5-flash',1,1,'2026-02-06 07:46:21.079029','2026-02-06 07:46:21.079039',4,1,NULL),(62,'You want to dynamically import a module based on a string variable `module_name = \'math\'`. Which of the following is the correct way to do this in Python?','The `__import__()` function is used for dynamic imports where the module name is a string. `import module_name` would try to import a literal module named \'module_name\'. `import()` is not a valid function for this purpose. `sys.modules[module_name]` would only work if the module has already been imported and cached, but it doesn\'t perform the import itself if it\'s not already present.',0,'MEDIUM','[\"python\"]','AI_GENERATED','Generate exactly 10 multiple choice questions about \"Python\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','gemini-2.5-flash',1,1,'2026-02-06 07:46:21.084109','2026-02-06 07:46:21.084118',4,1,NULL),(63,'Consider the following Python decorator:\n\n```python\ndef my_decorator(func):\n    def wrapper(*args, **kwargs):\n        print(\'Before function call\')\n        result = func(*args, **kwargs)\n        print(\'After function call\')\n        return result\n    return wrapper\n\n@my_decorator\ndef say_hello(name):\n    return f\'Hello, {name}!\'\n\nprint(say_hello(\'Alice\'))\n```\n\nWhat will be the output of this code?','The `@my_decorator` syntax applies `my_decorator` to `say_hello`. When `say_hello(\'Alice\')` is called, it actually executes the `wrapper` function returned by `my_decorator`. The `wrapper` function first prints \'Before function call\', then calls the original `say_hello` function, captures its result, prints \'After function call\', and finally returns the result of `say_hello`. Therefore, the output will be \'Before function call\', then \'Hello, Alice!\' (from the `print` statement outside the function), and then \'After function call\'.',0,'MEDIUM','[\"python\"]','AI_GENERATED','Generate exactly 10 multiple choice questions about \"Python\".\n\nDifficulty Level: MEDIUM - Questions should test application and analysis.\n\nRequirements:\n1. Each question must have exactly 4 options (A, B, C, D)\n2. Exactly one option should be correct (unless specified otherwise)\n3. Options should be plausible and educational\n4. Include a brief explanation for the correct answer\n5. Questions should be clear and unambiguous\n\n\n\nReturn ONLY a valid JSON array with this exact structure (no other text):\n[\n  {\n    \"question\": \"The question text here?\",\n    \"options\": [\n      {\"text\": \"Option A text\", \"is_correct\": false},\n      {\"text\": \"Option B text\", \"is_correct\": true},\n      {\"text\": \"Option C text\", \"is_correct\": false},\n      {\"text\": \"Option D text\", \"is_correct\": false}\n    ],\n    \"explanation\": \"Brief explanation of why the correct answer is correct.\",\n    \"is_multiple_correct\": false\n  }\n]','gemini-2.5-flash',1,1,'2026-02-06 07:46:21.086300','2026-02-06 07:46:21.086317',4,1,NULL),(64,'What is the main purpose of the `super()` function in Python class inheritance?','`super()` in Python is used to delegate method calls to a parent or sibling class in the Method Resolution Order (MRO). It\'s not just about the immediate parent but about finding the next appropriate method in the inheritance chain as defined by the MRO, especially crucial in multiple inheritan