def find_leaders(arr, n):\n    leaders = []\n    max_from_right = -10**18  # small sentinel\n    # traverse from right to left\n    for i in range(n-1, -1, -1):\n        if arr[i] >= max_from_right:\n            leaders.append(arr[i])\n            max_from_right = arr[i]\n    leaders.reverse()  # restore original order\n    return leaders\n\n# Main driver code\nif __name__ == \"__main__\":\n    n = int(input().strip())\n    arr = list(map(int, input().split()))\n\n    leaders = find_leaders(arr, n)\n    print(\" \".join(map(str, leaders)))','python','ACCEPTED',1,1,100,34.28196907043457,9005.08,'2025-12-03 10:44:39.024320','[{\"error\": \"\", \"input\": \"[Hidden]\", \"hidden\": true, \"memory\": 9005.08, \"status\": \"OK\", \"runtime\": 34.28196907043457, \"expected\": \"[Hidden]\", \"is_sample\": true, \"is_correct\": true, \"user_output\": \"[Hidden]\"}]','',1,24),(10,6,'TCS (Tata Consultancy Services)',32,'Arrays & Strings',13,'spiral-matrix-print','Spiral Matrix Print','def spiralPrint(matrix):\n    res = []\n    m, n = len(matrix), len(matrix[0])\n    \n    top, bottom = 0, m - 1\n    left, right = 0, n - 1\n\n    while top <= bottom and left <= right:\n\n        # left  right\n        for i in range(left, right + 1):\n            res.append(matrix[top][i])\n        top += 1\n\n        # top  bottom\n        for i in range(top, bottom + 1):\n            res.append(matrix[i][right])\n        right -= 1\n\n        if top <= bottom:\n            # right  left\n            for i in range(right, left - 1, -1):\n                res.append(matrix[bottom][i])\n            bottom -= 1\n\n        if left <= right:\n            # bottom  top\n            for i in range(bottom, top - 1, -1):\n                res.append(matrix[i][left])\n            left += 1\n\n    return res\n\n\nif __name__==\"__main__\":\n    m,n=map(int,input().split())\n    matrix=[list(map(int,input().split())) for _ in range(m)]\n    print(*spiralPrint(matrix))','python','ACCEPTED',1,1,100,36.38458251953125,9991.5,'2025-12-03 10:45:04.624537','[{\"error\": \"\", \"input\": \"[Hidden]\", \"hidden\": true, \"memory\": 9991.5, \"status\": \"OK\", \"runtime\": 36.38458251953125, \"expected\": \"[Hidden]\", \"is_sample\": true, \"is_correct\": true, \"user_output\": \"[Hidden]\"}]','',1,24),(11,5,'Tech Mahindra',28,'Arrays & Matrices',5,'the-missing-roll-number','The Missing Roll Number','def find_missing_roll(rolls, n):\n    total = n*(n+1)//2\n    return total - sum(rolls)\n\nif __name__ == \"__main__\":\n    n = int(input().strip())\n    rolls = list(map(int, input().split()))\n    print(find_missing_roll(rolls, n))','python','ACCEPTED',1,1,100,35.76302528381348,8421.97,'2025-12-10 08:59:24.915945','[{\"error\": \"\", \"input\": \"[Hidden]\", \"hidden\": true, \"memory\": 8421.97, \"status\": \"OK\", \"runtime\": 35.76302528381348, \"expected\": \"[Hidden]\", \"is_sample\": true, \"is_correct\": true, \"user_output\": \"[Hidden]\"}]','',1,16);
