INSERT INTO `syllabi` VALUES (3,'2fc3d80cc5a1456d8f6fec52f5915cdc','Introduction to C','Interacting with computer needs a language and one of the language is C. C is computer programming language developed in late seventies by Dennis Ritchie at AT & T Bell Laboratories. It has been very widely used because of its simple, reliable and simple to use.\nC is the high level programming language. It is strongly typed language. Strongly typed are one where we need to define what data type we are using. (More about data types in further sections).\nC language is widely used in the system side. It is the powerful language when it comes in terms of efficiency since it interacts directly with the computer hardware.',1,1,'2025-11-20 06:39:13.783601','2025-11-20 06:39:13.783622',3),(4,'8c07dbaa46aa416f91cf54b6329eb277','Python Introduction','Python is a high-level, general-purpose programming language known for its simplicity, readability, and versatility. Created by Guido van Rossum and first released in 1991, Python emphasizes clean and easy-to-understand syntax, making it an excellent choice for both beginners and experienced developers.\n\nPython supports multiple programming paradigms, including procedural, object-oriented, and functional programming. It comes with a rich standard library and has a massive ecosystem of external libraries, making it suitable for a wide range of applications.',2,1,'2025-11-21 08:12:37.201605','2025-11-22 05:36:10.031738',4),(6,'a296bb37d58741ce9c320c33368f9c57','Introduction to DevOps','DevOps is all about automating and streamlining the software development lifecycle so that code moves from development to production quickly, reliably, and securely.',3,1,'2025-11-28 10:18:34.949763','2025-11-28 11:02:13.250187',7),(7,'90d7fc1623b14356a49ac6bd23c47338','Module 1: Introduction to Django','What is Django and why use it for web development.\nKey features: DRY principle, built-in login system, database connections, and CRUD support.\nWhen to choose Django for database-driven websites',4,1,'2025-11-28 10:19:00.987427','2025-12-03 06:34:39.800265',6),(9,'626bbbb72d0a42b097b5f252dcbf745d','Introduction to Java','Introduction to Java',1,1,'2025-12-10 09:32:01.507720','2025-12-10 09:32:01.507741',9);
/*!40000 ALTER TABLE `syllabi` ENABLE KEYS */;
