INSERT INTO `task_highlight_blocks` VALUES (1,'# models.py\nfrom django.db import models\n\nclass Course(models.Model):\n    title = models.CharField(max_length=200)\n    level = models.CharField(max_length=50)',1,64),(2,'# views.py\nfrom django.shortcuts import render\nfrom .models import Course\n\ndef course_list(request):\n    courses = Course.objects.all()\n    return render(request, \"course_list.html\", {\"courses\": courses})',3,64),(3,'<!-- templates/course_list.html -->\n<h1>Available Courses</h1>\n<ul>\n  {% for course in courses %}\n    <li>{{ course.title }} ({{ course.level }})</li>\n  {% endfor %}\n</ul>',5,64),(4,'# urls.py\nfrom django.urls import path\nfrom .views import course_list\n\nurlpatterns = [\n    path(\"courses/\", course_list, name=\"course_list\"),\n]',7,64),(5,'python --version',1,65),(6,'py --version\npython3 --version',3,65),(7,'pip --version',5,65),(8,'python -m pip --version',7,65),(9,'python -m venv .venv',9,65),(10,'.venv\\Scripts\\activate',11,65),(11,'source .venv/bin/activate',13,65),(12,'python -m pip install django',15,65),(13,'django-admin --version',17,65),(14,'student_portal',1,66),(15,'cd path/to/your/projects',3,66),(16,'django-admin startproject student_portal',5,66),(17,'student_portal/\n    manage.py\n    student_portal/\n        __init__.py\n        asgi.py\n        settings.py\n        urls.py\n        wsgi.py',7,66),(18,'cd student_portal\npython manage.py runserver',9,66),(19,'Starting development server at http://127.0.0.1:8000/',11,66),(20,'http://127.0.0.1:8000/',13,66),(21,'python manage.py startapp courses',1,67),(22,'courses/\n    __init__.py\n    admin.py\n    apps.py\n    models.py\n    tests.py\n    views.py\n    migrations/',3,67),(23,'INSTALLED_APPS = [\n    \"django.contrib.admin\",\n    \"django.contrib.auth\",\n    \"django.contrib.contenttypes\",\n    \"django.contrib.sessions\",\n    \"django.contrib.messages\",\n    \"django.contrib.staticfiles\",\n    \"courses\",  # our first app\n]',5,67),(24,'from django.http import HttpResponse\n\ndef home(request):\n    return HttpResponse(\"Welcome to the Courses app!\")',7,67),(25,'from django.contrib import admin\nfrom django.urls import path, include\n\nurlpatterns = [\n    path(\"admin/\", admin.site.urls),\n    path(\"courses/\", include(\"courses.urls\")),\n]',11,67),(26,'from django.urls import path\nfrom . import views\n\nurlpatterns = [\n    path(\"\", views.home, name=\"courses_home\"),\n]',9,67),(27,'python manage.py runserver',13,67),(28,'http://127.0.0.1:8000/courses/',15,67),(29,'<!DOCTYPE html>\n<html>\n  <head>\n    <title>Django Templates Intro</title>\n  </head>\n  <body>\n    <h1>Welcome, {{ name }}!</h1>\n    <p>You are viewing the {{ page }} page.</p>\n  </body>\n</html>',1,68),(30,'from django.shortcuts import render\n\ndef home(request):\n    context = {\n        \"name\": \"Django learner\",\n        \"page\": \"Courses Home\",\n    }\n    return render(request, \"courses/home.html\", context)',5,68),(31,'student_portal/\n  manage.py\n  student_portal/\n    settings.py\n    urls.py\n  courses/\n    views.py\n    templates/\n      courses/\n        home.html',3,68),(32,'<h1>Hello, {{ name }}!</h1>',1,69),(33,'<h1>Hello, Arjun!</h1>',3,69),(34,'<p>Course: {{ course.title }}</p>\n<p>Teacher: {{ course.teacher.name }}</p>',5,69),(35,'<p>{{ name|upper }}</p>          <!-- ARJUN -->\n<p>{{ title|lower }}</p>         <!-- all small letters -->\n<p>{{ text|truncatechars:50 }}</p>  <!-- first 50 characters -->\n<p>{{ joined_date|date:\"d-m-Y\" }}</p>',7,69),(36,'<p>{{ name|lower|title }}</p>',8,69),(37,'{% if user.is_authenticated %}\n  <p>Welcome, {{ user.username }}!</p>\n{% else %}\n  <p>Welcome, guest! Please log in.</p>\n{% endif %}',10,69),(38,'<ul>\n  {% for course in courses %}\n    <li>{{ course.title }}</li>\n  {% empty %}\n    <li>No courses available.</li>\n  {% endfor %}\n</ul>',12,69),(39,'{% with total=students.count %}\n  <p>Total students: {{ total }}</p>\n{% endwith %}',14,69),(40,'def course_list(request):\n    courses = [\n        {\"title\": \"Django Basics\", \"level\": \"Beginner\"},\n        {\"title\": \"Django with APIs\", \"level\": \"Intermediate\"},\n    ]\n    return render(request, \"courses/list.html\", {\"courses\": courses, \"page_title\": \"All Courses\"})',16,69),(41,'<h1>{{ page_title|upper }}</h1>\n\n<ul>\n  {% for course in courses %}\n    <li>{{ forloop.counter }}. {{ course.title }} - {{ course.level|title }}</li>\n  {% endfor %}\n</ul>',18,69),(43,'python manage.py makemigrations\npython manage.py migrate',0,70),(44,'from django import forms\nfrom .models import Course\n\nclass CourseForm(forms.ModelForm):\n    class Meta:\n        model = Course\n        fields = [\"title\", \"level\"]',2,70),(45,'from django.shortcuts import render, redirect, get_object_or_404\nfrom .models import Course\nfrom .forms import CourseForm\n\n# READ: list all\ndef course_list(request):\n    courses = Course.objects.all()\n    return render(request, \"courses/course_list.html\", {\"courses\": courses})\n\n# CREATE\ndef course_create(request):\n    if request.method == \"POST\":\n        form = CourseForm(request.POST)\n        if form.is_valid():\n            form.save()\n            return redirect(\"course_list\")\n    else:\n        form = CourseForm()\n    return render(request, \"courses/course_form.html\", {\"form\": form})\n\n# UPDATE\ndef course_update(request, pk):\n    course = get_object_or_404(Course, pk=pk)\n    if request.method == \"POST\":\n        form = CourseForm(request.POST, instance=course)\n        if form.is_valid():\n            form.save()\n            return redirect(\"course_list\")\n    else:\n        form = CourseForm(instance=course)\n    return render(request, \"courses/course_form.html\", {\"form\": form})\n\n# DELETE\ndef course_delete(request, pk):\n    course = get_object_or_404(Course, pk=pk)\n    if request.method == \"POST\":\n        course.delete()\n        return redirect(\"course_list\")\n    return render(request, \"courses/course_confirm_delete.html\", {\"course\": course})',4,70),(46,'from django.urls import path\nfrom . import views\n\nurlpatterns = [\n    path(\"\", views.course_list, name=\"course_list\"),\n    path(\"create/\", views.course_create, name=\"course_create\"),\n    path(\"<int:pk>/edit/\", views.course_update, name=\"course_update\"),\n    path(\"<int:pk>/delete/\", views.course_delete, name=\"course_delete\"),\n]',6,70),(47,'<h1>Courses</h1>\n\n<a href=\"{% url \'course_create\' %}\">Add new course</a>\n\n<ul>\n  {% for course in courses %}\n    <li>\n      {{ course.title }} ({{ course.level }})\n      <a href=\"{% url \'course_update\' course.pk %}\">Edit</a>\n      <a href=\"{% url \'course_delete\' course.pk %}\">Delete</a>\n    </li>\n  {% empty %}\n    <li>No courses yet.</li>\n  {% endfor %}\n</ul>',8,70),(48,'<h1>Course form</h1>\n\n<form method=\"post\">\n  {% csrf_token %}\n  {{ form.as_p }}\n  <button type=\"submit\">Save</button>\n</form>',10,70),(49,'<h1>Delete course</h1>\n<p>Are you sure you want to delete \"{{ course.title }}\"?</p>\n\n<form method=\"post\">\n  {% csrf_token %}\n  <button type=\"submit\">Yes, delete</button>\n  <a href=\"{% url \'course_list\' %}\">Cancel</a>\n</form>',12,70),(50,'class Topic(models.Model):\n    course = models.ForeignKey(Course, on_delete=models.CASCADE, related_name=\"topics\")\n    title = models.CharField(max_length=200)\n    order = models.PositiveIntegerField(default=0)\n\n    class Meta:\n        ordering = [\"order\"]\n\n    def __str__(self):\n        return self.title',3,71),(51,'from django.db import models\n\nclass Course(models.Model):\n    title = models.CharField(max_length=200)\n    level = models.CharField(max_length=50, blank=True)\n    description = models.TextField(blank=True)\n\n    def __str__(self):\n        return self.title',1,71),(52,'python manage.py makemigrations courses\npython manage.py migrate',5,71),(53,'DATABASES = {\n    \"default\": {\n        \"ENGINE\": \"django.db.backends.sqlite3\",\n        \"NAME\": BASE_DIR / \"db.sqlite3\",\n    }\n}',7,71),(54,'{% if courses %}\n  <p>Total courses: {{ courses|length }}</p>\n{% else %}\n  <p>No courses available yet.</p>\n{% endif %}',1,72),(55,'<h3>Topics in this course</h3>\n<ol>\n  {% for topic in course.topics.all %}\n    <li>{{ topic.title }}</li>\n  {% empty %}\n    <li>No topics added yet.</li>\n  {% endfor %}\n</ol>',5,72),(56,'<h2>All Courses</h2>\n<ul>\n  {% for course in courses %}\n    <li>\n      {{ forloop.counter }}. {{ course.title }} ({{ course.level|title }})\n      <a href=\"{% url \'course_update\' course.pk %}\">Edit</a>\n      <a href=\"{% url \'course_delete\' course.pk %}\">Delete</a>\n    </li>\n  {% empty %}\n    <li>No courses available.</li>\n  {% endfor %}\n</ul>',3,72),(57,'<ul>\n  {% for topic in topics %}\n    {% if topic.id == current_topic_id %}\n      <li><strong>{{ topic.title }}</strong> (current)</li>\n    {% else %}\n      <li>{{ topic.title }}</li>\n    {% endif %}\n  {% endfor %}\n</ul>',7,72),(58,'# settings.py\nSTATIC_URL = \"static/\"\n\nfrom pathlib import Path\nBASE_DIR = Path(__file__).resolve().parent.parent\n\nSTATICFILES_DIRS = [\n    BASE_DIR / \"static\",   # project-level static files\n]',3,73),(59,'STATIC_URL = \"static/\"',1,73),(60,'student_portal/\n  manage.py\n  student_portal/\n  courses/\n  static/\n    css/\n      main.css\n    img/\n      logo.png',5,73),(61,'body {\n  font-family: Arial, sans-serif;\n  background-color: #f8fafc;\n}\n\nheader {\n  background-color: #2563eb;\n  color: white;\n  padding: 10px 20px;\n}\n\n.course-card {\n  border: 1px solid #e5e7eb;\n  padding: 10px;\n  margin-bottom: 8px;\n  border-radius: 4px;\n}',7,73),(62,'{% load static %}\n<!DOCTYPE html>\n<html>\n  <head>\n    <title>{% block title %}Student Portal{% endblock %}</title>\n    <link rel=\"stylesheet\" href=\"{% static \'css/main.css\' %}\">\n  </head>\n  <body>\n    <header>\n      <img src=\"{% static \'img/logo.png\' %}\" alt=\"Student Portal Logo\" height=\"40\">\n      <span>Student Portal</span>\n    </header>\n\n    <main>\n      {% block content %}{% endblock %}\n    </main>\n  </body>\n</html>',9,73),(63,'{% extends \"courses/base.html\" %}\n\n{% block title %}Courses{% endblock %}\n\n{% block content %}\n  <h1>Courses</h1>\n  <a href=\"{% url \'course_create\' %}\">Add new course</a>\n\n  {% for course in courses %}\n    <div class=\"course-card\">\n      <strong>{{ course.title }}</strong> ({{ course.level|title }})\n    </div>\n  {% empty %}\n    <p>No courses yet.</p>\n  {% endfor %}\n{% endblock %}',11,73),(64,'pip install mysqlclient',1,74),(65,'CREATE DATABASE student_portal_db CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;',3,74),(66,'DATABASES = {\n    \"default\": {\n        \"ENGINE\": \"django.db.backends.mysql\",\n        \"NAME\": \"student_portal_db\",\n        \"USER\": \"root\",          # change to your MySQL user\n        \"PASSWORD\": \"yourpass\",  # change to your MySQL password\n        \"HOST\": \"127.0.0.1\",     # or \"localhost\" or server IP\n        \"PORT\": \"3306\",\n    }\n}',5,74),(67,'python manage.py makemigrations\npython manage.py migrate',7,74),(68,'python manage.py runserver',9,74),(69,'courses = Course.objects.all()',1,75),(70,'def course_list(request):\n    qs = Course.objects.all()\n\n    q = request.GET.get(\"q\")\n    if q:\n        qs = qs.filter(title__icontains=q)\n\n    return render(request, \"courses/course_list.html\", {\"courses\": qs, \"q\": q})',7,75),(71,'# All beginner courses\nbeginner_courses = Course.objects.filter(level=\"Beginner\")\n\n# All non-beginner courses\nnon_beginner = Course.objects.exclude(level=\"Beginner\")',3,75),(72,'# Beginner Django courses\ndjango_beginner = Course.objects.filter(title__icontains=\"django\", level=\"Beginner\")',5,75),(73,'<form method=\"get\">\n  <input type=\"text\" name=\"q\" value=\"{{ q }}\" placeholder=\"Search courses...\">\n  <button type=\"submit\">Search</button>\n</form>\n\n<ul>\n  {% for course in courses %}\n    <li>{{ course.title }} ({{ course.level|title }})</li>\n  {% empty %}\n    <li>No matching courses found.</li>\n  {% endfor %}\n</ul>',9,75),(74,'# Newest courses first (assuming a created_at field)\nlatest_courses = Course.objects.order_by(\"-id\")[:5]',11,75),(75,'popular_beginner = Course.objects.filter(level=\"Beginner\").order_by(\"-id\")',13,75),(76,'from django import forms\nfrom .models import Course\n\nclass CourseForm(forms.ModelForm):\n    class Meta:\n        model = Course\n        fields = [\"title\", \"level\", \"description\"]',1,76),(77,'from django.shortcuts import render, redirect, get_object_or_404\nfrom .forms import CourseForm\nfrom .models import Course\n\ndef course_create(request):\n    if request.method == \"POST\":\n        form = CourseForm(request.POST)\n        if form.is_valid():\n            form.save()  # all cleaned and validated data\n            return redirect(\"course_list\")\n    else:\n        form = CourseForm()\n    return render(request, \"courses/course_form.html\", {\"form\": form})',3,76),(78,'def course_update(request, pk):\n    course = get_object_or_404(Course, pk=pk)\n    if request.method == \"POST\":\n        form = CourseForm(request.POST, instance=course)\n        if form.is_valid():\n            form.save()\n            return redirect(\"course_list\")\n    else:\n        form = CourseForm(instance=course)\n    return render(request, \"courses/course_form.html\", {\"form\": form})',5,76),(79,'class CourseForm(forms.ModelForm):\n    class Meta:\n        model = Course\n        fields = [\"title\", \"level\", \"description\"]\n\n    def clean_title(self):\n        title = self.cleaned_data.get(\"title\", \"\")\n        if len(title.strip()) < 3:\n            raise forms.ValidationError(\"Title must be at least 3 characters long.\")\n        return title',9,76),(80,'<h1>{{ form.instance.pk|yesno:\"Edit Course,Add Course\" }}</h1>\n\n<form method=\"post\">\n  {% csrf_token %}\n\n  {% if form.errors %}\n    <ul style=\"color:red;\">\n      {% for field in form %}\n        {% for error in field.errors %}\n          <li>{{ field.label }}: {{ error }}</li>\n        {% endfor %}\n      {% endfor %}\n      {% for error in form.non_field_errors %}\n        <li>{{ error }}</li>\n      {% endfor %}\n    </ul>\n  {% endif %}\n\n  {{ form.as_p }}\n  <button type=\"submit\">Save</button>\n</form>',7,76),(81,'from django.db import models\n\nclass Course(models.Model):\n    title = models.CharField(max_length=200)\n    level = models.CharField(max_length=50, blank=True)\n    description = models.TextField(blank=True)\n\n    def __str__(self):\n        return self.title\n\n\nclass Topic(models.Model):\n    course = models.ForeignKey(Course, on_delete=models.CASCADE, related_name=\"topics\")\n    title = models.CharField(max_length=200)\n    order = models.PositiveIntegerField(default=0)\n\n    class Meta:\n        ordering = [\"order\"]\n\n    def __str__(self):\n        return self.title',1,77),(82,'from django.urls import path\nfrom . import views\n\nurlpatterns = [\n    path(\"\", views.course_list, name=\"course_list\"),\n    path(\"<int:pk>/\", views.course_detail, name=\"course_detail\"),\n    path(\"create/\", views.course_create, name=\"course_create\"),\n    path(\"<int:pk>/edit/\", views.course_update, name=\"course_update\"),\n    path(\"<int:pk>/delete/\", views.course_delete, name=\"course_delete\"),\n    path(\"<int:course_pk>/topics/add/\", views.topic_create, name=\"topic_create\"),\n]',9,77),(83,'from django.shortcuts import render, redirect, get_object_or_404\nfrom .models import Course, Topic\nfrom .forms import CourseForm, TopicForm\n\ndef course_list(request):\n    courses = Course.objects.all()\n    return render(request, \"courses/course_list.html\", {\"courses\": courses})\n\ndef course_detail(request, pk):\n    course = get_object_or_404(Course, pk=pk)\n    topics = course.topics.all()\n    return render(request, \"courses/course_detail.html\", {\"course\": course, \"topics\": topics})\n\ndef course_create(request):\n    if request.method == \"POST\":\n        form = CourseForm(request.POST)\n        if form.is_valid():\n            form.save()\n            return redirect(\"course_list\")\n    else:\n        form = CourseForm()\n    return render(request, \"courses/course_form.html\", {\"form\": form})\n\ndef course_update(request, pk):\n    course = get_object_or_404(Course, pk=pk)\n    if request.method == \"POST\":\n        form = CourseForm(request.POST, instance=course)\n        if form.is_valid():\n            form.save()\n            return redirect(\"course_list\")\n    else:\n        form = CourseForm(instance=course)\n    return render(request, \"courses/course_form.html\", {\"form\": form})\n\ndef course_delete(request, pk):\n    course = get_object_or_404(Course, pk=pk)\n    if request.method == \"POST\":\n        course.delete()\n        return redirect(\"course_list\")\n    return render(request, \"courses/course_confirm_delete.html\", {\"course\": course})\n\ndef topic_create(request, course_pk):\n    course = get_object_or_404(Course, pk=course_pk)\n    if request.method == \"POST\":\n        form = TopicForm(request.POST)\n        if form.is_valid():\n            topic = form.save(commit=False)\n            topic.course = course\n            topic.save()\n            return redirect(\"course_detail\", pk=course.pk)\n    else:\n        form = TopicForm()\n    return render(request, \"courses/topic_form.html\", {\"form\": form, \"course\": course})',7,77),(84,'from django import forms\nfrom .models import Course, Topic\n\nclass CourseForm(forms.ModelForm):\n    class Meta:\n        model = Course\n        fields = [\"title\", \"level\", \"description\"]\n\n\nclass TopicForm(forms.ModelForm):\n    class Meta:\n        model = Topic\n        fields = [\"title\", \"order\"]',5,77),(85,'python manage.py makemigrations\npython manage.py migrate',3,77),(86,'from django.contrib import admin\nfrom django.urls import path, include\n\nurlpatterns = [\n    path(\"admin/\", admin.site.urls),\n    path(\"courses/\", include(\"courses.urls\")),\n]',11,77),(87,'<!DOCTYPE html>\n<html>\n  <head>\n    <title>{% block title %}Student Course Hub{% endblock %}</title>\n  </head>\n  <body>\n    <header>\n      <h1>Student Course Hub</h1>\n      <nav>\n        <a href=\"{% url \'course_list\' %}\">Courses</a>\n      </nav>\n      <hr>\n    </header>\n\n    <main>\n      {% block content %}{% endblock %}\n    </main>\n  </body>\n</html>',13,77),(88,'{% extends \"courses/base.html\" %}\n\n{% block title %}Courses{% endblock %}\n\n{% block content %}\n  <h1>Courses</h1>\n  <a href=\"{% url \'course_create\' %}\">Add new course</a>\n\n  <ul>\n    {% for course in courses %}\n      <li>\n        <a href=\"{% url \'course_detail\' course.pk %}\">\n          {{ course.title }}\n        </a>\n        ({{ course.level|default:\"No level\" }})\n      </li>\n    {% empty %}\n      <li>No courses yet.</li>\n    {% endfor %}\n  </ul>\n{% endblock %}',15,77),(89,'{% extends \"courses/base.html\" %}\n\n{% block title %}{{ course.title }}{% endblock %}\n\n{% block content %}\n  <h1>{{ course.title }}</h1>\n  <p><strong>Level:</strong> {{ course.level|default:\"Not set\" }}</p>\n  <p>{{ course.description|default:\"No description yet.\" }}</p>\n\n  <h2>Topics</h2>\n  <a href=\"{% url \'topic_create\' course.pk %}\">Add topic</a>\n\n  <ol>\n    {% for topic in topics %}\n      <li>{{ topic.title }}</li>\n    {% empty %}\n      <li>No topics added yet.</li>\n    {% endfor %}\n  </ol>\n\n  <p>\n    <a href=\"{% url \'course_update\' course.pk %}\">Edit course</a> |\n    <a href=\"{% url \'course_delete\' course.pk %}\">Delete course</a> |\n    <a href=\"{% url \'course_list\' %}\">Back to list</a>\n  </p>\n{% endblock %}',17,77),(90,'{% extends \"courses/base.html\" %}\n\n{% block title %}Course Form{% endblock %}\n\n{% block content %}\n  <h1>Course Form</h1>\n  <form method=\"post\">\n    {% csrf_token %}\n    {{ form.as_p }}\n    <button type=\"submit\">Save</button>\n  </form>\n{% endblock %}',19,77);
