INSERT INTO `task_mcq_set_questions` VALUES (5,'Which of the following is the correct return type for main in a standard hosted C program?',1,'void main()',0,'int main()',1,'main()',0,'char main()',0,'Standard specifies int return type for hosted implementations. void main() is nonstandard.',0,'2026-01-15 02:20:23.242314','2026-01-15 02:20:23.242337',5),(6,'Which directive includes declarations from the standard I/O library?\n',1,'#include \"stdio.h\"',0,'#include <stdio.h>',1,' import stdio;',0,'#use <stdio.h>',0,'<...> includes system headers. \"...\" typically used for local headers.',1,'2026-01-15 02:20:23.248524','2026-01-15 02:20:23.248544',5),(7,'Given int main(int argc, char *argv[]), what is argv[0]',1,'First command-line argument passed by the user',0,'Pointer to a random memory location',0,'Program name / invocation path',1,'Number of command-line arguments',0,' By convention argv[0] holds program name or path; user args start from argv[1]',2,'2026-01-15 02:20:23.256206','2026-01-15 02:20:23.256238',5),(8,'Which of the following is not a compilation phase?\n',1,'Preprocessing',0,' Linking',0,'Garbage collection',1,'Assembly',0,'Garbage collection is runtime memory management; not a standard compilation phase.',3,'2026-01-15 02:20:23.262626','2026-01-15 02:20:23.262646',5),(9,'What is the effect of #define PI 3.14?\n',1,'Pi is a typed constant of type double.',0,'The preprocessor substitutes PI with 3.14 before compilation.',1,'Compiler reserves memory for PI.',0,'None  #define is a runtime statement.',0,'#define performs textual substitution at preprocessing.',4,'2026-01-15 02:20:23.270530','2026-01-15 02:20:23.270549',5),(10,'Which of these statements is valid inside a function body?',1,'int x;',1,'static int f();',0,'#include <stdio.h>',0,'All of the above',0,' #include is a preprocessor directive and should be at file scope (though technically can appear anywhere but not recommended inside function body). static int f(); is a declaration allowed at file scope; inside a block it\'s a function declaration but rarely used. Choose A for clear, good practice.',5,'2026-01-15 02:20:23.277105','2026-01-15 02:20:23.277124',5),(11,'What is the output of 5 % 2?',1,'2',0,'3',0,'1',1,'0',0,'',0,'2026-02-06 08:09:56.908577','2026-02-06 08:09:56.908594',6);
