e.</span></p>\n\n<h3 id=\"3-run-the-development-server\"><span style=\"font-family:Times New Roman,Times,serif;\">3. Run the development server</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Move into the new project folder and start the builtin server:</span></p>',8,66),(276,'<p><span style=\"font-family:Times New Roman,Times,serif;\">You should see Django&rsquo;s default welcome page, which confirms that your&nbsp;<code>student_portal</code>&nbsp;project is working. You can explain to students that this is just a starting page; they will replace it with their own views and templates in later lessons.</span></p>\n\n<p style=\"margin-left: 120px;\"><img src=\"data:image/gif;base64,\" /></p>',14,66),(277,'<p><span style=\"font-family:Times New Roman,Times,serif;\">If everything is set up correctly, the terminal will show messages ending with a line similar to:</span></p>',10,66),(278,'<p><span style=\"font-family:Times New Roman,Times,serif;\">This means Django is running locally on your machine.</span></p>\n\n<h3 id=\"4-view-the-project-in-the-browser\"><span style=\"font-family:Times New Roman,Times,serif;\">4. View the project in the browser</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Open your web browser and go to:</span></p>',12,66),(279,'<h3 id=\"1-what-is-a-django-app\"><span style=\"font-family:Times New Roman,Times,serif;\">1. What is a Django app?</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In Django, a&nbsp;<em>project</em>&nbsp;is the overall website configuration, and an&nbsp;<em>app</em>&nbsp;is a smaller module that does one specific job, such as handling courses, accounts, or blogs. A single project can contain many apps.</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">For this lesson, you will create an app called&nbsp;<code>courses</code>&nbsp;to manage courserelated pages in your&nbsp;<code>student_portal</code>&nbsp;project.</span></p>\n\n<h3 id=\"2-create-the-app\"><span style=\"font-family:Times New Roman,Times,serif;\">2. Create the app</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Make sure you are in the project folder where&nbsp;<code>manage.py</code>&nbsp;is located (for example, inside&nbsp;<code>student_portal/</code>), then run:</span></p>',0,67),(280,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Django will create a new&nbsp;<code>courses</code>&nbsp;folder with files like:</span></p>',2,67),(281,'<p><span style=\"font-family:Times New Roman,Times,serif;\">These files are the basic structure of your app. You will use&nbsp;<code>views.py</code>&nbsp;for request logic,&nbsp;<code>models.py</code>&nbsp;for data, and later&nbsp;<code>urls.py</code>&nbsp;and templates for routing and pages.</span></p>\n\n<h3 id=\"3-register-the-app-in-settings\"><span style=\"font-family:Times New Roman,Times,serif;\">3. Register the app in settings</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Open your project&rsquo;s settings file, usually at&nbsp;<code>student_portal/student_portal/settings.py</code>, and find the&nbsp;<code>INSTALLED_APPS</code>&nbsp;list. Add&nbsp;<code>&#39;courses&#39;</code>&nbsp;to that list:</span></p>',4,67),(282,'<h2>What is Java?</h2><p>Java is a popular and powerful programming language, created in 1995.</p><p>It is owned by Oracle, and more than <strong>3 billion</strong> devices run Java.</p><p>It is used for:</p><ul><li>Mobile applications (specially Android apps)</li><li>Desktop applications</li><li>Web applications</li><li>Web servers and application servers</li><li>Games</li><li>Database connection</li><li>And much, much more!</li></ul><h2>Why Use Java?</h2><ul><li>Java works on different platforms (Windows, Mac, Linux, Raspberry Pi, etc.)</li><li>It is one of the most popular programming languages in the world</li><li>It has a large demand in the current job market</li><li>It is easy to learn and simple to use</li><li>It is open-source and free</li><li>It is secure, fast and powerful</li><li>It has huge community support (tens of millions of developers)</li><li>Java is an object oriented language which gives a clear structure to programs and allows code to be reused, lowering development costs</li><li>As Java is close to <a href=\"https://www.w3schools.com/cpp/default.asp\">C++</a> and <a href=\"https://www.w3schools.com/cs/default.asp\">C#</a>, it makes it easy for programmers to switch to Java or vice versa</li></ul><h2>Java Example</h2><p>Java is often used in everyday programming tasks, like saying hello to a user:</p><h3>Example:</h3>',0,56),(283,'<p><span style=\"font-family:Times New Roman,Times,serif;\">This tells Django that the&nbsp;<code>courses</code>&nbsp;app is part of this project and should be loaded.</span></p>\n\n<h3 id=\"4-create-a-simple-view\"><span style=\"font-family:Times New Roman,Times,serif;\">4. Create a simple view</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Open&nbsp;<code>courses/views.py</code>&nbsp;and add a basic view function:</span></p>',6,67),(284,'<p><span style=\"font-family:Times New Roman,Times,serif;\">This view returns a simple text response when someone visits the app&rsquo;s page.</span></p>\n\n<h3><span style=\"font-family:Times New Roman,Times,serif;\">5. Add URLs for the app</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Create a new file&nbsp;<code>courses/urls.py</code>&nbsp;with the following content:</span></p>',8,67),(285,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Now connect the app&rsquo;s URLs to the project&rsquo;s main URL configuration. In&nbsp;<code>student_portal/student_portal/urls.py</code>, include the&nbsp;<code>courses</code>&nbsp;URLs:</span></p>',10,67),(286,'<p><span style=\"font-family:Times New Roman,Times,serif;\">This means any URL starting with /courses/ will go to the courses app URL patterns.</span></p>\n\n<h3><span style=\"font-family:Times New Roman,Times,serif;\">6. Test your first app<br />\nStart the development server if it is not already running:</span></h3>',12,67),(287,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Then open this address in your browser:</span></p>',14,67),(288,'<p><span style=\"font-family:Times New Roman,Times,serif;\">You should see the text: &ldquo;Welcome to the Courses app!&rdquo;, which confirms your first app is working.</span></p>',16,67),(289,'<h3 id=\"what-is-a-django-template\"><span style=\"font-family:Times New Roman,Times,serif;\">What is a Django template?</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">A template is usually an HTML file that defines how a page should look, with placeholders where data from your view will appear. Django&rsquo;s template language uses&nbsp;<code>{{ ... }}</code>&nbsp;for variables and&nbsp;<code>{% ... %}</code>&nbsp;for logic like loops and conditions.</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Example template file&nbsp;<code>home.html</code>:</span></p>',0,68),(290,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Here&nbsp;<code>name</code>&nbsp;and&nbsp;<code>page</code>&nbsp;are values that will come from the view.</span></p>\n\n<h3 id=\"where-to-put-templates\"><span style=\"font-family:Times New Roman,Times,serif;\">Where to put templates</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">A simple app-level structure is:</span></p>',2,68),(291,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Using&nbsp;<code>templates/courses/home.html</code>&nbsp;helps avoid name clashes when you have many apps.</span></p>\n\n<p>&nbsp;</p>\n\n<h3 id=\"rendering-a-template-from-a-view\"><span style=\"font-family:Times New Roman,Times,serif;\">Rendering a template from a view</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In&nbsp;<code><span style=\"backgrou