n></p>',4,69),(297,'<h3 id=\"template-tags\"><span style=\"font-family:Times New Roman,Times,serif;\">Template tags</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Tags add logic and structure (loops, conditions, including other templates, etc.). They are written inside&nbsp;<code>{% ... %}</code>.</span></p>\n\n<h3><span style=\"font-family:Times New Roman,Times,serif;\">Control flow tags</span></h3>\n\n<ol>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>if</code>&nbsp;/&nbsp;<code>elif</code>&nbsp;/&nbsp;<code>else</code>:</span></p>\n	</li>\n</ol>',9,69),(298,'<ol start=\"2\">\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>for</code>&nbsp;loop:</span></p>\n	</li>\n</ol>',11,69),(299,'<h3><span style=\"font-family:Times New Roman,Times,serif;\">Other useful tags</span></h3>\n\n<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>block</code>&nbsp;/&nbsp;<code>extends</code>&nbsp;(for inheritance, later topic)</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>include</code>&nbsp;(reuse a small template snippet)</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>url</code>&nbsp;(build links using URL names)</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>with</code>&nbsp;(create a shortlived variable):</span></p>\n	</li>\n</ul>',13,69),(300,'<h3 id=\"putting-them-together-small-example\"><span style=\"font-family:Times New Roman,Times,serif;\">Putting them together (small example)</span></h3>\n\n<h3><span style=\"font-family:Times New Roman,Times,serif;\">View:</span></h3>',15,69),(301,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Template&nbsp;<code><span style=\"background-color:#bdc3c7;\">courses/list.html</span></code><span style=\"background-color:#bdc3c7;\">:</span></span></p>',17,69),(302,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Here you are using:</span></p>\n\n<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Variables:&nbsp;<code>page_title</code>,&nbsp;<code>course.title</code>,&nbsp;<code>course.level</code></span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Filters:&nbsp;<code>upper</code>,&nbsp;<code>title</code></span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Tags:&nbsp;<code>for</code>,&nbsp;<code>endfor</code>, and the builtin&nbsp;<code>forloop.counter</code>.</span></p>\n	</li>\n</ul>',19,69),(303,'<p><span style=\"font-family:Times New Roman,Times,serif;\">You can chain filters:</span></p>',8,69),(306,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Django creates the&nbsp;<code>Course</code>&nbsp;table in the database.</span></p>\n\n<h3 id=\"2-create-a-form-basic-or-modelform\"><span style=\"font-family:Times New Roman,Times,serif;\">1. Create a form (basic or ModelForm)</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Simplest for beginners: use a&nbsp;<code>ModelForm</code>.</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>courses/forms.py</code></span></p>',1,70),(307,'<h3 id=\"3-crud-views-functionbased-very-simple\"><span style=\"font-family:Times New Roman,Times,serif;\">2. CRUD views (functionbased, very simple)</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In&nbsp;<code>courses/views.py</code>:</span></p>',3,70),(308,'<h3><span style=\"font-family:Times New Roman,Times,serif;\">3. URLs for CRUD</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>courses/urls.py</code>:</span></p>',5,70),(309,'<p><span style=\"font-family:Times New Roman,Times,serif;\">These map list/create/edit/delete routes to your views.</span></p>\n\n<h3 id=\"5-templates-for-list-form-delete\"><span style=\"font-family:Times New Roman,Times,serif;\">4. Templates for list, form, delete</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>templates/courses/course_list.html</code>:</span></p>',7,70),(310,'<p><span style=\"font-family:Times New Roman,Times,serif;\"><code><span style=\"background-color:#bdc3c7;\">templates/courses/course_form.html</span></code><span style=\"background-color:#bdc3c7;\">:</span></span></p>',9,70),(311,'<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>templates/courses/course_confirm_delete.html</code>:</span></p>',11,70),(312,'<p><span style=\"font-family:Times New Roman,Times,serif;\">This gives a full, minimal CRUD flow: view all courses, add a new one, edit existing, and delete</span></p>',13,70),(313,'<p>&nbsp;</p>\n\n<h2 id=\"what-is-a-django-model\"><span style=\"font-family:Times New Roman,Times,serif;\">What is a Django model?</span></h2>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In Django, a model is a Python class that represents a table in your database.<br />\nEach attribute in the class becomes a column (field) in that table, and each instance of the class becomes a row (record).</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">When you created your Django project, Django also created a default SQLite database file named&nbsp;<code>db.sqlite3</code>&nbsp;in the project root, which is used for all your models unless you change the settings.</span></p>\n\n<h2 id=\"create-a-course-model\"><span style=\"font-family:Times New Roman,Times,serif;\">Create a Course model</span></h2>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In your&nbsp;<code>courses</code>&nbsp;app, open&nbsp;<code>courses/models.py</code>&nbsp;and define a model that matches your learning platform:</span></p>',0,71),(314,'<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><strong><code><span style=\"background-color:#bdc3c7;\">title</span></code></strong>: short text, e.g., &ldquo;Django for Beginners&rdquo;.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><strong><code><span style=\"background-color:#bdc3c7;\">level</span></code></strong>: like &ldquo;Beginner&rdquo;, &ldquo;Intermediate&rdquo;; kept as a simple text for now.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><strong><code><span style=\"background-color:#bdc3c7;\">description</span></code></strong>: longer text that explains what the course covers.</span></p>\n	</li>\n</ul>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">You can add another model for topics if you want a course &rarr; many topics structure:</span></p>',2,71),(315,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Here, each topic belongs to one course, and&nbsp;<code>on_delete=models.CASCADE</code>&nbsp;means deleting a course removes its topics.</span></p>\n\n<h3 id=\"apply-migrations-create-tables-in-dbsqlite3\"><span style=\"font-family:Times New Roman,Times,serif;\">Apply migrations (create tables in db.sqlite3)</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Defining the model does not create the tables yet; you must run migrations.</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">From the project folder (where&nbsp;<code>manage.py</code>&nbsp;is):</span></p>',4,71),(316,'<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>makemigrations</code>&nbsp;scans your models and creates a migration file describing the new&nbsp;<code>Course</code>&nbsp;(and&nbsp;<code>Topic</code>) tables.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>migrate</code>&nbsp;reads those migration files and executes SQL against&nbsp;<code>db.sqlite3</code>&nbsp;to actually create the tables.</span></p>\n	</li>\n</ul>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">By default, Django also adds an&nbsp;<code>id</code>&nbsp;primary key field (autoincrementing integer) to each model if you don&rsquo;t define one yourself.</span></p>\n\n<h3 id=\"where-the-data-is-stored\"><span style=\"font-family:Times New Roman,Times,serif;\">Where the data is stored</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Your models are connected to the database configured in&nbsp;<code><span style=\"background-color:#bdc3c7;\">settings.py</span></code>, which for a fresh project is typically:</span></p>',6,71),(317,'<p><span style=\"font-family:Times New Roman,Times,serif;\">That means any&nbsp;<code>Course.objects.create(...)</code>, form save, or admin insert will store rows in the&nbsp;<code>db.sqlite3</code>&nbsp;file. You can later switch to PostgreSQL or another engine without rewriting model classes.</span></p>',8,71),(318,'<h3 id=\"template-tags-the-basics\"><span style=\"font-family:Times New Roman,Times,serif;\">Template tags: the basics</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Template tags are written inside&nbsp;<code>{% ... %}</code>&nbsp;and control logic or structure in the template. Common tags you will use in your student portal:</span></p>\n\n<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>{% if %} ... {% elif %} ... {% else %} ... {% endif %}</code>&nbsp;for conditions.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>{% for item in items %} ... {% endfor %}</code>&nbsp;for loops.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>{% url &#39;name&#39; %}</code>&nbsp;to build links from URL names instead of hardcoding paths.</span></p>\n	</li>\n</ul>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Example (check if there are any courses):</span></p>',0,72),(319,'<h3 id=\"looping-over-courses-or-topics\"><span style=\"font-family:Times New Roman,Times,serif;\">Looping over courses or topics</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In your project, you will often pass a queryset like&nbsp;<code>Course.objects.all()</code>&nbsp;or&nbsp;<code>course.topics.all()</code>&nbsp;to the template. Use the&nbsp;<code>for</code>&nbsp;tag to show each item:</span></p>',2,72),(320,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Key points here:</span></p>\n\n<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>forloop.counter</code>&nbsp;gives the current index (starting at 1).</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>{% empty %}</code>&nbsp;runs if&nbsp;<code>courses</code>&nbsp;is an empty list or queryset.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>{{ course.level|title }}</code>&nbsp;uses a filter to format text.</span></p>\n	</li>\n</ul>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">For topics under a course:</span></p>',4,72),(321,'<h3 id=\"using-if-with-loops-highlight-active-item\"><span style=\"font-family:Times New Roman,Times,serif;\">Using if with loops (highlight active item)</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Conditions can be combined with loops to show special content.</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Example: mark the current topic in a sidebar:</span></p>',6,72),(322,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Here the view passes&nbsp;<code>current_topic_id</code>&nbsp;in the context so the template can compare and highlight.</span></p>',8,72),(323,'<p><span style=\"font-family:Times New Roman,Times,serif;\">For development, a simple approach for your course is to create a projectlevel&nbsp;<code>static</code>&nbsp;folder and tell Django to look there:</span></p>',2,73),(324,'<h3 id=\"1-what-are-static-files\"><span style=\"font-family:Times New Roman,Times,serif;\">1. What are static files?</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Static files are files that do not change when the page is loaded: CSS stylesheets, JavaScript files, images, icons, etc. Django has a builtin app (<code>django.contrib.staticfiles</code>) to help you organize and serve these files during development.</span></p>\n\n<h3 id=\"2-basic-settings-for-static-files\"><span style=\"font-family:Times New Roman,Times,serif;\">2. Basic settings for static files</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In a default project, you usually have this in&nbsp;<code>settings.py</code>:</span></p>',0,73),(325,'<p><span style=\"font-family:Times New Roman,Times,serif;\">This means Django will search for static files inside&nbsp;<code>&lt;project_root&gt;/static/</code>&nbsp;when using the&nbsp;<code>{% static %}</code>&nbsp;tag.</span></p>\n\n<p>&nbsp;</p>\n\n<h3 id=\"3-create-css-and-image-folders\"><span style=\"font-family:Times New Roman,Times,serif;\">3. Create CSS and image folders</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Inside your project folder, create this structure:</span></p>',4,73),(326,'<p>Example&nbsp;<code>static/css/main.css</code>:</p>',6,73),(327,'<h3 id=\"4-load-static-files-in-your-base-template\"><span style=\"font-family:Times New Roman,Times,serif;\">4. Load static files in your base template</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In&nbsp;<code>templates/courses/base.html</code>&nbsp;(or your project&rsquo;s main base template), load static and include CSS and optional JS:</span></p>',8,73),(328,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Now when you refresh&nbsp;<code>/courses/</code>, they will see styled content using the CSS loaded via Django&rsquo;s static system.</span></p>',12,73),(329,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Key points for students:</span></p>\n\n<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>{% load static %}</code>&nbsp;must be at the top of any template that uses&nbsp;<code>{% static %}</code>.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Paths inside&nbsp;<code>{% static %}</code>&nbsp;are relative to the&nbsp;<code>static</code>&nbsp;directory (e.g.,&nbsp;<code>css/main.css</code>,&nbsp;<code>img/logo.png</code>).</span></p>\n	</li>\n</ul>\n\n<h3 id=\"5-example-styled-course-list\"><span style=\"font-family:Times New Roman,Times,serif;\">5. Example: styled course list</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Update&nbsp;<code>templates/courses/course_list.html</code>&nbsp;to use the CSS class:</span></p>',10,73),(330,'<p><span style=\"font-family:Times New Roman,Times,serif;\">To connect your Django portal to MySQL, configure the MySQL server, install a driver, then update&nbsp;<code>DATABASES</code>&nbsp;in&nbsp;<code>settings.py</code>&nbsp;and run migrations.</span></p>\n\n<h3 id=\"1-install-mysql-and-driver\"><span style=\"font-family:Times New Roman,Times,serif;\">1. Install MySQL and driver</span></h3>\n\n<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Install MySQL Server (or MariaDB) on your machine and create a database, e.g.&nbsp;<code>student_portal_db</code>.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">In your virtual environment, install the MySQL driver:</span></p>\n	</li>\n</ul>\n\n<p>&nbsp;</p>',0,74),(331,'<p><span style=\"font-family:Times New Roman,Times,serif;\">This is the officially recommended backend for MySQL in Django.</span></p>\n\n<h3 id=\"2-create-a-database-in-mysql\"><span style=\"font-family:Times New Roman,Times,serif;\">2. Create a database in MySQL</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">From a MySQL client:</span></p>',2,74),(332,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Or use any GUI (phpMyAdmin, MySQL Workbench) to create the same database name.</span></p>\n\n<p>&nbsp;</p>\n\n<h3 id=\"\"><span style=\"font-family:Times New Roman,Times,serif;\">3. Configure&nbsp;<code>settings.py</code></span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In your Django&nbsp;<code>settings.py</code>, replace the default SQLite&nbsp;<code>DATABASES</code>&nbsp;block with a MySQL one:</span></p>',4,74),(333,'<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>ENGINE</code>&nbsp;tells Django to use the MySQL backend, and the other fields are your normal MySQL credentials.</span></p>\n\n<h3 id=\"4-run-migrations-on-mysql\"><span style=\"font-family:Times New Roman,Times,serif;\">4. Run migrations on MySQL</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">With this configuration active, run:</span></p>',6,74),(334,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Django will now create all tables for your models (Course, Topic, auth tables, etc.) inside&nbsp;<code>student_portal_db</code>&nbsp;instead of&nbsp;<code>db.sqlite3</code>.</span></p>\n\n<h3 id=\"5-quick-check\"><span style=\"font-family:Times New Roman,Times,serif;\">5. Quick check</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Run the server:</span></p>',8,74),(335,'<p><span style=\"font-family:Times New Roman,Times,serif;\">If there is no database error and your site loads, the connection works. You can open MySQL Workbench or the MySQL CLI and run&nbsp;<code>SHOW TABLES;</code>&nbsp;on&nbsp;<code>student_portal_db</code>&nbsp;to see Djangocreated tables.</span></p>',10,74),(336,'<p><span style=\"font-family:Times New Roman,Times,serif;\">In student portal, QuerySets are how Django lets you search and filter&nbsp;<code>Course</code>&nbsp;or&nbsp;<code>Topic</code>&nbsp;rows using Python instead of raw SQL</span></p>\n\n<h3 id=\"what-is-a-queryset\"><span style=\"font-family:Times New Roman,Times,serif;\">What is a QuerySet?</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">A QuerySet is a collection of objects from your database, built by chaining methods like&nbsp;<code>all()</code>,&nbsp;<code>filter()</code>,&nbsp;<code>exclude()</code>, and&nbsp;<code>order_by()</code>. It is lazy, which means the query only hits the database when you actually use the results (iterate, convert to list, etc.).</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Example (all courses):</span></p>',0,75),(337,'<h3 id=\"basic-filtering\"><span style=\"font-family:Times New Roman,Times,serif;\">Basic filtering</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Use&nbsp;<code>filter()</code>&nbsp;to keep only matching rows; use&nbsp;<code>exclude()</code>&nbsp;to remove rows that match a condition.</span></p>',2,75),(338,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Here&nbsp;<code>title__icontains</code>&nbsp;does a caseinsensitive substring search on the title.</span></p>\n\n<h3 id=\"searching-simple-text-search\"><span style=\"font-family:Times New Roman,Times,serif;\">Searching (simple text search)</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">In a &ldquo;course list&rdquo; view, you might let the user type a search term:</span></p>',6,75),(339,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Multiple conditions use AND by default:</span></p>',4,75),(340,'<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">If&nbsp;<code>q</code>&nbsp;is provided (e.g.&nbsp;<code>?q=django</code>), only courses whose title contains that text are returned.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">If&nbsp;<code>q</code>&nbsp;is empty, all courses are shown.</span></p>\n	</li>\n</ul>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Template snippet:</span></p>',8,75),(341,'<h3 id=\"ordering-and-limiting\"><span style=\"font-family:Times New Roman,Times,serif;\">Ordering and limiting</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Use&nbsp;<code>order_by()</code>&nbsp;to sort and slicing to limit results.</span></p>',10,75),(342,'<p><span style=\"font-family:Times New Roman,Times,serif;\">You can mix filtering and ordering:</span></p>',12,75),(343,'<h3 id=\"typical-patterns-to-teach-students\"><span style=\"font-family:Times New Roman,Times,serif;\">Typical patterns to teach students</span></h3>\n\n<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><strong>Read all:</strong>&nbsp;<code>Course.objects.all()</code></span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><strong>Filter by exact field:</strong>&nbsp;<code>Course.objects.filter(level=&quot;Beginner&quot;)</code></span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><strong>Search text:</strong>&nbsp;<code>Course.objects.filter(title__icontains=query)</code></span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><strong>Exclude something:</strong>&nbsp;<code>Course.objects.exclude(level=&quot;Advanced&quot;)</code></span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><strong>Sort and limit:</strong>&nbsp;<code>Course.objects.order_by(&quot;title&quot;)[:10]</code></span></p>\n	</li>\n</ul>',14,75),(344,'<p><span style=\"font-family:Times New Roman,Times,serif;\">In your portal, &ldquo;Building Simple Forms and Validating Input&rdquo; can focus on a&nbsp;<code>CourseForm</code>&nbsp;that lets users add courses safely and shows clear error messages when input is wrong.</span></p>\n\n<p>&nbsp;</p>\n\n<h3 id=\"1-basic-modelform-for-course\"><span style=\"font-family:Times New Roman,Times,serif;\">1. Basic ModelForm for Course</span></h3>\n\n<p><code><span style=\"background-color:#bdc3c7;\">forms.py</span></code><span style=\"background-color:#bdc3c7;\">:</span></p>\n\n<pre>\n\n&nbsp;</pre>',0,76),(345,'<p><span style=\"font-family:Times New Roman,Times,serif;\">This automatically creates form fields based on the&nbsp;<code>Course</code>&nbsp;model and handles a lot of validation for you (required fields, max lengths, types).</span></p>\n\n<h3 id=\"2-handling-get-vs-post-in-the-view\"><span style=\"font-family:Times New Roman,Times,serif;\">2. Handling GET vs POST in the view</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>views.py</code>&nbsp;(create or update look similar):</span></p>',2,76),(346,'<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">On GET, show an empty form.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">On POST, bind data, run&nbsp;<code>form.is_valid()</code>, and if everything passes, save and redirect.</span></p>\n	</li>\n</ul>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">For editing, pass&nbsp;<code>instance</code>:</span></p>',4,76),(347,'<h2 id=\"3-showing-errors-in-the-template\">3. Showing errors in the template</h2>\n\n<p><code>templates/courses/course_form.html</code>:</p>',6,76),(348,'<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>clean_title</code>&nbsp;runs when&nbsp;<code>is_valid()</code>&nbsp;is called.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">If it raises&nbsp;<code>ValidationError</code>, the error appears next to the title field in the template.</span></p>\n	</li>\n</ul>\n\n<h3 id=\"5-key-ideas-to-teach\"><span style=\"font-family:Times New Roman,Times,serif;\">5. Key ideas to teach</span></h3>\n\n<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Always use&nbsp;<code>if form.is_valid():</code>&nbsp;before saving or using input.</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Access validated values via&nbsp;<code>form.cleaned_data[...]</code>&nbsp;(or just&nbsp;<code>form.save()</code>&nbsp;for ModelForms).</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Use builtin validation (required, max_length, EmailField, etc.) and add&nbsp;<code>clean_&lt;field&gt;()</code>&nbsp;or&nbsp;<code>clean()</code>&nbsp;for custom rules.</span></p>\n	</li>\n</ul>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">If you want, next step can be a short quiz for this chapter (what&nbsp;<code>is_valid()</code>&nbsp;does, where&nbsp;<code>cleaned_data</code>&nbsp;lives, how to add&nbsp;<code>clean_title</code>).</span></p>',10,76),(349,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Django will automatically add error messages for required fields, invalid values, etc., which you display by looping over&nbsp;<code>form.errors</code>.</span></p>\n\n<h3 id=\"4-adding-a-simple-custom-validation-rule\"><span style=\"font-family:Times New Roman,Times,serif;\">4. Adding a simple custom validation rule</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Example: do not allow an empty or extremely short course title.</span></p>',8,76),(350,'<p><span style=\"font-family:Times New Roman,Times,serif;\">This creates two tables in the database: one for courses and one for topics.</span></p>\n\n<h3 id=\"step-2-create-forms\"><span style=\"font-family:Times New Roman,Times,serif;\">Step 2: Create forms</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Use Django ModelForms to build forms for creating and editing courses and topics.</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>courses/forms.py</code>:</span></p>',4,77),(351,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Use this miniproject as a guided demo: build a &ldquo;Student Course Hub&rdquo; where users can manage courses and their topics. Below is a classroomfriendly flow you can walk students through.</span></p>\n\n<h3 id=\"1-project-overview-tell-students\"><span style=\"font-family:Times New Roman,Times,serif;\">1. Project overview (tell students)</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Goal:<br />\n&ldquo;Today we will build a small Django site called Student Course Hub. You can add courses (like &lsquo;Django Basics&rsquo;), attach topics under each course (like &lsquo;Templates&rsquo;, &lsquo;Models&rsquo;), and see them neatly on pages.&rdquo;</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Explain the features:</span></p>\n\n<ul>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Add / edit / delete courses</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">Add topics under a course</span></p>\n	</li>\n	<li>\n	<p><span style=\"font-family:Times New Roman,Times,serif;\">View course list and course detail with topics</span></p>\n	</li>\n</ul>\n\n<h3 id=\"2-show-models\"><span style=\"font-family:Times New Roman,Times,serif;\">2. Show models</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">Explain: &ldquo;These Python classes become database tables.&rdquo;</span></p>\n\n<p><code>courses/models.py</code>:</p>',0,77),(352,'<p><span style=\"font-family:Times New Roman,Times,serif;\">Run migrations (demo in terminal):</span></p>',2,77),(353,'<p><span style=\"font-family:Times New Roman,Times,serif;\">ModelForms automatically generate form fields from the model definitions and include builtin validation.</span></p>\n\n<p>&nbsp;</p>\n\n<h3 id=\"step-3-implement-views\"><span style=\"font-family:Times New Roman,Times,serif;\">Step 3: Implement views</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">The views handle the CRUD logic for&nbsp;<code>Course</code>&nbsp;and topic creation for a given course.</span></p>\n\n<p><code><span style=\"background-color:#bdc3c7;\">courses/views.py</span></code><span style=\"background-color:#bdc3c7;\">:</span></p>',6,77),(354,'<p><span style=\"font-family:Times New Roman,Times,serif;\">In the project&rsquo;s main&nbsp;<code><span style=\"background-color:#bdc3c7;\">urls.py</span></code><span style=\"background-color:#bdc3c7;\">:</span></span></p>',10,77),(355,'<p><span style=\"font-family:Times New Roman,Times,serif;\">These views implement list, detail, create, update, and delete operations for courses, plus a simple topiccreation view.</span></p>\n\n<h3 id=\"step-4-configure-urls\"><span style=\"font-family:Times New Roman,Times,serif;\">Step 4: Configure URLs</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\"><code><span style=\"background-color:#bdc3c7;\">courses/urls.py</span></code><span style=\"background-color:#bdc3c7;\">:</span></span></p>',8,77),(356,'<p><span style=\"font-family:Times New Roman,Times,serif;\">All URLs for the miniproject are now accessible under the&nbsp;<code>/courses/</code>&nbsp;path.</span></p>\n\n<h3 id=\"step-5-create-templates\"><span style=\"font-family:Times New Roman,Times,serif;\">Step 5: Create templates</span></h3>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\">These templates use template inheritance, variables, tags, and loops.</span></p>\n\n<p><span style=\"font-family:Times New Roman,Times,serif;\"><code>templates/courses/base.html</code>&nbsp;(simplified example):</span></p>',12,77),(357,'<p><code><span style=\"background-color:#bdc3c7;\">templates/courses/course_list.html</span></code><span style=\"background-color:#bdc3c7;\">:</span></p>',14,77),(358,'<p><code><span style=\"background-color:#bdc3c7;\">templates/courses/course_detail.html</span></code><span style=\"background-color:#bdc3c7;\">:</span></p>',16,77),(359,'<p><code><span style=\"background-color:#ecf0f1;\">templates/courses/course_form.html</span></code><span style=\"background-color:#ecf0f1;\">:</span></p>',18,77),(360,'<p><span style=\"font-family:Times New Roman,Times,serif;\">These templates demonstrate using template inheritance, blocks, variables, and loops in a real miniproject</span></p>',20,77),(361,'<p>A step-by-step explanation of every part of a C program &mdash; from headers and <code data-end=\"504\" data-start=\"496\">main()</code> to compilation phases &mdash; with examples, common pitfalls, exercises, and MCQs designed to teach correct concepts.</p>\n\n<p>&nbsp;</p>\n\n<h2 data-end=\"1089\" data-start=\"1069\">1. Quick overview</h2>\n\n<p data-end=\"1197\" data-start=\"1090\">A C program is written as plain text in a file (usually with <code data-end=\"1155\" data-start=\"1151\">.c</code> extension). A typical C program contains:</p>\n\n<ul data-end=\"1431\" data-start=\"1198\">\n	<li data-end=\"1253\" data-start=\"1198\">\n	<p data-end=\"1253\" data-start=\"1200\">Preprocessor directives (e.g., <code data-end=\"1241\" data-start=\"1231\">#include</code>, <code data-end=\"1252\" data-start=\"1243\">#define</code>)</p>\n	</li>\n	<li data-end=\"1286\" data-start=\"1254\">\n	<p data-end=\"1286\" data-start=\"1256\">Global declarations (optional)</p>\n	</li>\n	<li data-end=\"1339\" data-start=\"1287\">\n	<p data-end=\"1339\" data-start=\"1289\">Function declarations (prototypes) and definitions</p>\n	</li>\n	<li data-end=\"1385\" data-start=\"1340\">\n	<p data-end=\"1385\" data-start=\"1342\">The <code data-end=\"1354\" data-start=\"1346\">main()</code> function &mdash; program entry point</p>\n	</li>\n	<li data-end=\"1431\" data-start=\"1386\">\n	<p data-end=\"1431\" data-start=\"1388\">Statements and expressions inside functions</p>\n	</li>\n</ul>\n\n<p data-end=\"1510\" data-start=\"1433\">Below is a minimal complete C program followed by a line-by-line explanation.</p>',0,78),(362,'<p data-end=\"1926\" data-start=\"1890\"><strong data-end=\"1926\" data-start=\"1890\">Explanation (map to code above):</strong></p>\n\n<ul data-end=\"2530\" data-start=\"1927\">\n	<li data-end=\"2010\" data-start=\"1927\">\n	<p data-end=\"2010\" data-start=\"1929\"><code data-end=\"1940\" data-start=\"1929\">/* ... */</code> &mdash; a block comment; comments explain code and are ignored by compiler.</p>\n	</li>\n	<li data-end=\"2156\" data-start=\"2011\">\n	<p data-end=\"2156\" data-start=\"2013\"><code data-end=\"2033\" data-start=\"2013\">#include &lt;stdio.h&gt;</code> &mdash; instructs preprocessor to insert declarations for I/O functions like <code data-end=\"2113\" data-start=\"2105\">printf</code>. Angle brackets indicate standard headers.</p>\n	</li>\n	<li data-end=\"2319\" data-start=\"2157\">\n	<p data-end=\"2319\" data-start=\"2159\"><code data-end=\"2175\" data-start=\"2159\">int main(void)</code> &mdash; <code data-end=\"2184\" data-start=\"2178\">main</code> returns an <code data-end=\"2201\" data-start=\"2196\">int</code>. <code data-end=\"2209\" data-start=\"2203\">void</code> means it takes no arguments. This is the recommended signature for programs that don&rsquo;t use command-line args.</p>\n	</li>\n	<li data-end=\"2376\" data-start=\"2320\">\n	<p data-end=\"2376\" data-start=\"2322\"><code data-end=\"2331\" data-start=\"2322\">{ ... }</code> &mdash; braces define the function body (a block).</p>\n	</li>\n	<li data-end=\"2445\" data-start=\"2377\">\n	<p data-end=\"2445\" data-start=\"2379\"><code data-end=\"2403\" data-start=\"2379\">printf(&quot;Hello, C!\\n&quot;);</code> &mdash; a statement; ending semicolon required.</p>\n	</li>\n	<li data-end=\"2530\" data-start=\"2446\">\n	<p data-end=\"2530\" data-start=\"2448\"><code data-end=\"2459\" data-start=\"2448\">return 0;</code> &mdash; returns 0 to the operating system; conventionally indicates success.</p>\n	</li>\n</ul>\n\n<p data-end=\"2530\" data-start=\"2448\">&nbsp;</p>\n\n<h2 data-end=\"2583\" data-start=\"2537\">2. Header files and preprocessor directives</h2>\n\n<ul data-end=\"2983\" data-start=\"2584\">\n	<li data-end=\"2788\" data-start=\"2584\">\n	<p data-end=\"2726\" data-start=\"2586\"><strong data-end=\"2600\" data-start=\"2586\"><code data-end=\"2598\" data-start=\"2588\">#include</code></strong>: Inserts the content of header files at preprocessing. Use <code data-end=\"2667\" data-start=\"2660\">&lt;...&gt;</code> for standard library headers and <code data-end=\"2708\" data-start=\"2701\">&quot;...&quot;</code> for user headers.</p>\n\n	<ul data-end=\"2788\" data-start=\"2729\">\n		<li data-end=\"2788\" data-start=\"2729\">\n		<p data-end=\"2788\" data-start=\"2731\">Example: <code data-end=\"2760\" data-start=\"2740\">#include &quot;utils.h&quot;</code> (searches local dir first).</p>\n		</li>\n	</ul>\n	</li>\n	<li data-end=\"2923\" data-start=\"2789\">\n	<p data-end=\"2889\" data-start=\"2791\"><strong data-end=\"2804\" data-start=\"2791\"><code data-end=\"2802\" data-start=\"2793\">#define</code></strong>: Text substitution macro. Use sparingly and prefer <code data-end=\"2863\" data-start=\"2856\">const</code> or <code data-end=\"2873\" data-start=\"2867\">enum</code> where possible.</p>\n\n	<ul data-end=\"2923\" data-start=\"2892\">\n		<li data-end=\"2923\" data-start=\"2892\">\n		<p data-end=\"2923\" data-start=\"2894\">Example: <code data-end=\"2923\" data-start=\"2903\">#define MAXLEN 100</code></p>\n		</li>\n	</ul>\n	</li>\n	<li data-end=\"2983\" data-start=\"2924\">\n	<p data-end=\"2983\" data-start=\"2926\"><strong data-end=\"2944\" data-start=\"2926\">Include guards</strong> (in headers) prevent double inclusion:</p>\n	</li>\n</ul>',2,78),(363,'<h2 data-end=\"3186\" data-start=\"3161\">3. <code data-end=\"3175\" data-start=\"3167\">main()</code> signatures</h2>\n\n<p data-end=\"3211\" data-start=\"3187\">Common legal signatures:</p>',4,78),(364,'<p data-end=\"3456\" data-start=\"3373\">Avoid <code data-end=\"3392\" data-start=\"3379\">void main()</code> as it is non-standard for hosted environments (use <code data-end=\"3454\" data-start=\"3444\">int main</code>).</p>\n\n<p data-end=\"3489\" data-start=\"3458\"><strong data-end=\"3487\" data-start=\"3458\">Meaning of <code data-end=\"3477\" data-start=\"3471\">argc</code>/<code data-end=\"3484\" data-start=\"3478\">argv</code>:</strong></p>\n\n<ul data-end=\"3597\" data-start=\"3490\">\n	<li data-end=\"3539\" data-start=\"3490\">\n	<p data-end=\"3539\" data-start=\"3492\"><code data-end=\"3498\" data-start=\"3492\">argc</code> &mdash; number of command-line tokens (&ge; 1).</p>\n	</li>\n	<li data-end=\"3597\" data-start=\"3540\">\n	<p data-end=\"3597\" data-start=\"3542\"><code data-end=\"3548\" data-start=\"3542\">argv</code> &mdash; array of C-strings; <code data-end=\"3580\" data-start=\"3571\">argv[0]</code> is program name.</p>\n	</li>\n</ul>\n\n<p data-end=\"3597\" data-start=\"3542\">&nbsp;</p>\n\n<h2 data-end=\"3637\" data-start=\"3604\">4. Declarations vs Definitions</h2>\n\n<ul data-end=\"4001\" data-start=\"3638\">\n	<li data-end=\"3773\" data-start=\"3638\">\n	<p data-end=\"3726\" data-start=\"3640\"><strong data-end=\"3655\" data-start=\"3640\">Declaration</strong> tells the compiler about the type and name (e.g., function prototype).</p>\n\n	<ul data-end=\"3773\" data-start=\"3729\">\n		<li data-end=\"3773\" data-start=\"3729\">\n		<p data-end=\"3773\" data-start=\"3731\"><code data-end=\"3773\" data-start=\"3731\">int sum(int a, int b); /* declaration */</code></p>\n		</li>\n	</ul>\n	</li>\n	<li data-end=\"3883\" data-start=\"3774\">\n	<p data-end=\"3820\" data-start=\"3776\"><strong data-end=\"3790\" data-start=\"3776\">Definition</strong> provides the body or storage.</p>\n\n	<ul data-end=\"3883\" data-start=\"3823\">\n		<li data-end=\"3883\" data-start=\"3823\">\n		<p data-end=\"3883\" data-start=\"3825\"><code data-end=\"3883\" data-start=\"3825\">int sum(int a, int b) { return a + b; } /* definition */</code></p>\n		</li>\n	</ul>\n	</li>\n	<li data-end=\"4001\" data-start=\"3884\">\n	<p data-end=\"4001\" data-start=\"3886\">For global variables, definitions allocate space. Avoid unwanted multiple definitions by using <code data-end=\"3989\" data-start=\"3981\">extern</code> in headers.</p>\n	</li>\n</ul>\n\n<p data-end=\"4001\" data-start=\"3886\">&nbsp;</p>\n\n<h2 data-end=\"4058\" data-start=\"4008\">5. Compilation phases (what the toolchain does)</h2>\n\n<ol data-end=\"4322\" data-start=\"4059\">\n	<li data-end=\"4155\" data-start=\"4059\">\n	<p data-end=\"4155\" data-start=\"4062\"><strong data-end=\"4079\" data-start=\"4062\">Preprocessing</strong> (<code data-end=\"4089\" data-start=\"4081\">gcc -E</code>): handles <code data-end=\"4110\" data-start=\"4100\">#include</code>, <code data-end=\"4121\" data-start=\"4112\">#define</code>, macros, conditional compilation.</p>\n	</li>\n	<li data-end=\"4205\" data-start=\"4156\">\n	<p data-end=\"4205\" data-start=\"4159\"><strong data-end=\"4174\" data-start=\"4159\">Compilation</strong> (<code data-end=\"4184\" data-start=\"4176\">gcc -S</code>): source &rarr; assembly.</p>\n	</li>\n	<li data-end=\"4260\" data-start=\"4206\">\n	<p data-end=\"4260\" data-start=\"4209\"><strong data-end=\"4221\" data-start=\"4209\">Assembly</strong> (<code data-end=\"4227\" data-start=\"4223\">as</code>): assembly &rarr; object file (<code data-end=\"4258\" data-start=\"4254\">.o</code>).</p>\n	</li>\n	<li data-end=\"4322\" data-start=\"4261\">\n	<p data-end=\"4322\" data-start=\"4264\"><strong data-end=\"4275\" data-start=\"4264\">Linking</strong> (<code data-end=\"4281\" data-start=\"4277\">ld</code>): object files + libraries &rarr; executable.</p>\n	</li>\n</ol>\n\n<p data-end=\"4467\" data-start=\"4324\">You can see intermediate outputs with flags: <code data-end=\"4384\" data-start=\"4369\">gcc -E file.c</code> (preprocessed), <code data-end=\"4416\" data-start=\"4401\">gcc -S file.c</code> (assembly), or <code data-end=\"4447\" data-start=\"4432\">gcc -c file.c</code> (object file only).</p>\n\n<p data-end=\"4493\" data-start=\"4469\">&nbsp;</p>\n\n<h2 data-end=\"4793\" data-start=\"4756\">6. Common beginner mistakes &amp; tips</h2>\n\n<ul data-end=\"5217\" data-start=\"4794\">\n	<li data-end=\"4836\" data-start=\"4794\">\n	<p data-end=\"4836\" data-start=\"4796\">Missing semicolon <code data-end=\"4817\" data-start=\"4814\">;</code> &mdash; syntactic error.</p>\n	</li>\n	<li data-end=\"4945\" data-start=\"4837\">\n	<p data-end=\"4945\" data-start=\"4839\">Using <code data-end=\"4853\" data-start=\"4845\">printf</code> without <code data-end=\"4882\" data-start=\"4862\">#include &lt;stdio.h&gt;</code> &mdash; modern compilers will warn/error about implicit declaration.</p>\n	</li>\n	<li data-end=\"4996\" data-start=\"4946\">\n	<p data-end=\"4996\" data-start=\"4948\">Mismatched braces <code data-end=\"4970\" data-start=\"4966\">{}</code> &mdash; unmatched block errors.</p>\n	</li>\n	<li data-end=\"5082\" data-start=\"4997\">\n	<p data-end=\"5082\" data-start=\"4999\">Using <code data-end=\"5008\" data-start=\"5005\">=</code> instead of <code data-end=\"5024\" data-start=\"5020\">==</code> in conditions: <code data-end=\"5052\" data-start=\"5040\">if (a = 5)</code> assigns; use <code data-end=\"5070\" data-start=\"5066\">==</code> to compare.</p>\n	</li>\n	<li data-end=\"5163\" data-start=\"5083\">\n	<p data-end=\"5163\" data-start=\"5085\">Not checking return values of I/O and system calls &mdash; practice checking errors.</p>\n	</li>\n	<li data-end=\"5217\" data-start=\"5164\">\n	<p data-end=\"5217\" data-start=\"5166\">Using uninitialized variables &mdash; undefined behavior.</p>\n	</li>\n</ul>',6,78),(365,'<h1 data-end=\"2197\" data-start=\"2173\">2. <code data-end=\"2187\" data-start=\"2178\">if&ndash;else</code> Statement</h1>\n\n<h2 data-end=\"2208\" data-start=\"2199\">Syntax</h2>\n\n<pre data-end=\"2282\" data-start=\"2209\">\n\n&nbsp;</pre>\n\n<p><code>if (condition)</code></p>\n\n<p><code>&nbsp; { // true block } </code></p>\n\n<p><code>else </code></p>\n\n<p><code>&nbsp; { // false block }</code></p>\n\n<p>Example</p>',2,79),(366,'<h2 data-end=\"2504\" data-start=\"2493\">Key Rule</h2>\n\n<p data-end=\"2581\" data-start=\"2505\"> Exactly <strong data-end=\"2537\" data-start=\"2515\">one block executes</strong><br data-end=\"2540\" data-start=\"2537\" />\n Both blocks <strong data-end=\"2581\" data-start=\"2554\">cannot execute together</strong></p>\n\n<p data-end=\"2581\" data-start=\"2505\">&nbsp;</p>\n\n<p data-end=\"2581\" data-start=\"2505\">&nbsp;</p>\n\n<h1 data-end=\"2609\" data-start=\"2588\">3. <code data-end=\"2602\" data-start=\"2593\">else&ndash;if</code> Ladder</h1>\n\n<p data-end=\"2661\" data-start=\"2611\">Used when <strong data-end=\"2644\" data-start=\"2621\">multiple conditions</strong> must be checked.</p>\n\n<p data-end=\"2661\" data-start=\"2611\">if (condition1)<br />\n{<br />\n}<br />\nelse if (condition2)<br />\n{<br />\n}<br />\nelse if (condition3)<br />\n{<br />\n}<br />\nelse<br />\n{<br />\n}<br />\n&nbsp;</p>\n\n<p data-end=\"2661\" data-start=\"2611\">Example: Grade System</p>',4,79),(367,'<h2 data-end=\"3103\" data-start=\"3082\">Important Behavior</h2>\n\n<ul data-end=\"3213\" data-start=\"3104\">\n	<li data-end=\"3146\" data-start=\"3104\">\n	<p data-end=\"3146\" data-start=\"3106\">Conditions are checked <strong data-end=\"3146\" data-start=\"3129\">top to bottom</strong></p>\n	</li>\n	<li data-end=\"3178\" data-start=\"3147\">\n	<p data-end=\"3178\" data-start=\"3149\">First true condition executes</p>\n	</li>\n	<li data-end=\"3213\" data-start=\"3179\">\n	<p data-end=\"3213\" data-start=\"3181\">Remaining conditions are skipped</p>\n	</li>\n</ul>\n\n<h1 data-end=\"3236\" data-start=\"3220\">4. Nested <code data-end=\"3236\" data-start=\"3232\">if</code></h1>\n\n<p data-end=\"3266\" data-start=\"3238\">An <code data-end=\"3245\" data-start=\"3241\">if</code> inside another <code data-end=\"3265\" data-start=\"3261\">if</code>.</p>\n\n<p data-end=\"3266\" data-start=\"3238\">Syntax</p>\n\n<p data-end=\"3266\" data-start=\"3238\">if (condition1)<br />\n{<br />\n&nbsp; &nbsp; if (condition2)<br />\n&nbsp; &nbsp; {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; // statements<br />\n&nbsp; &nbsp; }<br />\n}<br />\n&nbsp;</p>\n\n<p data-end=\"3266\" data-start=\"3238\">Example: Eligibility Check</p>',6,79),(368,'<h2 data-end=\"3775\" data-start=\"3747\">When to Avoid Nested <code data-end=\"3775\" data-start=\"3771\">if</code></h2>\n\n<ul data-end=\"3850\" data-start=\"3776\">\n	<li data-end=\"3810\" data-start=\"3776\">\n	<p data-end=\"3810\" data-start=\"3778\">Deep nesting reduces readability</p>\n	</li>\n	<li data-end=\"3850\" data-start=\"3811\">\n	<p data-end=\"3850\" data-start=\"3813\">Prefer <code data-end=\"3829\" data-start=\"3820\">else&ndash;if</code> ladder when possible</p>\n	</li>\n</ul>\n\n<p data-end=\"3850\" data-start=\"3813\">&nbsp;</p>\n\n<h1 data-end=\"3850\" data-start=\"3813\">5. Conditional (Ternary) Operator <code data-end=\"3897\" data-start=\"3893\">?:</code></h1>\n\n<p>Syntax</p>\n\n<p>condition ? expression1 : expression2;<br />\n&nbsp;</p>',8,79),(369,'<h2 data-end=\"4148\" data-start=\"4134\">When to Use</h2>\n\n<p data-end=\"4196\" data-start=\"4149\"> Simple conditions<br data-end=\"4171\" data-start=\"4168\" />\n Single-line decisions</p>\n\n<p data-end=\"4223\" data-start=\"4198\"> Avoid for complex logic</p>',10,79),(370,'<p>test</p>',0,90);
