INSERT INTO `topics` VALUES (4,'0d14a521a21841cd86833cb28e06fcc0','Getting Started with C','C is a general-purpose, compiled programming language developed in the early 1970s at Bell Labs by Dennis Ritchie. Its widely used for system programming, embedded devices, and performance-critical software.\nShows how software talks to hardware, helps you understand memory, pointers, and low-level program structure. Great foundation for other languages.\nMinimal example :\nint main(void) {\n    printf(\"Hello, world!\\n\");\n    return 0;\n}\nPractice: compile and run the example using gcc hello.c -o hello and ./hello.',1,1,'2025-11-20 06:40:27.620687','2026-01-14 17:43:09.685538',3),(5,'cc0ce09ff26f4ed4837126d77b1936a7','Character set in C','The set of characters the language source can include (letters, digits, punctuation, whitespace, and escape sequences). Source encoding is usually ASCII or UTF-8 for comments and string literals, but identifiers are traditionally in the basic source character set.\nExample: character literal \'A\', escape sequences like \'\\n\' and \'\\\\\' in strings.\n\nIn simple terms : The C character set is a collection of all valid symbols you can use to write code.',1,1,'2025-11-20 06:41:48.935022','2026-01-08 12:05:58.368783',3),(6,'58f40dd760d149b4a5368fbdf56e0006','Tokens in C','Tokens are the smallest individual units of a C program that are meaningful to the compiler.\nCORE CATEGORIES OF C TOKENS:\n1)Keywords:	Reserved words with predefined meanings for the compiler\n    Examples :int, while, return, if\n2)Identifiers: User-defined names for variables, functions, or arrays \n    Examples: total_sum, main, age, _count\n3)Constants:	Fixed values that do not change during program execution \n    Examples:10, 3.14, \'A\', \"Hello\"\n4)Strings: Sequences of characters enclosed in double quotation marks \n    Examples: \"C-Language\", \"2026\"\n5)Special Symbols: Characters with specific syntactic roles in C code \n    Examples:[], {}, (), ;, ,\n6)Operators: Symbols that perform mathematical or logical operations \n    Examples:+, -, *, /, ==, &&\n\nThe \"best of the best\" content always includes a real-world dissection. Show your readers how the compiler actually \"sees\" a line of code.\n\nLine of Code: int sum = 10 + 20;\n\nThe Tokens Identified:\n\nint  Keyword\n\nsum  Identifier\n\n=  Operator (Assignment)\n\n10  Constant\n\n+  Operator (Arithmetic)\n\n20  Constant\n\n;  Special Symbol (Terminator)',1,1,'2025-11-20 06:42:22.705261','2026-01-08 12:23:21.284247',3),(7,'413cb83a21ef459f963acafa650b198d','Constants','A constant is a value that cannot be changed during program execution.\n\nInteger Constants: Whole numbers like 10, -500, 0.\n\nReal (Floating-point) Constants: Numbers with decimals like 3.14, -0.001.\n\nCharacter Constants: A single character in single quotes like \'A\', \'7\', \'$\'.\n\nString Constants: Sequence of characters in double quotes like \"Hello C\".\n\nExample : \n#define PI 3.14159\nconst int MAX_USERS = 100;',1,1,'2025-11-20 06:43:47.946646','2026-01-08 12:07:31.105073',3),(8,'d21437d5747745488a705f5acf6e227d','Keywords','Keywords are reserved words with predefined meanings for the compiler. You cannot use them as variable names.\n\nStandard Keywords (32): \nauto, break, case, char, const, continue, default, do, double, else, enum, extern, float, for, goto, if, int, long, register, return, short, signed, sizeof, static, struct, switch, typedef, union, unsigned, void, volatile, while.',1,1,'2025-11-20 06:44:43.967614','2026-01-08 12:23:49.605084',3),(9,'96bac7ec529548f5a9fb754cb3c2ec38','Identifiers','In the C language, an Identifier is the programmer-assigned name for variables, functions, arrays, and structures. If a Keyword is a command the language owns, an Identifier is a label that you own.\nExamples of identifier: \nint amount; \ndouble _bal7nb; \nHere ,  amount and  _bal7nb are identifiers.\n\nRules for naming identifiers in C:\n\n1) Every identifier must follow these strict rules to be accepted by the C compiler:\n2) Initial Character: Must start with a letter (A-Z or a-z) or an underscore (_). It cannot begin with a digit.\n3) Allowed Characters: Can only contain letters, digits (0-9), and underscores.\n4) No Reserved Words: You cannot use keywords (like int, while, return) as identifiers.\n5) Case Sensitivity: C treats uppercase and lowercase differently; myVar and myvar are two separate identifiers.\n6) No Special Symbols: Spaces and characters like @, #, $, %, or - are strictly prohibited.\n\n\nTypes of identifier: \nThere are two types of identifier: \n1. Internal Identifier \n2. External Identifier \n\n1. Internal identifier : Identifiers which are used as a local variable or are not used in external linkage are called internal identifiers.\n2. External identifier: Identifiers which are used as a global variable or used for naming function or any other external linkage are called external identifiers. \n',1,1,'2025-11-20 06:45:08.769686','2026-01-08 12:31:48.503681',3),(10,'f2d4785f435c4b6c98381ada66a8c84a','Operators','Operators are symbols used to perform operations on variables (operands).\n\nArithmetic Operators: Used for math calculations.\n\n+ Addition\n\n- Subtraction\n\n* Multiplication\n\n/ Division\n\n% Modulo (returns the remainder)\n\nRelational Operators: Used to compare two values.\n\n== Equal to\n\n!= Not equal to\n\n> Greater than\n\n< Less than\n\nLogical Operators: Used to combine two or more conditions.\n\n&& Logical AND (True if both are true)\n\n|| Logical OR (True if at least one is true)\n\n! Logical NOT (Reverses the state)\n\nAssignment Operator:\n\n= Assigns the value on the right to the variable on the left.',1,1,'2025-11-20 06:45:25.682960','2026-01-08 12:27:35.106082',3),(11,'8c84133a48374eda9c1dba58d096f360','Variables','A variable in C is a named piece of memory which is used to store data and access it whenever required.\n // integer variable\n    int age = 20;\n\n    // floating-point variable\n    float height = 5.7;\n\n    // character variable\n    char grade = \'A\';\n\nRules for Naming Variables in C:\nWe can assign any name to a C variable as long as it follows the following rules:\n\n1) A variable name must only contain letters, digits, and underscores.\n2) It must start with an alphabet or an underscore only. It cannot start with a digit.\n3) No white space is allowed within the variable name.\n4) A variable name must not be any reserved word or keyword.\n5) The name must be unique in the program.\n\nC Variable Initialization:\n\n // 1. Initialization at the time of declaration\n    int age = 20;\n    float height = 5.7;\n\n    // 2. Initialization after declaration\n    char grade;\n    grade = \'A\';',1,1,'2025-11-20 06:45:48.760013','2026-01-08 12:44:36.970187',3),(12,'1e7c89d8d8764f49af3e7953a142144b','Data-types','Data types define the type of data a variable can hold and how much space it takes in memory.\n\nBasic Data Types:\n\n int: For integers (e.g., 5, -100). Size: 2 or 4 bytes.\n\n float: For single-precision decimals (e.g., 5.75). Size: 4 bytes.\n\n double: For double-precision decimals (e.g., 3.14159). Size: 8 bytes.\n\n char: For single characters (e.g., \'A\'). Size: 1 byte.\n\nDerived Types: \n Arrays: int marks[5] = {90, 85, 88, 92, 80};\n Pointers: int x = 10;\n                      int *ptr = &x;\n Structures: \n     struct Student {\n          int id;\n          char name[20];\n          float marks;\n      };\n\n Unions:\n       union Data {\n       int i;\n       float f;\n       };\n\n\nVoid Type: Represents \"no value\" or \"empty\".',1,1,'2025-11-20 06:46:14.410172','2026-01-08 12:46:02.720598',3),(13,'531553cd1d7e4025ab413711615a4bf8','Integer Representation in C','In C programming, integers such as 10, -10, or 0 are stored inside the computers memory in binary format. Understanding how integers are represented helps in learning data storage, bitwise operations, overflow, and low-level programming.\n\nBinary System: Computers only understand 0 and 1. An integer 5 is stored as 101.\n\nSigned Integers: Use the Most Significant Bit (MSB) as a sign bit.\n\n 0 = Positive\n\n 1 = Negative\n\nTwo\'s Complement: Negative integers are stored using this method.\n\n Step 1: Find binary of the positive number.\n\n Step 2: Flip bits (1 to 0, 0 to 1).\n\n Step 3: Add 1 to the result.',1,1,'2025-11-20 06:46:57.665761','2026-01-08 12:48:57.649333',3),(14,'f1f860e8a9c7406fa12c2a308ed128b5','Formatted input Statement [scanf]','The scanf() function in C is a formatted input statement used to read data from the standard input (usually the keyboard).\n\nSYNTAX:\nscanf(\"format_string\", &variable1, &variable2, ...);\nMeaning of Syntax: format_string: A string containing format specifiers (e.g., %d, %f, %c, %s) and optional literal characters to match the input pattern.\n&variable1, &variable2, ...: The addresses of the variables where the input values will be stored. The ampersand (&) is the address-of operator.',1,1,'2025-11-20 06:47:50.286240','2026-01-08 12:47:32.562781',3),(15,'4f18e5c5171844619ae50387b462ade8','Formatted output Statement [printf]','The printf() function in C is a formatted output statement used to display data on the standard output (usually the screen).\n\nSYNTAX:\nprintf(\"format_string\", expression1, expression2, ...);\n\nMeaning of Syntax:\nformat_string: A string containing format specifiers (e.g., %d, %f, %c, %s) and optional literal characters that control how the output is displayed.\n\nexpression1, expression2, ...: Values (variables or constants) whose contents will be printed according to the corresponding format specifiers in the format_string.',1,1,'2025-11-20 06:48:13.875502','2026-01-08 12:49:52.853605',3),(16,'7b62ac4c61684ff3923d82024bfb6df5','Unformatted input Statement [getchar]','getchar() is used to read a single character from standard input (keyboard).\n\nSYNTAX:\nch = getchar();\nMeaning of Syntax:\n\ngetchar(): Reads one character from the input buffer and returns it as a value of type int.\nch: A variable (usually of type char or int) that stores the character returned by getchar().\n\nExample:\nprogram:\n#include <stdio.h>\nint main() {\n    int character; // Use int to safely store the return value (including EOF)\n    printf(\"Enter a character: \");\n    character = getchar(); // Reads a single character from the user\n    printf(\"You entered: %c\\n\", character);\n    return 0;\n}\n\nOutput:\nEnter a character: V\nYou entered: V',1,1,'2025-11-20 06:48:42.493428','2026-01-08 12:52:59.676277',3),(17,'6549823646374b6ab4f0a570eadb13e2','Unformatted input Statement [gets]','gets() is an unformatted input function used to read an entire line of text (a string) from standard input until a newline (\\n) is encountered. \n\nSYNTAX:\ngets(str);\nMeaning of Syntax:\ngets(): Reads characters from the keyboard until the user presses Enter, then stores them in the character array and appends a terminating \'\\0\' (string end).\nstr: A character array (string) with enough space to hold all input characters plus the null terminator.',1,1,'2025-11-20 06:49:23.649075','2026-01-08 12:57:54.997961',3),(18,'ea31ebc4f44843b5aca9acc7697ebf5b','Unformatted output Statement [putchar]','putchar() is used to display a single character on the standard output (screen).\n\nSYNTAX:\nputchar(character);\n\nMeaning of Syntax:\nputchar(): Writes exactly one character to the terminal screen at the current cursor position.\ncharacter: The character constant (e.g., \'A\') or the variable containing a character that you want to display.\n\nExample:\nProgram:\n#include <stdio.h>\nint main() {\n    char ch = \'V\'; \n    printf(\"The character is: \");\n    putchar(ch); // Displays a single character stored in variable ch\n    putchar(\'\\n\'); // Displays a newline character\n    return 0;\n}\n\nOutput:\ntext\nThe character is: V',1,1,'2025-11-20 06:49:43.747290','2026-01-08 12:55:22.554301',3),(19,'2274fdb888634c9fbeaee84ea52900c2','Unformatted output Statement [puts]','puts() is an unformatted output function in C used to display a string on the output screen.\nIt is declared in the header file <stdio.h> and is used when no formatting is required.\nThe function automatically appends a newline character (\\n) after printing the string.\nputs() can print only strings and cannot display variables with format specifiers.\nIt is simpler and faster than printf() for plain text output.\nExample : #include <stdio.h>\n\nint main() {\n    puts(\"C Programming\");\n    puts(\"Using puts function\");\n    return 0;\n}',1,1,'2025-11-20 06:50:14.586928','2026-01-08 12:55:30.258750',3),(20,'d427fdaba77640d5817d8994f51315c9','Commonly used Mathematical Functions','C provides several built-in mathematical functions that help perform common calculations such as square roots, powers, rounding, and absolute values. These functions are defined in the math library.\n\nTo use mathematical functions in C, you must include the following header file:\n\n #include <math.h>\n\nSome systems also require linking the math library while compiling:\n\n gcc program.c -lm\n\n1. Square Root Function  sqrt()\n\nThe sqrt() function is used to calculate the square root of a number.\n\n Syntax:\nsqrt(x)\n\n Parameter:\nx must be a non-negative number\n\n Return type:\nReturns a value of type double\n\nExample:\n#include <stdio.h>\n#include <math.h>\n\nint main() {\n    double result = sqrt(25);\n    printf(\"Square root of 25 is %.2f\", result);\n    return 0;\n}\n\nOutput:\nSquare root of 25 is 5.00\n\nImportant points:\n Passing a negative number results in an invalid value\n Always store the result in a double variable\n\n2. Power Function  pow()\n\nThe pow() function calculates a number raised to a given power.\n\n Syntax:\npow(x, y)\n\n Meaning:\nx raised to the power y (x)\n\n Return type:\nReturns a double\n\nExample:\n#include <stdio.h>\n#include <math.h>\n\nint main() {\n    double value = pow(2, 3);\n    printf(\"2 raised to power 3 is %.0f\", value);\n    return 0;\n}\nOutput:\n2 raised to power 3 is 8\nNotes:\n Both base and exponent can be decimal\n Result is always double\n\n3. Absolute Value Function  abs()\n\nThe abs() function returns the absolute (positive) value of an integer.\n\n Syntax:\nabs(x)\n\n Parameter:\nx must be an integer\n\n Return type:\nReturns an integer\n\nExample:\n#include <stdio.h>\n#include <stdlib.h>\n\nint main() {\n    int num = -15;\n    printf(\"Absolute value is %d\", abs(num));\n    return 0;\n}\nOutput:\nAbsolute value is 15\n\nNotes:\n abs() works only with integers\n For floating-point numbers, use fabs()\n\n\nImportant Notes for Students\n\n All math functions return double values\n Include <math.h> before using them\n Use -lm while compiling if required\n Use correct data types to avoid warnings',1,1,'2025-11-20 06:51:16.328193','2026-01-08 12:56:50.750080',3),(21,'0b76b54b008f47009facc25698fe4f6d','Structure of C Program','#include <stdio.h>\nint main() {\n    printf(\"Hello, World!\\n\");\n    return 0;\n}     \n\nStructure Breakdown\nPreprocessor Directive\n#include <stdio.h> is a preprocessor instruction processed before compilation. It copies the entire contents of the standard input/output header file (stdio.h) into your program. This gives access to essential functions like printf() for output and scanf() for input.\n\n\nMain Function Declaration\nint main() { declares the program\'s entry point. The compiler/OS always starts execution here. int specifies that main returns an integer value (0 for success), and empty () means it takes no command-line arguments.\n\n\nprintf Function Call\nprintf(\"Hello, World!\\n\"); calls the print function from stdio.h. The string literal \"Hello, World!\\n\" is the format string - \\n creates a newline. Semicolon ; ends every statement in C.\n\n\nReturn Statement\nreturn 0; terminates main() and sends status code 0 back to the operating system. Convention: 0 = success, non-zero = error. The matching } closes the main function block',1,1,'2025-11-20 06:52:15.726319','2026-01-08 12:40:22.360603',3),(23,'1edc8319ef2b488294926468714f203c','Practice Questions','',1,1,'2025-11-20 06:53:03.969923','2025-11-20 06:53:03.969944',3),(24,'b800e726ac9a4d59a8f4ec01669cd342','Expression Evaluation','Expression Evaluation is the process by which the compiler computes a single value from a combination of constants, variables, operators, and function calls.\n\nHow Evaluation Works:\nWhen the C compiler encounters an expression, it determines the order of operations based on the strict rules: \n1) Parentheses first: Sub-expressions within parentheses are evaluated before the rest of the expression.\n2) Precedence rules: Operators with higher precedence are evaluated before those with lower precedence.\n3) Associativity rules: If multiple operators have the same precedence, the associativity rule (usually left-to-right for arithmetic) determines the order. \nConsider the expression: ans = 12 + 18 / 3 * 2 - (5 + 1);\n1) Parentheses:\n(5 + 1) is evaluated first  6.\n2) Expression becomes: 12 + 18 / 3 * 2 - 6.\nMultiplication and Division (left-to-right):\n18 / 3  6 (integer division).\nNow: 12 + 6 * 2 - 6.\n6 * 2  12.\nExpression becomes: 12 + 12 - 6.\n3) Addition and Subtraction (left-to-right):\n12 + 12  24.\n24 - 6  18.\nFinal value: ans = 18.\n',1,1,'2025-11-20 06:56:00.827809','2026-01-08 12:41:39.164087',3),(25,'5208679026a8456cb3260a45cd67002f','Comments','#include <stdio.h>\n/* This is a multi-line comment explaining the program */\nint main() {\n    printf(\"Hello, World!\\n\"); // Single-line comment for printf\n    return 0;\n}\nComments improve code readability for coders and people who try to understand code later. They document complex logic, function purposes, and algorithm explanations without affecting program execution.\nSingle-Line Comments\nUse // to start a comment that extends to the end of the line \nMulti-Line Comments\nEnclose text between /* and */ to comment multiple lines or blocks',1,1,'2025-11-20 07:20:19.977108','2026-01-08 12:44:34.268828',3),(26,'1f1983b650cc434895f8dded548dda1c','Python Intro','',1,1,'2025-11-21 08:14:26.783150','2025-11-21 08:37:22.516658',4),(27,'f8871bdc7f234d6c868d0dee21809905','Python Syntax','',1,1,'2025-11-21 08:56:13.756274','2025-11-21 08:56:13.756296',4),(28,'9ac3b44bab7f418d9a59945963884960','Python Data Types','Python datatypes define the type of data a variable can hold, allowing Python to understand how the data should be stored and manipulated. The main built-in datatypes include numbers (int, float, complex), strings for text, booleans for True/False values, and collections such as lists, tuples, sets, and dictionaries. Each datatype has its own propertiesfor example, lists are mutable while tuples are immutable. Python automatically assigns datatypes based on the value given, making it dynamically typed. These datatypes form the foundation for writing efficient programs and handling different kinds of data in Python applications.',1,1,'2025-11-21 09:51:26.663631','2025-11-21 09:51:26.663652',4),(29,'e16464905c9347d29988f90f6495d5a9','Python Numbers','Python Numbers refer to the numeric data types used to store and manipulate numerical values in Python programs. The main number types are integers (int) for whole numbers, floating-point numbers (float) for decimal values, and complex numbers (complex) for numbers with real and imaginary parts. Python allows seamless arithmetic operations across these types and automatically converts between them when needed. These number types are widely used in calculations, data analysis, scientific computing, and mathematical applications. Python also provides built-in functions and libraries to handle advanced number operations efficiently.',1,1,'2025-11-21 10:10:58.997623','2025-11-21 10:10:58.997644',4),(30,'b47220c560b946fab1030c45ffc94dc1','Python Operators','Python operators are special symbols used to perform operations on variables and values. They include arithmetic operators for calculations, comparison operators for checking conditions, logical operators for combining boolean expressions, and assignment operators for storing values. Python also provides bitwise operators for manipulating binary data and membership or identity operators for checking relationships between objects. These operators help build expressions and control program logic, making Python code more interactive and functional.',1,1,'2025-11-21 10:25:12.892039','2025-11-21 10:25:12.892060',4),(31,'4825fe014c67414799f6c3af78f32f54','Python Lists','Python lists are ordered, mutable collections used to store multiple items in a single variable. They can hold elements of different data types, such as numbers, strings, or even other lists. Lists support indexing and slicing, allowing easy access and modification of elements. They also provide a wide range of built-in methods for adding, removing, and manipulating data. Because lists can grow or shrink dynamically, they are one of the most flexible and commonly used data structures in Python.',1,1,'2025-11-21 11:26:25.540952','2025-11-21 11:26:25.540972',4),(37,'e107a13f5ef1422babf1c06b21951714','Python Sets','Python sets are unordered, mutable collections that store unique elements, making them ideal for removing duplicates and performing fast membership tests. Sets do not allow indexing or duplicate values, and their elements must be immutable types like numbers or strings. They support mathematical set operations such as union, intersection, difference, and symmetric difference, which are useful for comparing and filtering data. Since sets are implemented using hash tables, operations like lookup and addition are very efficient. Overall, Python sets provide a powerful and simple way to manage distinct data in various applications.',1,1,'2025-11-22 07:30:58.798629','2025-11-22 07:30:58.798649',4),(38,'25397590158844f1872f8fc1d61aef5f','tert','ret',1,1,'2025-11-22 07:44:47.250819','2025-11-22 07:44:47.250838',7),(39,'bc390762202f4927902b60ce1a87fb46','errt','ert',1,1,'2025-11-22 07:45:05.903200','2025-11-22 07:45:05.903221',7),(40,'5efc2fe4ec0345538069a4505d942f5a','DevOps Tutorial','DevOps Tutorial',1,1,'2025-11-28 10:20:14.675819','2025-11-28 10:20:14.675840',7),(43,'ae47df7e25bb40fba6982ae37367fd1e','Java Introduction','Introduction to Java',1,1,'2025-12-01 06:26:01.431204','2025-12-11 08:00:26.309705',9),(45,'a4cf68c6c0e54f919c4856c311ba3d9a','What is Django?','A gentle introduction to Django, explaining what it is, why people use it, and how it helps you build websites using Python.',0,1,'2025-12-10 06:08:52.658493','2025-12-10 06:08:52.658515',6),(46,'8b6dba31398747398ecd1aadcd576752','Getting Django Installed and Running','Stepbystep guide to install Python and Django, create a new Django project, and see the first page in your browser.',0,1,'2025-12-10 06:09:08.711494','2025-12-10 06:09:08.711513',6),(47,'0cce3d97a41040b7b6272477fe823a4e','Understanding Project and App Folders','Explains the main files and folders created by Django, and shows how projects and apps are organized.',0,1,'2025-12-10 06:09:24.818404','2025-12-10 06:09:24.818426',6),(48,'6f2c40cad461487e9df64af8b7bd7d94','Handling Web Addresses (URLs) and Views','Shows how a browser request for a URL is connected to a Python function (view) that sends back a response.',0,1,'2025-12-10 06:09:43.787816','2025-12-10 06:09:43.787835',6),(49,'f9eb23d57e07461f9c35b0fb54b60fd5','Showing Data with HTML Pages (Templates)','Teaches how to use HTML template files to display data, instead of writing HTML directly inside Python code.',0,1,'2025-12-10 06:10:40.485259','2025-12-10 06:10:40.485279',6),(50,'254fc55e2d1e4daf94b068bf83d747a1','Storing Data with Models','Introduces models as Python classes that map to database tables, and explains how Django saves and reads data.',0,1,'2025-12-10 06:11:06.257819','2025-12-10 06:11:06.257841',6),(51,'015b4ee26a094e0ab6235d3c3c7f84a5','Using the Admin Panel to Manage Data','Shows how to log into Djangos builtin admin site and use it to add, edit, and delete records easily.',0,1,'2025-12-10 06:11:21.324010','2025-12-10 06:11:21.324031',6),(52,'b35cebbcbf6f41f2a623a4f88fcf750d','Adding, Viewing, Editing and Deleting Records (CRUD)','Builds pages where users can create, list, update, and remove data from the database through the website.',0,1,'2025-12-10 06:11:34.670736','2025-12-10 06:11:34.670759',6),(53,'79deef004f244bd3bedd86f91bdfc647','Working with Template Tags and Loops','Explains how to use special tags in templates for conditions and loops, so you can repeat HTML and show dynamic content.',0,1,'2025-12-10 06:12:07.415416','2025-12-10 06:12:07.415437',6),(54,'c66fa62799d74673a3c9495d960c58ec','Using Static Files (CSS, Images, JS)','Teaches how to add styling, images, and JavaScript files to your pages and link them correctly in templates.',0,1,'2025-12-10 06:12:37.564925','2025-12-16 10:25:42.412493',6),(55,'1620b6b607e540198b617af7222c717d','Connecting to a Real Database','Shows how to configure Django to use a full database server instead of the default simple database.',0,1,'2025-12-10 06:13:01.671193','2025-12-10 06:13:01.671212',6),(56,'c35b6d86702348a988431e10959ffeac','Searching and Filtering Data (QuerySets)','Explains how to fetch, filter, sort, and count records from the database using Djangos query features.',0,1,'2025-12-10 06:13:16.424960','2025-12-10 06:13:16.424981',6),(57,'abd66e750221434fa7c9cc8fdcce0a81','Building Simple Forms and Validating Input','Teaches how to create forms, receive user input, check if the data is valid, and handle errors.',0,1,'2025-12-10 06:13:32.634309','2025-12-10 06:13:32.634330',6),(58,'3151c3a4c15c4519a76311c605f23f0b','Creating a Small Django MiniProject','Combines everything learned so far into a small, complete app that solves a simple realworld problem.',0,1,'2025-12-10 06:13:46.494845','2025-12-10 06:13:46.494865',6),(59,'cad7ef6a2ca44b62b0a6f9399421528b','Using the Admin Panel to Manage Data','Shows how to log into Djangos builtin admin site and use it to add, edit, and delete records easily.',0,1,'2025-12-10 06:21:25.401243','2025-12-10 06:21:25.401263',6),(60,'f885dcc3e78c4dde843e131956353011','Getting Your Django Site Online (Deployment)','Gives an overview of how to move your Django project from your computer to an online server.',0,1,'2025-12-10 06:23:44.299728','2025-12-10 06:23:44.299748',6),(61,'e83fec483946498e9edbec7941e2ca94','Decision making in C','Decision-making structures require that the programmer specifies one or more conditions to be evaluated or tested by the program.\n\nSimple if Statement\n\n Evaluation: If the condition is true, the block of code runs. If false, it is skipped.\n\n Common Error: Using = (assignment) instead of == (comparison) inside the if condition.\n\nif-else Statement\n\n Evaluation: Provides a \"Plan B.\" One of the two blocks must execute.\n\nThe else-if Ladder\n\n Use Case: When you have multiple mutually exclusive conditions (e.g., grading system: A, B, C, or Fail).\n\nNested if\n\n Concept: An if statement inside another. Used for complex logic like checking if a number is positive AND even.\n\nThe Ternary Operator (?:)\n\n A shorthand for if-else.\n\n Syntax: condition ? value_if_true : value_if_false;',1,1,'2026-01-08 17:21:59.869977','2026-01-09 01:02:42.149726',3),(63,'7c6c794eb08c42fb8e5102a93aec5538','Flow control in C','These statements unconditionally transfer program control from one point to another.\n\n1. break Statement\n\n Usage: \"Jumps out\" of the innermost loop or switch block immediately.\n\n2. continue Statement\n\n Usage: \"Skips\" the remaining code in the current iteration and jumps to the next loop update/test.\n\n3. goto Statement\n\n Concept: Moves control to a specific label:.\n\n Note: In modern programming, goto is discouraged because it creates \"spaghetti code\" that is hard to debug.',0,1,'2026-01-08 17:24:22.909780','2026-01-09 01:04:39.650801',3),(64,'b213d2afe8d94f7fbafc45d4118d8877','Switch statements in C','A switch statement tests a single variable against a series of constants known as cases.\n\nKey Rules:\n\n The expression must result in an integer or character. Floats are not allowed.\n\n case labels must be unique constants.\n\n The \"Fall-through\" Effect: If you forget a break, C will execute every case below the matching one until it hits a break or the end of the switch.\n\ndefault Case: Acts as a catch-all. Its good practice to always include one for unexpected inputs.',0,1,'2026-01-08 17:25:35.790259','2026-01-09 01:05:21.462067',3),(65,'68b4edd7483f4c6abf5ee211203aebd2','Functions in C','Functions in C are self-contained blocks of code that perform specific tasks, helping to organize programs and make code reusable.\n\nSYNTAX:\nreturn_type function_name(parameter_list) {\n    // body of the function\n}\n\nExplanation of each part:\n1) Return type: Specifies the type of value the function will return. Use void if the function does not return anything.\n2) Function name: A unique name that identifies the function. It follows the same naming rules as variables.\n3) Parameter list: A set of input values passed to the function. If the function takes no inputs, this can be left empty or written as void.\n4) Function body: The block of code that runs when the function is called. It is enclosed in curly braces { }.\n\nExample:\n#include <stdio.h>\n// Function definition\nint add(int a, int b) {\n    return a + b;   // returns sum of a and b\n\nint main() {\n    int x = 5, y = 7, result;\n    result = add(x, y);   // function call\n    printf(\"Sum = %d\\n\", result);\n    return 0;\n}\nThis example shows a user-defined function add() with parameters, a return type int, and a call from main() to use it.\n\nCORE CONCEPTS OF FUNCTION:\n1)Function Declaration: Tells the compiler the function\'s name, return type, and parameters before it is used.\n2)Function Definition: Contains the actual body of code that executes when the function is called.\n3)Function Call: The statement that executes the function, often passing values (arguments) and receiving a result.\n\nTYPES OF FUNCTION:\n1)Standard Library Functions: Built-in functions like printf(), scanf(), and getchar() that are defined in header files like <stdio.h>.\n2)User-Defined Functions: Functions created by the programmer to perform custom operations.',1,1,'2026-01-08 17:28:17.583961','2026-01-09 02:24:38.013250',3),(66,'2e18ca975c3b4f6882da2d7229807714','Arrays','An Array is a fixed-size collection of elements of the same data type stored in contiguous memory locations.\n\nSYNTAX AND DECLARATION:\nYou must specify the data type, the name of the array, and the size in square brackets [].\n\nSyntax:\ndata_type array_name[array_size];\n\nExample:\nint marks[5]; // Declares an array that can hold 5 integers.\n\nImporrtant Rules to Remember:\n1)Zero-Based Indexing: The first element is always at index 0, not 1. If an array has 5 elements, the indices are 0, 1, 2, 3, 4.\n\n2)Index Out of Bounds: Accessing an index like marks[5] in a size-5 array will cause an error because the last valid index is 4.\n\n3)Initialization: You can assign values using curly braces {}:\nint numbers[3] = {10, 20, 30};\n\nCore Concept:\n1)Contiguous Memory: All elements are stored side-by-side in memory, like rooms in a hallway.\n2)Same Data Type: You can\'t mix int and float in the same array; it must be all integers or all characters.\n3)Fixed Size: Once you tell the compiler the array size, it cannot be changed during the program\'s execution',0,1,'2026-01-08 17:28:43.832623','2026-01-09 02:29:28.647393',3),(68,'7a8ff10da12844a7979ee87724f60aad','Pointers','',0,1,'2026-01-08 17:29:12.046735','2026-01-08 17:29:12.046754',3),(69,'bbac5115af224ae198844fab5f468cbf','Structures','',0,1,'2026-01-08 17:29:30.395346','2026-01-08 17:29:30.395377',3),(70,'28068270a055444196b1bdddf25cdee9','Memory management in C','Memory management in C is the process by which a program monitors and controls the allocation and deallocation of memory during its execution.\n\nThe memory layout of a program shows how its data is stored in memory during execution. It helps developers understand and manage memory efficiently.\n1)Memory is divided into sections such as code, data, heap, and stack.\n2)Knowing the memory layout is useful for optimizing performance, debugging and prevent errors like segmentation fault and memory leak.\n\nTHE TWO PILLARS OF MEMORY:\n-The computer\'s RAM as being divided into two main areas for your program:\n\n1)The Stack (Automatic Memory)\nSpeed: Super fast; the computer handles it for you.\nLifetime: Temporary; variables disappear when the function ends.\nBest for: Local variables and small data (like int x).\nAnalogy: A stack of dinner plates; you only ever touch the one on top.\n\n\n2)The Heap (Manual Memory)\nSpeed: Slower; you have to ask for space manually.\nLifetime: Permanent; stays there until you explicitly \"free\" it.\nBest for: Large data and things you need to keep across different functions.\nAnalogy: A parking lot; you rent a space, use it, and must \"leave\" to let others in\n\n\n\nDYNAMIC MEMORY ALLOCATION FUNCTIONS:\n\n1)malloc() (Memory Allocation): Allocates a specified number of bytes and returns a void pointer to the start of the memory block. The allocated memory is uninitialized (contains garbage values).\n2)calloc() (Contiguous Allocation): Allocates memory for an array of a specified number of elements and size, and initializes all bytes to zero. It\'s often used for arrays where initial values need to be zero.\n3)realloc() (Re-allocation): Changes the size of a previously allocated memory block. It can increase or decrease the size and attempts to preserve the data within the original block.\n4)free(): Deallocates a memory block that was previously allocated by malloc(), calloc(), or realloc(). It is the programmer\'s responsibility to call free() for every allocation to prevent memory         leaks.',0,1,'2026-01-08 17:29:51.919142','2026-01-09 02:52:11.682076',3),(71,'7e141024a7c64bb89d038cedbad11376','File handling in C','File handling in C allows a program to store data permanently on a disk rather than losing it when the program ends. \n\nTHE 3-STEP WORKFLOW:\nEvery file operation in C must follow this sequence to avoid errors and memory leaks:\n1)Open the File: Use fopen() to create a connection between your program and the disk file.\n2)Process Data: Read from or write to the file using functions like fprintf() or fscanf().\n3)Close the File: Use fclose() to break the connection and ensure all data is saved correctly.\n\n\nESSENTIAL FUNCTIONS:\n1)fopen(\"filename\", \"mode\"): Opens a file. Modes include \"r\" (read), \"w\" (write/overwrite), and \"a\" (append/add to end).\n2)fprintf(): Writes formatted data to a file (works just like printf).\n3)fscanf(): Reads formatted data from a file (works just like scanf).\n4)fclose(file_pointer): Safely closes the file and frees up system resources.\n\n\nFILE POINTER:\nSyntax: FILE *fptr;\nAnalogy: Think of the FILE pointer as a \"bookmark.\" It keeps track of where you are currently reading or writing inside the file.',0,1,'2026-01-08 17:30:12.962387','2026-01-09 02:56:10.504568',3),(75,'7089004fc87541a8a6361b86db8c0a17','Error Handling','Error handling in C is different from modern languages like Python or Java because it does not have \"try-catch\" blocks. Instead, it uses return values and global error codes to let you know when something went wrong.\n\nThe Three Main Error Types:\n\n1)Syntax Errors: These occur when you break the \"grammar\" of C (e.g., forgetting a semicolon). The compiler will catch these before the program even runs.2)\n2)Runtime Errors: The program runs but crashes during execution, such as when dividing by zero or trying to open a file that doesn\'t exist.\n3)Logical Errors: The program runs without crashing but gives the wrong output because the math or logic is incorrect.\n\nEssential Error Handling Tools:\n\nC provides a special library, <errno.h>, and functions to translate computer errors into human-readable messages.\n1)errno (Error Number): A global variable that stores a numeric code for the last error that occurred.\n2)perror(): Prints a message you choose, followed by a colon and the system\'s explanation of the error.\n3)strerror(): Returns a pointer to a string that describes the error associated with a specific errno.\n4)exit(): Ends the program immediately. Using exit(EXIT_FAILURE) tells the computer the program stopped because of an error.',1,1,'2026-01-08 17:36:20.016384','2026-01-09 03:02:11.951626',3),(76,'c36719ff6ef94e6088de7b11903ee269','Strings in C','',0,1,'2026-01-08 17:36:55.868238','2026-01-08 17:36:55.868257',3),(81,'87b335eea962464a9a0f2182af01a3bc','new1','ewr',1,1,'2026-01-10 11:03:21.050696','2026-01-10 11:03:21.050716',3),(82,'a1d36d2c1fbd4a6a85d44d2bac64d2e3','Installing a C compiler','',0,1,'2026-01-15 02:28:34.519412','2026-01-15 02:28:34.519434',3),(85,'ed0107a2d4d84cdb83a794ad862021ef','loops in c','',1,1,'2026-01-15 06:58:00.667735','2026-01-15 06:59:12.464582',3);
